INSERT INTO `health_brands` (`id`, `title`, `description`, `top_brand`, `images`) VALUES
(1, 'Ultimate Nutrition', 'Ultimate Nutrition was founded in 1979 by Victor H. Rubino. At the time Victor was one of the top amateur power lifters in the United States. Driven by a goal to become the best, Victor knew that supplements were the key to improving his performance through increased strength and faster recovery. Not satisfied with the current supplements that were available to him the 1970s and being a biochemist himself, Victor decided to launch his own company Ultimate Nutrition. Victors goal was to create high quality, thoroughly researched products at an affordable price for everyone.', 0, 'ultimate-nutrition-logo.png'),
(2, 'MuscleTech', 'MuscleTech is a brand of dietary supplements, marketed by Iovate Health Sciences Inc., which includes Hydroxycut. It was owned by Canadian company Kerr Holdings which was acquired by the Xiwang Foodstuffs Company, a Chinese company, for $5.84 million in 2016.[1]\r\n\r\nIn 1998, MuscleTech launched Cell-Tech, a creatine-carbohydrate-alpha lipoic acid supplement.[2]', 0, 'MT-Logo-INT.png'),
(4, 'On (Optimum Nutrition)', 'Optimum Nutrition, Inc. (ON) is part of Glanbia , a leading international cheese and nutritional ingredients group. ON owns and operates two premium sports nutrition brands, Optimum Nutrition and American Body Building (A.B.B.). Together, these brands provide active adults around the world with a comprehensive line of powdered, bar, tablet, capsule and ready to drink products.', 0, '');
