(13, 'FAQs', 'faq', '', '<p>FAQs question and Answers</p>\r\n', 'Demo static page', 'demo;static page', 'Demo static page', 1, '', 'media/assets/banner/banner3.jpg', 0, '2018-08-20 00:00:00'),
(21, 'Careers', 'career', '<div data-id=\"144\" class=\"row-elment col-md-12 module-54fc1f05f2541 full-width\"><div class=\"container\"><div class=\"row-content row\"><div class=\"col-elment col-md-12\"><div class=\"module-margin module-maps54fbddcd0e89a\"><div class=\"module-border\"><div class=\"module-padding\"><div class=\"module-content\"><div class=\"module-main\">{module:maps/index,142}</div></div></div></div></div></div></div></div><style>{module:row/index,144}</style></div><div class=\"row-elment col-md-12\"><div class=\"container\"><div class=\"row-content row\"><div class=\"col-elment col-md-6\"><div class=\"module-margin module-contact54b253c063867\"><div class=\"module-border\"><div class=\"module-padding\"><div class=\"module-content\"><div class=\"module-main\">{module:m_contact/index,6}</div></div></div></div></div></div><div class=\"col-elment col-md-6\"><div class=\"module-margin module-custom54fbde76ef7e6\"><div class=\"module-border\"><div class=\"module-padding\"><div class=\"module-content\"><div class=\"module-main\">{module:m_custom/index,143}</div></div></div></div></div></div></div></div></div>', '<p><img alt=\"\" src=\"http://www.aldivo.com/img/uploads/aldivo_Careers1.jpg\" /></p>\r\n\r\n<p>The benefits include</p>\r\n\r\n<ol>\r\n	<li>Opportunities to work with new and emerging technologies across all technical platforms</li>\r\n	<li>Incentive programmes</li>\r\n	<li>Widespread development opportunities</li>\r\n	<li>Leadership development and training opportunities</li>\r\n</ol>\r\n\r\n<p>We are always interested in meeting highly motivated, talented people. If you would like to become a part of our team, please&nbsp;view our current openings&nbsp;below and send your resume with a covering letter to&nbsp;<strong>care@aldivo.com</strong>. Please mention the position applied for in the subject line.</p>\r\n', 'Career', '', '', 1, '', '', 0, '2017-07-04 00:00:00'),
(22, 'About us', 'about-us', '', '<p>Now a day&rsquo;s trade of Online marketing and in this era there are some categories which is not available in online, basically in Pharmaceutical&rsquo;s product.</p>\r\n\r\n<p>raeesworld is think of new generation and which is involved in supply, marketing, import and export of pharmaceuticals/cosmetics/herbal raw material through online platform.</p>\r\n\r\n<p>Mr. Gopal Kumar have 12 years experience ( East African ( India ) Overseas is an offshoot of&nbsp; East African India Remedies Private Limited )&nbsp; in well reputed pharmaceuticals formulation company in India. I get 12 years experience in pharma industries than I think for online platform for pharmaceutical raw material than to be start step by step August 2018.</p>\r\n\r\n<p>raeesworld is the preferred choice of Pharmaceutical manufacturing company given its mammoth assortment of Pharma&rsquo;s raw material, quick delivery even to the remotest corners of the country, and daily deals, discounts &amp; offers to make products available at slashed down prices to our valuable customers. Get Started! Shop Online Today at raeesworld. Simply log into raeesworld.com and browse through the wide assortment of products across categories.</p>\r\n\r\n<p>Fulfill Your Entrepreneurial Dreams! Sell Today at raeesworld Thanks to easy-to-understand, flexible policies and SD Advisors to help sellers at each step, anyone from a manufacturer to wholesaler to retailer can sell on raeesworld. Begin your entrepreneurial journey with raeesworld as a seller by filling a simple registration form here. Once the registration process is done, you can start selling your products to the entire country by sitting at your home or office.</p>\r\n', 'Welcome to our page', 'Welcome to our page Welcome to our pageWelcome to our page', 'Welcome to our page', 1, '', 'media/assets/avatar-1.jpg', 0, '2019-06-14 00:00:00'),
(25, 'Privacy Policy', 'privacy-policy', 'This electronic record is generated by a computer system and does not require any physical or digital signatures.', '<p>This electronic record is generated by a computer system and does not require any physical or digital signatures.</p>\r\n\r\n<p>The domain name www.RAEESWORLD.com (hereinafter referred to as &quot;Website&quot;) is owned by&nbsp;BN RAEESWORLD MARKETING PRIVATE LIMITED&nbsp;a company incorporated under the Companies Act, 1956 with its registered office at I-17A, Gali No.-17, Rajiv Nagar Extn., vILL. - Karala, Lal Mandir Road, Begumpur, New Delhi -110086, India.</p>\r\n\r\n<p>This service terms of this website, www. RAEESWORLD.com, (hereinafter referred to as &quot;Website&quot;) constitute a legally binding &ldquo;Agreement&rdquo; between RAEESWORLD and its Users.</p>\r\n\r\n<p>RAEESWORLD uses the maximum care as is possible to ensure that all or any data / information in respect of electronic transfer of money does not fall in the wrong hands.&nbsp;For completing online transactions involving payments a user is directed to a Payment Gateway, RAEESWORLD does not store or keep credit card data. Since the transaction happens on a third-party network not controlled by RAEESWORLD, once a credit card transaction has been completed, the payment information is not accessible to anyone at RAEESWORLD after completion of the on-line transaction at the Payment Gateway, this ensures the maximum security.</p>\r\n\r\n<p>This electronic record is generated by a computer system and does not require any physical or digital signatures.</p>\r\n\r\n<p>The domain name www.RAEESWORLD.com (hereinafter referred to as &quot;Website&quot;) is owned by&nbsp;BN RAEESWORLD MARKETING PRIVATE LIMITED&nbsp;a company incorporated under the Companies Act, 1956 with its registered office at I-17A, Gali No.-17, Rajiv Nagar Extn., vILL. - Karala, Lal Mandir Road, Begumpur, New Delhi -110086, India.</p>\r\n\r\n<p>This service terms of this website, www. RAEESWORLD.com, (hereinafter referred to as &quot;Website&quot;) constitute a legally binding &ldquo;Agreement&rdquo; between RAEESWORLD and its Users.</p>\r\n\r\n<p>RAEESWORLD uses the maximum care as is possible to ensure that all or any data / information in respect of electronic transfer of money does not fall in the wrong hands.&nbsp;For completing online transactions involving payments a user is directed to a Payment Gateway, RAEESWORLD does not store or keep credit card data. Since the transaction happens on a third-party network not controlled by RAEESWORLD, once a credit card transaction has been completed, the payment information is not accessible to anyone at RAEESWORLD after completion of the on-line transaction at the Payment Gateway, this ensures the maximum security.</p>\r\n\r\n<p>RAEESWORLD &nbsp;may, without notice in its sole discretion, and at any time, terminate or restrict your use or access to RAEESWORLD (or any part thereof) for any reason, including, without limitation, that RAEESWORLD based on its judgement and perception believes you have violated or acted inconsistently with the letter or spirit of these terms and conditions or any applicable law.</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">This Privacy policy is subject to the terms of the Site Policy (User agreement) of RAEESWORLD. This policy is effective from the date and time a user registers with RAEESWORLD by filling up the Registration form and accepting the terms and conditions laid out in the Site Policy.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">In order to provide a personalized browsing experience, RAEESWORLD may collect personal information from you. Additionally some of our websites may require you to complete a registration form or seek some information from you. When you let us have your preferences, we will be able to deliver or allow you to access the most relevant information that meets your end.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">To extend this personalized experience RAEESWORLD may track the IP address of a user&#39;s computer and save certain information on your system in the form of cookies. A user has the option of accepting or declining the cookies of this website by changing the settings of your browser.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">The personal information provided by the users to RAEESWORLD will not be provided to third parties without previous consent of the user concerned. Information of a general nature may however be revealed to external parties</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">Every effort will be made to keep the information provided by users in a safe manner, the information will be displayed on the website will be done so only after obtaining consent from the users. Any user browsing the site generally is not required to disclose his identity or provide any information about him/her, it is only at the time of registration you will be required to furnish the details in the registration form.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">A full user always has the option of not providing the information which is not mandatory. You are solely responsible for maintaining confidentiality of the User password and user identification and all activities and transmission performed by the User through his user identification and shall be solely responsible for carrying out any online or off-line transaction involving credit cards / debit cards or such other forms of instruments or documents for making such transactions and RAEESWORLD assumes no responsibility or liability for their improper use of information relating to such usage of credit cards / debit cards used by the subscriber online / off-line.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">You agree that RAEESWORLD may use personal information about you to improve its marketing and promotional efforts, to analyze site usage, improve the Site&#39;s content and product offerings, and customise the Site&#39;s content, layout, and services. These uses improve the Site and better tailor it to meet your needs, so as to provide you with a smooth, efficient, safe and customised experience while using the Site.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">You agree that RAEESWORLD may use your personal information to contact you and deliver information to you that, in some cases, are targeted to your interests, such as targeted banner advertisements, administrative notices, product offerings, and communications relevant to your use of the Site. By accepting the User Agreement and Privacy Policy, you expressly agree to receive this information. If you do not wish to receive these communications, we encourage you to opt out of the receipt of certain communications in your profile. You may make changes to your profile at any time. It is the belief of RAEESWORLD that privacy of a person can be best guaranteed by working in conjunction with the Law enforcement authorities.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(51, 51, 51); font-family:arial,sans-serif; font-size:10.5pt\">The RAEESWORLD website fully complies with all Indian Laws applicable. may disclose all or part of your personal details in response to a request from the law enforcement authorities or in a case of bonafide requirement to prevent an imminent breach of the law.</span></p>\r\n', 'Privacy Policy ', 'Privacy Policy ', 'Privacy Policy ', 1, '', '', 0, '2019-06-14 00:00:00'),
(29, 'Return Policy', 'return-policy', 'Return Policy', '<p style=\"text-align:justify\"><strong>Aldivo.com&nbsp;</strong>values the faith and trust you place in aldivo.com. That&#39;s why we maintain the highest standards for safe and secure transactions and buyerinformation privacy. Please go through with thebelow mentioned statement to learn about our information gathering and dissemination practices. We may change or update our privacy policy at any time without prior notice. To make sure you are aware of any update or changes; please review our policy time to time. By accessing the services offered by aldivo.com, you agree to the collection and use of your personal information by us in the manner provided in our Privacy Policy.</p>\r\n\r\n<p><strong>Policy for Cancellation</strong></p>\r\n\r\n<p style=\"text-align:justify\">We endeavour to reach your order to you at the earliest &ndash; printing it the same day. The alternative to cancel your order is feasible if it has not been processed by the time the cancellation request has been made. In such a case, the amount may be refunded to the customer or Point wallet. You are requested to contact our customer support team to cancel your order.</p>\r\n\r\n<p>For cancellations, you may drop an email at care@aldivo.com or call us at <span style=\"font-family:arial,helvetica,sans serif\">+91-9891-26-4324</span> along with the order details.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Policy for Return of Order</strong></p>\r\n\r\n<p><br />\r\nIn general, an item may be eligible for return within following conditions:</p>\r\n\r\n<ul>\r\n	<li>Was delivered in a physically damaged condition</li>\r\n	<li>Has missing parts or accessories</li>\r\n	<li>Is different from what was ordered</li>\r\n</ul>\r\n\r\n<p>All items must be returned in their original condition,&nbsp;original accessories and in the original manufacturer&rsquo;s box/packaging as delivered to you.</p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans serif\">For </span>Return<span style=\"font-family:arial,helvetica,sans serif\">, you may drop an email at care@aldivo.com or call us at&nbsp;+91-9891-26-4324</span><span style=\"font-family:arial,helvetica,sans serif\">&nbsp;along with the order details.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:arial,helvetica,sans serif\"><a href=\"http://www.aldivo.com\"><img alt=\"\" src=\"http://www.aldivo.com/img/uploads/aldivo3.jpg\" style=\"border-style:solid; border-width:5px; float:left; height:370px; margin:1px; width:1270px\" /></a></span></p>\r\n', 'Return Policy of aldivo.com', 'Return Policy of aldivo.com', 'Return Policy of aldivo.com', 1, '', '', 0, '2017-04-03 00:00:00'),
(30, 'Terms of use', 'terms-of-use', 'Terms of use ', '<p>The domain name www.raeesworld.com (hereinafter referred to as &quot;Website&quot;) is owned by&nbsp;BN raeesworld MARKETING PRIVATE LIMITED&nbsp;a company incorporated under the Companies Act, 1956 with its registered office at I-17A, Gali No.-17, Rajiv Nagar Extn., vILL. - Karala, Lal Mandir Road, Begumpur, New Delhi -110086, India.</p>\r\n\r\n<p>raeesworld shall not be liable for any loss or damage sustained by reason of any disclosure (inadvertent or otherwise) of any information concerning the user&#39;s account and / or information relating to or regarding online transactions using credit cards / debit cards and / or their verification process and particulars nor for any error, omission or inaccuracy with respect to any information so disclosed and used whether or not in pursuance of a legal process or otherwise.</p>\r\n\r\n<p>raeesworld will not be liable for any damages of any kind arising out of or relating to the use or the inability to use raeesworld, its content or links, including but not limited to damages caused by or related to errors, omissions, interruptions, defects, delay in operation or transmission, computer virus, line failure and all other direct, indirect, special, incidental, punitive, loss of profit, exemplary or consequential damages whether based on contract, tort or any other legal theory including Force Majeure, and whether or not, such organizations or entities were intimated or advised of the possibility of such damages.</p>\r\n\r\n<p><u>Selling</u></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As a registered Manufacturer, you are allowed to list item(s) for sale on the Website in accordance with the Policies which are incorporated by way of reference in this Terms of Use. You must be legally able to sell the item(s) you list for sale on our Website. You must ensure that the listed items do not infringe upon the intellectual property, trade secret or other proprietary rights or rights of publicity or privacy rights of third parties. Listings may only include text descriptions, graphics and pictures that describe your item for sale. All listed items must be listed in an appropriate category on the Website. All listed items must be kept in stock for successful fulfilment of sales.</p>\r\n\r\n<p>The listing description of the item must not be misleading and must describe actual condition of the product. If the item description does not match the actual condition of the item, you agree to refund any amounts that you may have received from the Buyer. You agree not to list a single product in multiple quantities across various categories on the Website. raeesworld reserves the right to delete such multiple listings of the same product listed by you in various categories.</p>\r\n\r\n<p>If the material is fail in testing then material return to suppler with proper testing/QC/QA document if suppler should call joint analysis for that material buyer can agree, buyer should not agree for joint analysis material will not return to seller.&nbsp;</p>\r\n\r\n<p>If the materials fail at buyer end seller will return back and pay the both side freight and loses of buyer end.</p>\r\n\r\n<p>Seller will not return back without any proper testing.</p>\r\n\r\n<p>Seller will accept the material with good packing/material condition if buyer damage the material at buyer end seller will not return back any condition</p>\r\n\r\n<p>Suppler always dispatch the material with proper packing in as per good condition with all required document form buyer end.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Terms of use of raeesworld.com', 'Terms of use of raeesworld.com', 'Terms of use of raeesworld.com', 1, '', '', 0, '2019-06-17 00:00:00'),
