INSERT INTO `post` (`id`, `category_id`, `post_title`, `slug`, `post_type`, `excerpt`, `route_id`, `description`, `layout`, `image`, `attachment`, `seo_title`, `seo_description`, `seo_keywords`, `status`, `created`, `updated`) VALUES
(1, '49', 'Apple Introduces iPhone 7 & 7 Plus RED Special Edition', 'apple-introduces-iphone-7-iphone-7-plus-productred-special-edition', 'post', 'Customers Can Now Purchase iPhone in a Beautiful New Finish & Contribute to the Global Fund to Fight AIDS', 0, '<p style=\"text-align:justify\"><strong>Customers Can Now Purchase iPhone in a Beautiful New Finish &amp; Contribute to the Global Fund to Fight AIDS</strong></p>\r\n\r\n<p style=\"text-align:justify\">CUPERTINO, California &mdash; March 21, 2017 &mdash; Apple&reg; today announced iPhone&reg; 7 and iPhone 7 Plus (PRODUCT)RED Special Edition in a vibrant red aluminium finish, in recognition of more than 10 years of partnership between Apple and (RED). This gives customers an unprecedented way to contribute to the Global Fund and bring the world a step closer to an AIDS-free generation. The special edition (PRODUCT)RED iPhone will be available to order online worldwide and in stores beginning Friday, March 24.</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;Since we began working with (RED) 10 years ago, our customers have made a significant impact in fighting the spread of AIDS through the purchase of our products, from the original iPod nano (PRODUCT)RED Special Edition all the way to today&rsquo;s lineup of Beats products and accessories for iPhone, iPad and Apple Watch,&rdquo; said Tim Cook, Apple&rsquo;s CEO. &ldquo;The introduction of this special edition iPhone in a gorgeous red finish is our biggest (PRODUCT)RED offering to date in celebration of our partnership with (RED), and we can&rsquo;t wait to get it into customers&rsquo; hands.&rdquo;</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;Apple is the world&rsquo;s largest corporate donor to the Global Fund, contributing more than $130 million as part of its partnership with (RED),&rdquo; said Deborah Dugan, (RED)&rsquo;s CEO. &ldquo;Combining the global reach of the world&rsquo;s most loved smartphone with our efforts to provide access to life-saving ARV medication in sub-Saharan Africa, customers now have a remarkable opportunity to make a difference and contribute to the Global Fund through the purchase of this new beautiful (PRODUCT)RED iPhone.&rdquo; iPhone 7 and iPhone 7 Plus are the best, most advanced iPhones ever, packed with unique innovations that improve all the ways iPhone is used every day. Both phones feature the most popular camera in the world with advanced camera systems that shoot incredible photos and videos day or night, more power and performance with the best battery life ever in an iPhone, immersive stereo speakers and a wide colour system from camera to display, all in a water and dust resistant design. iPhone comes with iOS 10, which brings more expressive and animated ways to communicate in Messages, new ways to use Siri&reg; with your favourite apps, beautifully redesigned Maps, Photos, Apple Music&reg; and News, and the Home app, which lets you simply and securely set up, manage and control your home all in one place. (RED)&rsquo;s critical work provides access to life-saving HIV/AIDS programs in sub-Saharan Africa, which is home to more than two thirds of the world&rsquo;s HIV-positive population. One hundred percent of all money raised by (RED) goes directly to Global Fund HIV/AIDS grants that provide testing, counselling, treatment and prevention programs with a specific focus on eliminating transmission of the virus from moms to their babies. Since it was founded in 2006, (RED) has generated more than $465 million for the Global Fund, with more than $130 million from Apple alone. Pricing &amp; Availability iPhone 7 and iPhone 7 Plus (PRODUCT)RED Special Edition will be available in 128GB and 256GB models starting at MRP INR82,000 from Apple Authorised Resellers. The special edition (PRODUCT)RED iPhone joins iPhone 7 finishes in jet black, black, silver, gold and rose gold. Both special edition models are available worldwide beginning Friday, March 24, and start shipping to customers by the end of March in the US and more than 40 countries and regions, including Australia, Belgium, Canada, China, France, Germany, Hong Kong, Italy, Japan, Mexico, Netherlands, New Zealand, Russia, Singapore, South Korea, Spain, Sweden, Switzerland, Taiwan, Thailand, the UK and United Arab Emirates. Brazil, Chile, Colombia, India, Turkey and other countries will follow in April. The special edition iPhone joins the current (PRODUCT)RED lineup, which is available for customers to purchase year-round, including the full iPod&reg; line of products, Beats Solo 3 Wireless On-Ear Headphones, Beats Pill+ Portable Speaker, the iPhone 7 Smart Battery Case and a range of accessories for iPhone, iPad&reg; and Apple Watch&reg;. iPhone SE, the most powerful phone with a four-inch display, will be available beginning Friday, March 24, in 32GB and 128GB models, doubling the current capacity and replacing 16GB and 64GB models, all at the same starting price of MRP INR 27200 at Apple Authorised Resellers. New colours of Apple-designed iPhone 7 and iPhone 7 Plus silicone cases in azure, camellia and pebble, and leather cases in taupe, sapphire and berry will also be available at Apple Authorised Resellers starting at MRP INR 2,900. Apple revolutionised personal technology with the introduction of the Macintosh in 1984. Today, Apple leads the world in innovation with iPhone, iPad, Mac, Apple Watch and Apple TV. Apple&rsquo;s four software platforms &mdash; iOS, macOS, watchOS and tvOS &mdash; provide seamless experiences across all Apple devices and empower people with breakthrough services including the App Store, Apple Music, Apple Pay and iCloud. Apple&rsquo;s more than 100,000 employees are dedicated to making the best products on earth, and to leaving the world better than we found it.</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#808080\">Source:- Apple Press info</span></p>\r\n', 0, 'ap_red1.jpg', '', 'Apple Introduces iPhone 7 & iPhone 7 Plus (PRODUCT)RED Special Edition', 'Apple Introduces iPhone 7 & iPhone 7 Plus (PRODUCT)RED Special Edition', 'Apple Introduces iPhone 7 & iPhone 7 Plus (PRODUCT)RED Special Edition', 1, '2017-03-25 00:00:00', NULL),
(2, '49', 'Samsung launches Galaxy C9 Pro', 'samsung-launches-galaxy-c9-pro', 'post', 'A feature Powerhouse with 6GB RAM, 16MP Front and Back Camera, 15.20cm (6.0) FHD sAMOLED Display', 0, '<p style=\"text-align: justify;\">Samsung India today announced the launch of its all new smartphone powerhouse, the Galaxy C9 Pro. The all metal unibody smartphone is loaded with powerful features and is designed for consumers who demand more from their smartphone.&nbsp;<br />\r\nThe Galaxy C9 Pro is a feature powerhouse with a super screen, super memory and super camera offering consumers an immersive viewing, the best multimedia and camera experience.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n&ldquo;India is one of the fastest growing smartphone markets. Consumer trends indicate that more users prefer larger screen smartphones. Further, the needs of Indian users, who are now moving to their 2nd or 3rd smartphone, have evolved and they are demanding more from their smartphones. With the introduction of the Galaxy C9 Pro, we continue our commitment to offer our customers the very best of features and technology&rdquo;, said Vice President, Mobile Business, Samsung India. &ldquo;The Galaxy C9 Pro will enhance and give users the best multimedia experience with its 15.20cm (6.0) Full HD sAMOLED display while delivering a powerhouse performance thanks to its advanced processor, 6GB RAM, huge battery power and storage. And to top it all, the superb 16MP front and rear camera with f1.9 lens will help users capture brilliant photos even in low light conditions. &rdquo; he further added.<br />\r\nSamsung Galaxy C9 Pro gives its consumers a complete offering with its revolutionary features.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<strong>UNMATCHED PERFORMANCE</strong><br />\r\nSamsung Galaxy C9 Pro is the first Samsung with powerful 6GB RAM which offers a seam-less multi-tasking experience. In addition, it also comes with an inbuilt memory of 64GB which is expandable upto 256GB. Samsung Galaxy C9 Pro also hosts a 64-bit Octa Core Processor. Truly a performance powerhouse, Samsung Galaxy C9 Pro enables consumers to seamlessly enjoy multimedia, gaming and apps.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<strong>CAPTURING LIFE MOMENTS</strong><br />\r\nSamsung Galaxy C9 Pro sports enhanced 16MP front and rear cameras both with super wide F1.9 aperture which allow users to take clear images even in low light conditions. The high-resolution front camera offers an upgraded selfie experience while the 16MP rear camera comes with Dual LED Flash for super-clear and enhanced images.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<strong>LARGE IMMERSIVE DISPLAY</strong><br />\r\nThe smartphone provides an enhanced viewing experience with its 15.20cm (6.0) Full HD sAMOLED screen. The large immersive screen is also complemented with a dual speaker in the phone that makes it a perfect choice for users with high multimedia consumptions.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<strong>DESIGNED TO IMPRESS</strong><br />\r\nGalaxy C9 Pro has been designed with perfection. It has a full metal unibody design and with 6.9mm thickness, the handset has a comfortable one-handed grip. It is light weight and weighs only 188gms which is very impressive for a large 15.20cm (6.0) phone.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<strong>LONG LASTING BATTERY</strong><br />\r\nSamsung Galaxy C9 Pro comes with a long lasting 4,000 mAh battery along with fast charging technology, to enable avid gamers and multi-media users to do more. &nbsp;The device supports USB Type-C that offers a faster data transfer. To give flexibility to its consumers, Samsung Galaxy C9 Pro has two Sim card slots and a separate additional MicroSD card slot.</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n<strong>MAKE FOR INDIA</strong><br />\r\nSamsung Galaxy C9 Pro supports the suite of Make For India features like S Secure, S Power Planning, Ultra Data Saving (UDS) and My Galaxy, which complement the best in class hardware and differentiate the device from all others.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#808080\">Source:-&nbsp;Samsung &nbsp;Press Release</span></p>\r\n', 0, 'C9-Pro-Gold-Back-with-Gold.jpg', '', 'Samsung launches Galaxy C9 Pro', 'Samsung launches Galaxy C9 Pro', 'Samsung launches Galaxy C9 Pro', 1, '2017-03-25 00:00:00', NULL),
(3, '49', 'OPPO Launches the new Selfie Expert F3 Plus', 'oppo-launches-the-new-selfie-expert-f3-plus', 'post', 'OPPO Launches the new Selfie Expert F3 Plus', 0, '<p style=\"text-align:justify\"><strong>OPPO Launches the new Selfie Expert F3 Plus with Dual Front Camera, Kick starting the &lsquo;Group Selfie&rsquo; Trend</strong></p>\r\n\r\n<p style=\"text-align:justify\">The ever-evolving global smartphone brand OPPO, kick started the &lsquo;Group Selfie&rsquo; trend by launching the new Selfie Expert F3 Plus, priced at Rs30,990.The F3 Plus features the brand&rsquo;s first dual front camera including a first-ever120-degree wide-angle Group Selfie Camera. The F3 Plus First Sale begins from1st April 2017 across India. It will also be available in OPPO online stores on Flipkart, Amazon and Snapdeal. The pre-order starts from 23rd March till 31st March 2017.<br />\r\n&nbsp;<br />\r\nOPPO&rsquo;s New Brand Ambassador, youth icon and Bollywood superstar&ndash; Deepika Padukone and Renowned Photographer &ndash; Dabboo Ratnani also shared their own selfie experience with OPPO F3 Plus during the event.<br />\r\n&nbsp;<br />\r\nOPPO F3 Plus delivers great selfie photos through the revolutionary dual selfie front cameras: a 16-megapixel camera for selfie and a 120-degree wide-angle lens for group selfie.The rear camera is co-developed with Sony, equipped with a customized IMX398 sensor for serious photography. The F3 Plus is a high-end smartphone that is efficient, long-lasting, secure and beautiful, addressing today&rsquo;s highly-demanding mobile-first world. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n&nbsp;<br />\r\n&ldquo;OPPO is an industry leader in the Selfie Revolution with the recent &lsquo;Selfie Experts&rsquo; F-series. Our brand has been growing rapidly across Southeast Asia and other regions around the world. As per the GFK data, we becamethe No.2 smartphone brand in India offline market last year. The dual selfie camera F3 Plus marks a new &lsquo;Group Selfie&rsquo; trend, and reinforces our position as the Selfie Expert,&rdquo; said Sky Li, Global VP &amp; President of OPPO India.<br />\r\n&nbsp;<br />\r\nTake selfie with Deepika Padukone and Dabboo Ratnani<br />\r\nAt the event OPPO announced its new brand ambassador &ndash; the youth icon and Bollywood superstar Deepika Padukone. Deepika Padukone shared her experience of how excited she is to be a part of the OPPO family and kick start the &lsquo;Group Selfie&rsquo; trend with the OPPO F3 Plus. &ldquo;It&rsquo;s amazing to see the way OPPO has identified the nerves of the Indian youth and the trend &ndash; Selfies. Wherever I go, I find people taking selfies. I&rsquo;m excited that I have also joined the wagon!&rdquo; said Deepika Padukone. OPPO also shared the new TVC at the launch event.</p>\r\n\r\n<p style=\"text-align:justify\">The renowned photographer &ndash; Dabboo Ratnani, also shared his experience in associating with the F3 Plus and how he is looking forward to use the great technology that OPPO F3 Plus offers and which takes selfies a notch further.<br />\r\n&nbsp;<br />\r\n&nbsp;Remarkable Wide-Angle &amp;Dual Front Selfie Camera Define the Next Expert-Class Photography&nbsp;<br />\r\nSet to be the next ultimate &lsquo;Selfie Expert&rsquo;, the F3 Plusfeatures dual front selfie camera. The 16-megapixel front camera builds upon the technology offered by theprevious&lsquo;Selfie Expert&rsquo; F1s. At the core of this camera is a 1/3-inch sensor, which helps increase light exposure and clarity of images. The large f/2.0 apertureallows for great depth-of-field effects &ndash; clear foreground focus matched with the perfect amount of background blurriness.<br />\r\n&nbsp;<br />\r\nIn becoming the &lsquo;Group Selfie&rsquo; secret weapon, the F3 Plus has aspecialized 120-degree wide-angle 8MP camera which captures a wider view, up to105 percent more than a regular 80-degree lens field of view. This allows even more people to enter the frame with minimized lens distortion, thanks to the 6P camera lens. The camera also packs an eight-megapixel camera featuring a &frac14;-inch sensor.</p>\r\n\r\n<p style=\"text-align:justify\">With the built-in Smart Facial Recognition, the F3 Plus will notify users to switch to &lsquo;Group Selfie&rsquo; mode if there are more than three people in the frame. Users can snap their Group Selfie at ease, without compromising image stability when taking selfie with one hand.<br />\r\n&nbsp;<br />\r\nThe outstanding rear camera offers high-quality photography performance with fast focusing speed, noise reduction and advanced low-light performance. Powering the 16-megapixel rear camera is a brand-new 1/2.8-inch IMX398 sensor. This sensor is jointly developed by OPPO and Sony, which features Dual PDAF &ndash; dual phase detection autofocus technology. This new technology doubles the sensor&rsquo;s pixel array area where the photodiodes are embedded, necessary for phase detection autofocus. This makes for 40 percent faster focusing speeds even in low light. Paired with the large f/1.7 aperture, the resulting images are clear and breathtaking.<br />\r\n&nbsp;<br />\r\nThere are other innovative technologies packed into the F3 Plus to help users capture picture-perfect, flawless selfies. OPPO&rsquo;s pioneering beautification editing software, Beautify 4.0,will allow users to choose from various beautification modes, ensuring images presenting the favorable effects.&nbsp;<br />\r\n&nbsp;<br />\r\nLong battery endurance and VOOC flash charge<br />\r\nExtended daily usage is another of the device&rsquo;s core features. The 4,000 mAh built-in battery gives the F3 Plus endurance of more than 17 hours in simulation test of real use. Through OPPO&rsquo;s proprietary and industry leading rapid VOOC Flash Charge Solution, the battery will charge four times faster than standard batteries. Users can get up to 2 hours of talk time with just 5 minutes of charging.<br />\r\n&nbsp;<br />\r\nA Flawless Smartphone Experience<br />\r\nThe OPPO F3 Plus is fast, utilizing an octa-core processor backed by 4GB RAM and 64GB ROM. It also offers a dual-slot card tray that can hold two Nano 4G SIM cards or one Nano SIM card with amicroSD card, expanding memory to up to 256GB. OPPO&rsquo;s leading optimized ColorOS 3.0 system ensures superb speed with reduced energy consumptionand flawless performance with built-in Privacy Protection feature and virus scanner.<br />\r\n&nbsp;<br />\r\nPrivacy protection and security is alsoa top priority. The F3 Plus&rsquo; Lightning-Fast Touch Access is undoubtedly one of the quickest in the market. The home-button fingerprint reader in the F3 Plus unlocks the phone in a mere 0.2s. The fingerprint reader is even more versatile with the fingerprint-activated calling and app launch functions.<br />\r\n&nbsp;<br />\r\nUsers can enjoy the flexibility to multi-task and &lsquo;work hard, snap hard&rsquo;, all on one smartphone &ndash; seamlessly, securely, with a long battery life.<br />\r\n&nbsp;<br />\r\nStunning Design and Exquisite Craftsmanship<br />\r\nThe F3 Plusis constructed with a metal unibody and carefully crafted for a better sense of hand-gripping, resulting in a sleek and thin smartphone that is a wonder to hold. The 6-inch, 2.5D Corning Gorilla Glass 5 screen features a pre-applied protective screen coating, giving it an elegant, classy and premium lookwhile retaining unmatched durability.<br />\r\n&nbsp;<br />\r\nThe &lsquo;Six-String&rsquo; ultra-fine antennais a design rethoughtby OPPO, removing the ubiquitous, thick pair of white antenna linesseen in previous smartphone models, and gives the back shell a stunning look.<br />\r\n&nbsp;<br />\r\nAmazing Colors &amp; Competitive Pricing<br />\r\nThe F3 Plus comes in Gold and Black. Priced at Rs30,990, the Gold variant of the F3 Plus will be available from 1st April 2017 both online and offline. It will be available in OPPO stores across India and online stores on Flipkart, Amazon and Snapdeal. The pre-order starts from today till 31st March 2017. OPPO is also giving a special gift pack for all pre &ndash; orders purchases made both online and offline.There is also a Black color variant for the F3 Plus which will be available later.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Source:- &nbsp;OPPO Press&nbsp;News</p>\r\n', 0, 'Event_image3.jpg', '', '', '', '', 1, '2017-03-27 00:00:00', NULL),
(4, '49', 'Xperia XZ Premium ', 'xperia-xz-premium', 'post', 'Sonys stunning new Xperia XZ Premium with the worlds first Super slow motion video in a smartphone', 0, '<p style=\"text-align:justify\"><strong>Sony&rsquo;s stunning new Xperia&trade; XZ Premium with the world&rsquo;s first Super slow motion video in a smartphone</strong></p>\r\n\r\n<p style=\"text-align:justify\">&bull;&nbsp;&nbsp; &nbsp;Ground-breaking Motion Eye&trade; camera with the world&rsquo;s first Super slow motion video in a smartphone &nbsp;and new Predictive Capture<br />\r\n&bull;&nbsp;&nbsp; &nbsp;From BRAVIA to Xperia, the world&rsquo;s first smartphone with a 4K HDR display&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Super-fast up to 1Gbps download speeds &nbsp;to get 4K movies in your hands in seconds</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nBarcelona, Mobile World Congress, 27th February 2017 &ndash; Sony Mobile Communications (&ldquo;Sony Mobile&rdquo;) today announced its most ground-breaking smartphone to date, Xperia XZ Premium, with a camera so advanced it captures motion that the human eye can&rsquo;t see, a beautiful 4K HDR display, super-fast download speeds, a stunning loop design and even more intelligent features.</p>\r\n\r\n<p style=\"text-align:justify\">Encapsulating decades of Sony innovation, Xperia XZ Premium incorporates imaging know-how embedded on Sony &lsquo;&alpha;&rsquo; and Cyber-shot&trade; cameras to create the new Motion Eye&trade; camera system, for capturing life in ways no other smartphone can. &nbsp;The first smartphone to feature a memory stacked Exmor&trade;RS sensor with technologies usually only found on premium compact cameras, it provides 5 x faster image scanning and data transfer. This means you can create sensational videos from your everyday moments by recording in 960 frames per second, providing Super slow motion video playback that is four times slower than other smartphones &nbsp;giving you more detail than has ever been possible in the palm of your hand. Plus Predictive Capture stays one step ahead and automatically starts buffering images when it detects motion even before you press the button, so you can find a moment your eye may just have missed from a selection of up to four shots taken a second before you clicked. On top of this, the new 19MP high resolution sensor has 19% larger pixels to capture more light and provides exceptional detail and sharp images even in low-light and backlit conditions. Additional improvements have been made inside Motion Eye&trade; to the Bionz&trade; for mobile processing engine meaning it detects moving objects more precisely to enable Predictive Capture.Clarity, detail and texture are also improved to give exceptional image quality thanks to the redesigned G lens with high optical clarity.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">For the first time ever in a smartphone, Xperia XZ Premium features a 4K HDR (High Dynamic Range, 2160 x 3840) 5.5&rdquo; display. A truly unique Sony experience, it uses Sony&rsquo;s BRAVIA TV technology to give you an immersive 4K HDR viewing experience in the palm of your hand, removing the constraints of your sofa. Astonishing brightness, colour, clarity and contrast are realised to create levels of realism you almost feel part of the scene. The sharp, vivid quality of the display is enriched by Sony&rsquo;s native technologies TRILUMINOS&trade; Display for mobile, X-Reality for mobile and Dynamic Contrast Enhancer.</p>\r\n\r\n<p style=\"text-align:justify\">For the first time on mobile, you can enjoy a selection of 4K HDR content from Amazon Prime Video on Xperia XZ Premium. Stream or download select Amazon Originals series &nbsp;to watch whenever and wherever you want, with intensely vivid colours and breath-taking clarity.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Xperia XZ Premium is powered by the cutting edge Qualcomm&reg; Snapdragon&trade; 835 Mobile Platform, making it one of the very first smartphones capable of Gigabit Class LTE (up to 1Gbps)[i]. This is possible because of the integrated Snapdragon X16 LTE modem, which has the potential to transform how customers use their mobile devices by delivering fibre optic speeds on the go. The Snapdragon 835 platform also supports stunning graphics, superior performance and enhanced battery efficiency. File transfers are also super-charged thanks to the USB 3.1 connection which is 10 times quicker than USB 2.0 with a transfer speed of up to 5Gbps. And with the USB Type-C&trade; socket, plugging in is easy because the connector is always the right way up.</p>\r\n\r\n<p style=\"text-align:justify\">With so many advanced technologies working in harmony, it is only fitting that the Xperia XZ Premium has a harmonious design to match, making it beautiful on the inside and out. The exterior has an exquisite glass loop surface which when turned over reveals a luxurious mirrored effect on the back. Every aspect of the XZ Premium is unified, from its seamless flowing lines and intuitive finger-print sensor power button &nbsp;to the new live wallpaper which moves the elegant loops as you swipe, to the colours you see on screen which are matched to the beautiful colours of the exterior.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Rain is one less thing to think about when you&rsquo;re out and about with the Xperia XZ Premium. It&rsquo;s water resistant , dust-proof and reinforced with Corning&reg; Gorilla&reg; Glass 5 on the front and back of the handset, taking beauty and durability to new heights.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Taking intelligence to the next level Xperia XZ learns how you use your phone and adapts and makes recommendations to give you our most smartest and personal experience yet. The battery is maximised with Smart Stamina which uses the Xperia learning engine to accurately estimate how long your current battery will last based on your normal usage. It even warns you if it detects you&rsquo;re going to run out of power later that day and prompts you to activate Stamina mode. Battery Care &nbsp;and Qnovo Adaptive Charging are also included to protect your battery and keep it healthy up to twice as long.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Xperia Tips and new Xperia Actions offer you handy advice about the features you&rsquo;re using and even suggests map downloads based on your location, all aimed at making life that little bit easier. &nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">The Sony experience is continued through to the audio and gaming capabilities. High Resolution Audio playback allows you to hear every nuance and detail in a track as if you&rsquo;re right there with the artist. Sony&rsquo;s native DSEE HX&trade; technology even up-scales streamed tracks or MP3s to near High-res quality and if you connect with wireless speakers or headphones, LDAC ensures you don&rsquo;t lose a drop of sound quality by transferring three times more audio data than normal Bluetooth. Working with your PlayStation&reg;4 console, you can play the latest cutting-edge games on your Xperia XZ Premium. Its advanced processing and fast memory access means gameplay is always smooth and responsive, plus the 4K screen and powerful stereo speakers make it feel like you&rsquo;re actually in the game.</p>\r\n\r\n<p style=\"text-align:justify\">Xperia XZ Premium is available globally in in Luminous Chrome and Deepsea Black, from late Spring 2017. A range of supporting accessories will be available including the Quick Charger UCH12W &nbsp;which offers hours of battery time by plugging in for just a few minutes and Bluetooth Headset with Speaker SBH56 which enables hands free talking through the loud speaker whilst multi-tasking and has a remote camera shutter.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Xperia XZs</strong><br />\r\nSony Mobile today also launched its Xperia XZs, available in select markets, which takes our flagship device to a new level with the integration of the brand new Motion Eye&trade; camera. Sony imaging know-how from both &lsquo;&alpha;&rsquo; and Cyber-shot&trade; cameras means you get 960fps Super slow motion video, Predictive Capture and all the added quality benefits of the redesigned G lens and new Bionz&trade; for mobile image processing engine. &nbsp;Image and video playback look beautiful on the 5.2&rdquo; Full HD display which is integrated into the loop surface design with the ALKALEIDO&trade; metal back creating a premium shine and feel. Design hallmarks also include water-resistanceviii and finger-print sensor integrated into the power buttonvii. With its high end processor it&rsquo;s quick off the mark for downloads and streaming as well as seamlessly running the intelligent user interface. &nbsp;A host intelligent features such as Smart Stamina run on the Xperia learning engine which together with Battery care and Qnovo Adaptive Charging brings you reliable all day battery throughout the product lifespan. Whilst Xperia Actions can make your life easier by suggesting location based map downloads or usage based automatic setting changes. Xperia XZs is available from the beginning of April 2017 in Ice Blue, Warm Silver and Black. Please check with local operators and retailers for availability.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\nSource :- Sony Press Release</p>\r\n', 0, '01_Xperia_XZ_Premium_silver_dualview.png', '', 'aldivo Xperia XZ Premium ', 'Xperia XZ Premium ', 'Xperia XZ Premium ', 1, '2017-03-29 00:00:00', NULL),
(5, '49', 'Samsung Galaxy S8 and S8', 'samsung-galaxy-s8-and-s8', 'post', 'Discover New Possibilities with the Samsung Galaxy S8 and S8: Smartphones Without Limits', 0, '<p style=\"text-align: justify;\">The Galaxy S8 and Galaxy S8+ Deliver Stunning Infinity Display, Connected Ecosystem of Services and an Intelligent Interface<br />\r\n&nbsp;<br />\r\nSamsung Electronics Co., Ltd. introduces the Galaxy S8 and S8+ to the world, a smartphone that pushes the boundaries of traditional smartphones with its seamless hardware design and a variety of new service offerings. With the launch of multiple services and apps, as well as a stunning Infinity Display for immersive viewing experiences, the Galaxy S8 and S8+ bring a new level of functionality and convenience, opening up a galaxy of possibilities.<br />\r\n&nbsp;<br />\r\n&ldquo;The Samsung Galaxy S8 and S8+ usher in a new era of smartphone design and fantastic new services, opening up new ways to experience the world,&rdquo; said DJ Koh, President of Mobile Communications Business, Samsung Electronics. &ldquo;The Galaxy S8 and S8+ are our testament to regaining your trust by redefining what&rsquo;s possible in safety and marks a new milestone in Samsung&rsquo;s smartphone legacy.&rdquo;<br />\r\n&nbsp;<br />\r\nSee and Experience More<br />\r\n&nbsp;<br />\r\nThe Galaxy S8 builds on Samsung&rsquo;s heritage of creating stunning designs and functional devices. Available in 5.8-inch Galaxy S8 and 6.2-inch Galaxy S8+, the Infinity Display and bezel-less design form a smooth, continuous surface with no buttons or harsh angles. The result is a truly immersive viewing experience without distractions and makes multi-tasking more convenient. The Galaxy S8&rsquo;s compact design enables comfortable one-handed operation and Corning&reg; Gorilla&reg; Glass 5 on both the front and back for durability and a high-quality finish.<br />\r\n&nbsp;<br />\r\nThe Galaxy Foundation<br />\r\n&nbsp;<br />\r\nIn addition to the new design innovations, Samsung continues to deliver cutting-edge technology including an advanced camera, enhanced performance and more to the devices that users love, including:<br />\r\n&nbsp;<br />\r\n&bull; Premium Camera: The Galaxy S8 and S8+ are equipped with an advanced 8MP F1.7 Smart autofocus front camera and 12MP F1.7 Dual Pixel rear camera for the best low-light, zoom and anti-blur photos with enhanced image processing.<br />\r\n&bull; Powerful Performance: Packing powerful performance and connectivity, the Galaxy S8 and S8+ feature the industry&rsquo;s first 10nm processor, enabling heightened speed and efficiency. It is also gigabit LTE and gigabit Wi-Fi ready with support for up to 1 Gbps so users can quickly download files, regardless of the file size.<br />\r\n&bull; Robust Entertainment: As the world&#39;s first mobile device certified by the UHD Alliance as MOBILE HDR PREMIUMTM, Galaxy S8 and S8+ let you see the same vibrant colors and contrasts that the filmmakers intended while watching your favorite shows. In addition, the Galaxy S8 and S8+ offer next-level gaming experiences with vivid and superior graphic technology, as well as Game Pack, featuring top game titles, including select titles supported by the Vulkan API.<br />\r\n&bull; Global Standard in Mobile Security: The Galaxy S8 and S8+ are built on Samsung Knox, a defense-grade security platform. In addition, the Galaxy S8 and S8+ will offer a wide selection of biometric technologies including a fingerprint scanner, iris scanner and facial recognition so users can select a secure biometric authentication method that works best for them.<br />\r\n&nbsp;<br />\r\nThe Galaxy S8 and S8+ will also come with the foundational Galaxy features that our customers have come to love, including:<br />\r\n&bull; IP68 water and dust resistance<br />\r\n&bull; MicroSD support up to 256GB<br />\r\n&bull; Always-on display<br />\r\n&bull; Fast and wireless charging capabilities<br />\r\n&nbsp;<br />\r\nNew Way to Interact with Your Phone<br />\r\n&nbsp;<br />\r\nBixby is an intelligent interface that will help users get more out of their phone. With the new Bixby button, you will be able to conveniently access Bixby and navigate through services and apps with simple voice, touch and text commands. At launch, Bixby&rsquo;s Voice function will integrate with several Samsung native apps and features including Camera, Contacts, Gallery, Messages and Settings, with the plan to expand its capabilities to include more Samsung and third-party apps in the near future. Contextual awareness capabilities enable Bixby to offer personalized help based on what it continues to learn about the user&rsquo;s interests, situation and location.<br />\r\n&nbsp;<br />\r\nUsers can also shop, search for images and get details about nearby places with Bixby&rsquo;s image recognition technology. As the Bixby ecosystem grows, it will connect across devices, apps and services as a ubiquitous interface, and open up new experiences and scenarios to simplify life.<br />\r\n&nbsp;<br />\r\nBeyond the Phone Experiences<br />\r\n&nbsp;<br />\r\nThe Galaxy S8 and S8+ offers robust portfolio of products and services, elevating the both devices experience for premiere mobile productivity and connectivity.<br />\r\n&nbsp;<br />\r\nThe Galaxy S8 and S8+ unlock the new Gear VR with Controller, powered by Oculus. Enabling convenient one-handed control and navigation, the controller provides better motion interaction when accessing interactive VR content. The Galaxy S8 and S8+ will also connect to the new Gear 360 to create 4K 360-degree videos and 15MP photos.<br />\r\n&nbsp;<br />\r\nLeveraging the processing power of the Galaxy S8 and S8+ for enhanced productivity, Samsung DeX is a unique solution that transforms your smartphone into a desktop by providing a secure desktop-like experience. With Samsung DeX, users can easily display and edit data from their phone, making working from a smartphone faster and smarter.<br />\r\n&nbsp;<br />\r\nIn addition, as more IoT devices enter the market and the connected network becomes more complex, Samsung Connect simplifies smart device management. With Samsung Connect, users can easily activate IoT-enabled devices through a quick three-step configuration process and manage all connected devices through one integrated app.<br />\r\n&nbsp;<br />\r\nThe Galaxy S8 and S8+ also come with the enhanced Samsung Health service, expanding one of Samsung&rsquo;s most widely used services with 60 million monthly active users and 11 million daily active users worldwide. Samsung Health includes tele-health (U.S.-only), personal coaching, social capabilities that redefine traditional health and fitness.<br />\r\n&nbsp;<br />\r\nUsers can leave their physical wallet behind with Samsung Pay, turning their Galaxy S8 and S8+ into a digital wallet they can use almost anywhere they&rsquo;d use a credit or debit card. With more than 870 worldwide banking partnerships, Samsung Pay has processed more than 240 million transactions to date.<br />\r\n&nbsp;<br />\r\nNew high-performance earphones tuned by AKG by Harman, offering uncompromised audio for unbeatable sound quality, will come as an in-box accessory. These earphones will have a comfortable hybrid canal fit for better noise cancellation and will be made from anti-tangle metal-fabric material.<br />\r\n&nbsp;<br />\r\nThe Galaxy S8 and S8+ will be available starting on April 21, and will be offered in a rich color palette including Midnight Black, Orchid Gray, Arctic Silver, Coral Blue and Maple Gold.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">Source :-&nbsp;<span style=\"color:rgb(90, 90, 90); font-family:samsungifrg; font-size:14px\">&nbsp;Samsung Mobile Press&nbsp;</span></p>\r\n', 0, '20170331H7BBLORAHJHMEHL4A41BBAXH2.jpg', '', '', '', '', 1, '2017-04-03 00:00:00', NULL),
(7, '49', 'Apple Opens New App Accelerator Bengaluru', 'apple-opens-new-app-accelerator-bengaluru', 'post', 'App Accelerator to Inspire the Next Generation of Indian Developers', 0, '<p style=\"text-align:justify\">Bengaluru, India &mdash; March 31, 2017 &mdash; Apple&reg; today announced the opening of its App Accelerator in Bengaluru, the home of India&rsquo;s startup scene. iOS is the world&rsquo;s most powerful mobile operating system and the foundation for iPhone&reg; and iPad&reg;, and the App Accelerator Bengaluru will provide specialised support for developers, including tools and best practices to hone their skills and transform the design, quality and performance of their apps on the iOS platform.</p>\r\n\r\n<p style=\"text-align:justify\">Each week, Apple experts will lead briefings and provide one-on-one app reviews for developers. The first-of-its-kind facility will also provide support and guidance on Swift&trade;, Apple&rsquo;s powerful and intuitive programming language created to build apps for iOS, Apple TV&reg; and Apple Watch&reg;. Swift enables developers to write safer, more reliable code, save time and create richer app experiences.</p>\r\n\r\n<p style=\"text-align:justify\">India has one of the most vibrant and exciting iOS developer communities in the world and already tens of thousands of developers in India make apps for iOS. The App Accelerator Bengaluru will help to further enrich the iOS app ecosystem.</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;We are impressed by the great entrepreneurial spirit in India, and are excited to provide a platform for these developers to share their innovations with customers around the world,&quot; said Philip Schiller, senior vice president of Worldwide Marketing. &ldquo;In just the first few weeks, we&rsquo;ve already seen some incredible developers here at the App Accelerator Bengaluru, including Practo and Reliance Games, create innovative apps that can meet the needs of customers in India and around the world.&rdquo;</p>\r\n\r\n<p style=\"text-align:justify\">The App Accelerator is now open to iOS developers in India through a sign-up process on the App Accelerator Bengaluru website (https://developer.apple.com/accelerator/). Each week, Apple&rsquo;s team will guide developers on design best practices, refine their skills to create amazing iOS apps and transform the quality and performance of their apps on iOS.</p>\r\n\r\n<p style=\"text-align:justify\">The App Accelerator Bengaluru features Apple Technology Evangelists who will provide specialised briefings for over 500 developers every week. They will also offer detailed app analysis feedback for developers as they work to enhance their apps.</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;Apple&rsquo;s commitment to the developer community through the opening of the App Accelerator is a tremendous investment in the future of India&rsquo;s digital economy,&rdquo; said NASSCOM President R Chandrashekhar. &ldquo;A sustainable technology sector that champions Indian talent, combined with leading-edge design and insights from Apple engineering creates an innovative pipeline that will have local and global appeal.&rdquo;</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;We are thrilled to be one of the first developers to collaborate with team at the App Accelerator,&rdquo; said Shashank ND, Founder &amp; CEO of Practo. &ldquo;The Accelerator has really helped us make the best use of iOS technologies to rapidly digitise and improve the healthcare experience for millions of consumers in India.&quot;&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Apple revolutionised personal technology with the introduction of the Macintosh in 1984. Today, Apple leads the world in innovation with iPhone, iPad, Mac, Apple Watch and Apple TV. Apple&rsquo;s four software platforms &mdash; iOS, macOS, watchOS and tvOS &mdash; provide seamless experiences across all Apple devices and empower people with breakthrough services including the App Store, Apple Music, Apple Pay and iCloud. Apple&rsquo;s more than 100,000 employees are dedicated to making the best products on earth, and to leaving the world better than we found it.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Source:-&nbsp;Apple Press Info</p>\r\n', 0, 'aldivo_apple5.jpg', '', 'Apple Opens New App Accelerator Bengaluru', 'Apple Opens New App Accelerator Bengaluru', 'Apple Opens New App Accelerator Bengaluru', 1, '2017-04-03 00:00:00', NULL),
(8, '49', 'Samsung to Showcase ', 'samsung-to-showcase-its-smartphone-design-philosophy-at-milan-design-week', 'post', 'Samsung collaborates with Zaha Hadid to open an immersive studio representing the Galaxy S8 and S8+ design', 0, '<p style=\"text-align:justify\">Milan, Italy &ndash; April 4, 2017 &ndash; Samsung Electronics Co., Ltd. is honored to join design aficionados at Milan Design Week 2017. Samsung will welcome the global design community to an immersive studio on Via Bergognone, Tortona to experience Unconfined: The Galaxy S8 Design. Collaborating with world renowned Zaha Hadid Architects, and acclaimed digital art and design collective Universal Everything, Samsung will showcase the story behind the recently unveiled Galaxy S8 that centers on the perfect unity of design, technology and experience.<br />\r\n&nbsp;<br />\r\nInspired by the total design refinement of the Galaxy S8 and S8+, Patrik Schumacher and Johannes Schafelner of Zaha Architects, known for conjuring diverse shapes and curved masterpieces, collaborated with Universal Everything, to create an interactive experience. Visitors can journey through a completely bespoke interior, triggering mesmerizing digital installations and bringing to life the Galaxy design philosophy.<br />\r\n&nbsp;<br />\r\n&ldquo;Milan Design Week represents a unique opportunity to demonstrate the total refinement of the Galaxy S8 and S8+ amongst the brightest and best minds of the design industry,&rdquo; said Younghee Lee, Executive Vice President of Global Marketing, Mobile Communications Business at Samsung Electronics. &ldquo;The Galaxy S8 and S8+ showcase our commitment to meaningful innovation; with the bezel-less surround and Infinity Display we have designed a device that connects with the user like never before, with function not limited by form.&rdquo;<br />\r\n&nbsp;<br />\r\n&ldquo;We&rsquo;re truly excited to welcome the design community to our installation with Samsung during Milan Design Week&rdquo; said Patrik Schumacher, Principle, Zaha Hadid Architects. &ldquo;Unconfined sets a benchmark in the way materials and technology come together to create a natural flow between device and user and was the inspiration for our fantastic collaboration with Universal Everything. We often look at the logic and coherence of nature&rsquo;s systems when we are working to create environments that seamlessly connect form and function using innovative designs and technologies. This research is integrated within every aspect of the installations design.&rdquo;<br />\r\n&nbsp;<br />\r\nFinally, Samsung and Wallpaper* created an exclusive Design Book to celebrate the Galaxy S8&rsquo;s aesthetic innovation. Readers will learn more about the Samsung hardware and software design philosophy and get an inside look into the Galaxy S8&rsquo;s physical creation including photos from Samsung&rsquo;s factory in Vietnam. Readers will also have access to exclusive commentary and interpretations of the concepts that inspired the Galaxy S8&rsquo;s design by influential contemporary artists and design commentators, as well as Wallpaper* Bespoke Editor, Simon Mills . Access a digital version of the Galaxy S8&rsquo;s Design Book at http://www.samsungmobilepress.com/galaxydesignbook/<br />\r\n&nbsp;<br />\r\nFrom April 4-9, visitors to Unconfined: The Galaxy S8 Design will be able to get a first look at the Galaxy S8 and see for themselves the design refinement this new piece of technology for the modern age.<br />\r\nFor more product information, please visit http://www.samsungmobilepress.com</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Source:- samsung mobilepress</p>\r\n', 0, 'aldivo10.jpg', '', 'Samsung to Showcase Its Smartphone Design Philosophy at Milan Design Week', 'Samsung to Showcase Its Smartphone Design Philosophy at Milan Design Week', 'Samsung to Showcase Its Smartphone Design Philosophy at Milan Design Week', 1, '2017-04-04 00:00:00', NULL);
