(9, '49', 'Sony Mobile at Mobile World Congress 2017', 'sony-mobile-delivers-its-innovation-promise-at-mobile-world-congress-2017', 'post', 'Sony Mobile delivers its innovation promise at\r\nMobile World Congress 2017', 0, '<p style=\"text-align:justify\"><strong>Sony Mobile delivers its innovation promise at Mobile World Congress 2017</strong><br />\r\n&bull; Xperia&trade; Touch, the highly anticipated Android projector with multi-touch, rolls out to select markets from Spring 2017<br />\r\n&bull; First showcase of Xperia&trade; Ear &ldquo;Open-style CONCEPT&rdquo;, a nextgeneration Xperia Smart Product - with wireless &lsquo;open-ear&rsquo;stereo headphones<br />\r\n&bull; Four new X-Series smartphones; Xperia&trade; XZ Premium, Xperia</p>\r\n\r\n<p style=\"text-align:justify\">XZs and super mid-range Xperia XA1 and XA1 Ultra<br />\r\nBarcelona, 27th February 2017, Sony Mobile Communications (&ldquo;Sony Mobile&rdquo;) today re-affirmed its position as a leading communications innovator and visionary, by unveiling product experiences that break new ground in consumer technology. &quot;Xperia Touch is a revolutionary interface&quot; said Hiroki Totoki, President and CEO, at Sony Mobile Communications. &ldquo;A year on from unveiling our new brand direction and vision for the future of communications, not only are we announcing Xperia XZ Premium, equipped with the most advanced technologies to enhance the essential features on smartphones, we&rsquo;re creating whole new interactive communication experiences with our Xperia Smart Products.&rdquo;<br />\r\nAcclaimed concept to commercial product: Xperia Touch, the interactive Android projector launches from Spring 2017 Xperia Touch is an interactive projector that turns any flat surface into a 23&rdquo; HD touchscreen, with either horizontal or vertical ultrashort-throw projection.The interface is fast, fluid and responsive to physical touch - it&rsquo;s built using Sony&rsquo;s SXRD projection display technology, and touch is made possible through a combination of Infrared light and real-time detection via its built-in camera, at a rate of 60 frames-per-second. Xperia Touch enables family and friends to gather around a table, kitchen island or flat wall to enjoy games, watch online video streaming services and<br />\r\ncommunicate using messaging apps and social networks.The elegant home screen skin is engineered specifically for touch - designed to be both minimalistic and accessible in brightly lit or dark conditions. It provides real-time weather information, a memo board for doodles or video<br />\r\nnotes, calendar access and a Skype&trade; portal for video chat with colleagues or loved ones. Not only is Xperia Touch compatible with PlayStation&reg; 4 Remote Play1 , it will run any app or game downloaded from the Google Play Store, setting a new precedent for the way hundreds of thousands of application experiences2 can now be enjoyed. And, the unique projection, touch capability and sensor architecture will provide developers with an entirely new platform on which to build and create. Xperia Touch rolls out to Europe via select retailers and the Xperia Store Online in selected countries from Spring 2017, with a suggested retail price of &euro;14993 . Hands-free. Eyes-free. Ears-free: Xperia Ear &ldquo;Open-style CONCEPT&rdquo; is a next-generation Xperia Smart Product concept Xperia Ear &ldquo;Open-style CONCEPT&rdquo; is based on &#39;open-ear&#39; audio technology developed within Sony&#39;s Future Lab Program, an incubator that enables consumers to trial and shape prototypes from Sony&rsquo;s R&amp;D division. It utilises Sony&#39;s acoustics research and leadership to deliver wireless &#39;openear&#39; stereo headphones, so you can listen to music and receive notifications, whilst simultaneously hearing sounds from the world around you. Whether you&rsquo;re listening to music during a workout or commute, it&rsquo;s an unparalleled ambient experience. Xperia Ear &ldquo;Open-style CONCEPT&rdquo; is built to completely reimagine everyday listening and communication - its two highly powerful spatial acoustic &nbsp;conductors and driver units work together to transmit sounds directly to the<br />\r\near canal. And just as with Xperia Ear, Xperia Ear &ldquo;Open-style CONCEPT&rdquo; will be powered by Sony Agent Technology - a personal assistant that uses conversational voice interaction and head gestures to help you get things done, access information and communicate.<br />\r\nSony Mobile will continue to develop new features to further increase the inear assistant capability. An example of this is &lsquo;Anytime Talk&rsquo; - a new voice-chat service that will allow users to instantaneously start a group conversation in real-time without searching through contacts or needing to dial, with a simplesingle button press or head movement. The beta version will roll out for the first-generation Xperia Ear over the coming months. Sony Mobile is exploring the collaborative possibilities with Sony Agent Technology on Xperia Smart Products and the new cloud AI platform from LINE Corporation, the company behind the popular LINE messaging app, to develop and co-create a new communication experience.Four all-new Xperia smartphones; Flagship Xperia&trade; XZ Premium,Xperia XZs and super mid-range Xperia XA1 and XA1 Ultra Sony Mobile also announced four additions to its popular X-series enhancing both the premium and mid-range models - further ensuring that the range<br />\r\noffers a variety of features to excite consumers and ensuring that Xperia is available at each key operator tariff point in markets around the world.Hideyuki Furumi, EVP, Global Sales &amp; Marketing, at Sony Mobile Communications said: &ldquo;We&rsquo;ve continued to evolve and transform our smartphone portfolio, with an unwavering focus on delivering the most advanced technology in elegantly designed products. Whether it&rsquo;s a memorystacked camera system capable of super slow motion capture or the world&rsquo;s first 4K HDR smartphone display, we&rsquo;re delivering experiences that connect with users in emotional and meaningful ways like never before.&rdquo; Xperia XZ Premium showcases Sony&rsquo;s new Motion Eye&trade; camera system to enable advanced features and excellence in picture quality, as well as the world&rsquo;s first 4K HDR display4 (5.5&rdquo;). Motion Eye camera provides 960fps super slow motion video capture and playback, four times slower than any other smartphone5 . Xperia XZ Premium is available globally in in Luminous Chrome and Deepsea Black from late Spring 2017. The flagship variant Xperia XZs brings that same re-engineered Motion Eye camera to select markets in a 5.2&rdquo; form factor and is available from the beginning of April 2017 in Ice Blue, Warm Silver and Black.Building on the success of the Xperia XA models launched last year, Xperia XA1 and the 6&rdquo; large screen XA1 Ultra feature a beautiful borderless design with edge-to-edge screens. Both will surpass camera expectations with high-end rear camera specs including 23MP sensors and low-light capabilities, whilst XA1 Ultra has been designed specifically for selfie lovers with its superior 16MP front camera.Xperia XA1 and Xperia XA1 Ultra will roll out from Spring 20176 with Android Nougat at launch in a choice of contemporary finishes; White, Black, Pink7 and Gold.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Source:- Sony Press Release&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', 0, 'aldivo_sony4.jpg', '', 'Sony Mobile at Mobile World Congress 2017', 'Sony Mobile at Mobile World Congress 2017', 'Sony Mobile at Mobile World Congress 2017', 1, '2017-04-04 00:00:00', NULL),
(10, '49', 'With a Oneness Design Philosophy, ', 'with-a-oneness-design-philosophy-the-galaxy-s8-is-redefining-the-smartphone', 'post', 'With a Oneness Design Philosophy, the Galaxy S8 is Redefining the Smartphone', 0, '<p style=\"text-align:justify\"><strong>with-a-oneness-design-philosophy-the-galaxy-s8-is-redefining-the-smartphone</strong></p>\r\n\r\n<p style=\"text-align:justify\">When Samsung&rsquo;s product designers set out to create the new Galaxy S8, their approach was to look at the overall experience, with both hardware and software working together with the user. They wanted to design a device that would blend seamlessly into your life by achieving harmony between technology, design and human nature.<br />\r\n&nbsp;<br />\r\nThe designers carefully examined every aspect of the smartphone: From shape and form, the materials used, how it felt in the hand and its colors, to advanced functionality and user experience. They then went back to the very essence of the device in developing the Galaxy S8, focusing on creating more natural interactions, with fewer interferences for a seamless experience for users.<br />\r\n&nbsp;<br />\r\nArriving at the end-result that became the Galaxy S8, Samsung&rsquo;s team of designers removed all unnecessary technical elements to create more natural interactions, achieving total design refinement, with a stripped back, bezel-less display and removing the home button for immersive interaction.<br />\r\n&nbsp;<br />\r\nThe idea of &ldquo;becoming one with nature&rdquo; is much more than just an adage to live by, but rather an existential approach that should transcend our daily routines. This same concept of &ldquo;Oneness&rdquo; can also be applied to product design, especially with devices like the smartphones which we constantly touch and interact with all throughout the day as a gateway to our digital lives.<br />\r\n&nbsp;<br />\r\nBorn from the idea of neutrality and integrating naturally into an environment, the Galaxy S8&rsquo;s harmonious design is inspired by the smooth edges of a pebble, built for easy one handed control, combining form and function with neutral rounded lines. The product designers responsible for the Galaxy S8 solved the conceptual dilemma known as the &ldquo;paradox of size&rdquo; by maximizing the front surface, in essence developing a bigger screen without the need for a bigger phone and allowing for a more natural flow from screen to real world with uninterrupted glass, more screen and less scrolling.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">At a first glance, the Galaxy S8 captivates us with its rich, natural colors that draws upon the natural appearance of sunlight passing through a droplet of water. Samsung calls this &ldquo;liquid shade,&rdquo; and it is the inspiration behind the device&rsquo;s color palette &ndash; Midnight Black, Arctic Silver, Orchid Gray, Coral Blue and Maple Gold.<br />\r\n&nbsp;<br />\r\nThe barrier-defying Infinity Display, draws the viewer in, with a wondrous bezel-less curved screen and a symmetrical, curved design creates a more immersive experience with the device, for both navigation and apps.<br />\r\n&nbsp;<br />\r\nTo complement the refined exterior design of the Galaxy S8, it was crucial for the user experience (UX) design to be built from the same &ldquo;Oneness&rdquo; philosophy, continuing that natural connection between the device and user.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">The Galaxy S8&rsquo;s Infinity wallpaper from the Always-On-Display, fluid navigation and redesigned iconography based on the organic lines and curves of the Galaxy S8, all work in sync to unlock the user experience, creating a seamless and continuous experience across displays.<br />\r\n&nbsp;<br />\r\nWith a design and UX that are based on natural interactions and movements, the Galaxy S8 is truly a meaningful innovation that is the perfect unity of design, technology and experience, that organically fits into our lives, aimed to compliment rather than complicate. By keeping their focus on &ldquo;Oneness,&rdquo; Samsung&rsquo;s designers and engineers have created something that is more than just a piece of technology.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Source:- &nbsp;Samsung mobile press</p>\r\n', 0, 'aldivo_samsung2.jpg', '', 'With a Oneness Design Philosophy, the Galaxy S8 is Redefining the Smartphone', 'With a Oneness Design Philosophy, the Galaxy S8 is Redefining the Smartphone', 'With a Oneness Design Philosophy, the Galaxy S8 is Redefining the Smartphone', 1, '2017-04-06 00:00:00', NULL),
(11, '49', 'Moto G5 launches exclusively on Amazon.in', 'moto-g5-launches-exclusively-on-amazonin', 'post', 'Moto G5 launches exclusively on Amazon.in', 0, '<p style=\"text-align:justify\">Lenovo-owned Motorola is all scheduled to release the next version of their most popular phone on the midnight of April 4h through Amazon.in. Yes, you can mark it as one of the biggest event in the smartphone industry and hats off to Amazon.in that it took this great endeavor to launch this phone exclusively for the common people.</p>\r\n\r\n<p style=\"text-align:justify\">The Moto G5 was unveiled along with the Moto G5 Plus at the Mobile World Congress 2017, and since then, both the devices have generated much hype. The Motorola Moto G5 makes several improvements over the last year&rsquo;s version making it the ideal budget premium. The Moto G5 will be exclusively available on Amazon India. Like the G5 Plus, the G5 will also come in two variants with varying RAM and onboard storage. The base model will be available from Amazon India along with lucrative offers.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<strong>A Premium Feel</strong></p>\r\n\r\n<p style=\"text-align:justify\">The most noticeable upgrade to this G series device from Motorola is the metal body. The phones are available in Lunar Gray or Fine Gold. This is the first time that Motorola&rsquo;s G series phones are getting an all metal treatment. What&rsquo;s more interesting the removable battery cover with user replaceable battery and nano SIM slots under the cover. Regarding specifications, the G5 is obviously a bit more modest regarding specifications, but bears the same premium look and feel as that of Motorola&rsquo;s high-end phones. This makes it one of the biggest selling points of the Motorola Moto G5.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<strong>Display</strong></p>\r\n\r\n<p style=\"text-align:justify\">Motorola Moto G5 has received a significant upgrade in the display department. The screen is slightly smaller than that of G4 but now comes with 1920x1080 pixels. This makes the display look amazingly sharp with a pixel density of 440ppi, which is even higher than that of the G5 Plus. The display comes with Gorilla Glass 3 with a hydrophobic nano-coating making it smudge proof. Beneath the display, Motorola also incorporated a fingerprint sensor in the home button for faster and more secure authentication.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<strong>Specifications</strong></p>\r\n\r\n<p style=\"text-align:justify\">The Motorola Moto G5 will use a Qualcomm Snapdragon 430 SoC that has eight cores and is clocked at 1.4GHz. There will be two variants &ndash; one will have 3GB RAM and 16GB on board storage and the other will have 3GB RAM with 32 GB on board storage. The storage can be expanded up to 128GB using microSD card. The devices will come with a 2,800 mAh battery that can last a day with a full charge and will run on Android 7 out of the box.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<strong>Camera and Optics</strong></p>\r\n\r\n<p style=\"text-align:justify\">The G5 comes with a 13MP rear-facing camera with phase detect autofocus or PDAF. The Moto G4 also have the same pixel count but missed out on PDAF. &nbsp;It has a pixel pitch of 1.1&micro;m and an aperture of f/2.0, making it a decent shooter in low light too. The camera bump of the G5 is less than that of G5 Plus, thereby making it slimmer and more ergonomic. The front camera has a 5MP sensor with f/2.2 aperture. It comes with an auto-HDR mode but does not come with a flash.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<strong>Pricing, Availability and Offers</strong></p>\r\n\r\n<p style=\"text-align:justify\">The Moto G5 16GB with 3GB RAM will be on sale at Amazon India at 11,999. Amazon Prime members are eligible for up to 1,000 INR cash back as Amazon Pay Balance. Also, those buying using HDFC Bank Credit Cards will get the same 1,000 cash back for buying the Moto G5. The offer is available only on 5th and 6th April, 2017. Those exchanging their old phones can also get up to and additional 500 off.</p>\r\n\r\n<p style=\"text-align:justify\">The phone will be available for purchase as long as stocks last. The Moto G5 Plus sold out in a day. Similarly, the Moto G5 with its price tag, and lucrative offers from Amazon, is also expected to be sold out in a short period of time.<br />\r\nFinal Thoughts</p>\r\n\r\n<p style=\"text-align:justify\">With a price tag of 11,999 INR, the Motorola Moto G5 is an excellent device for those who wants to experience the premium segment without burning a hole in their pocket. And thanks to amazon.in for bringing such a great phone to the market. It is a well-balanced phone that offers very decent specifications for the price. Also, Motorola is highly focused on user experience and provides a near-stock version of Android that keeps the device running smoothly no matter what.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Source:-http://www.abplive.in</p>\r\n', 0, 'aldivo17.jpg', '', 'Moto G5 launches exclusively on Amazon.in', 'Moto G5 launches exclusively on Amazon.in', 'Moto G5 launches exclusively on Amazon.in', 1, '2017-04-07 00:00:00', NULL),
(12, '49', 'Nokia 3310, other models ', 'nokia-3310-other-models-to-be-made-in-india-launch-in-june', 'post', 'Nokia 3310, other models to be made in India, launch in June', 0, '<p style=\"text-align:justify\"><strong>BARCELONA: Finnish firm HMD Global, which has right to market Nokia brand, is likely to make all devices of the historic phone company in India including the iconic &quot;Nokia 3310&quot;.</strong></p>\r\n\r\n<p style=\"text-align:justify\">&quot;We will attempt to ensure all our products are made in India. We will source all our product from India,&quot; HMD Mobile India Vice President Ajey Mehta said.</p>\r\n\r\n<p style=\"text-align:justify\">HMD Global, which has struck a 10-year brand licensing agreement with Nokia for mobile phones and tablets, will launch a new version of the 17-year old &#39;Nokia 3310&#39; during April-June for around Rs 3,500 a unit.</p>\r\n\r\n<p style=\"text-align:justify\">It will also bring in Android-powered Nokia 6, Nokia 5 and Nokia 3 to India during the second quarter itself.</p>\r\n\r\n<p style=\"text-align:justify\">Taiwanese electronic company Foxconn is manufacturing partner of HMD Global.</p>\r\n\r\n<p style=\"text-align:justify\">At present, some feature phones are already being manufactured in India at Foxconn facility.</p>\r\n\r\n<p style=\"text-align:justify\">Mehta said the company is even evaluating development of 4G feature phone.</p>\r\n\r\n<p style=\"text-align:justify\">&quot;We are evaluating all opportunity in the market,&quot; Mehta said, adding India is very important market for HMD Global.</p>\r\n\r\n<p style=\"text-align:justify\">&quot;All consumer requirements are fed up to the product team at our company which then develops the final product,&quot; Mehta said.</p>\r\n\r\n<p style=\"text-align:justify\">The company will sell Nokia phones through both offline and online channels.</p>\r\n\r\n<p style=\"text-align:justify\">&quot;Whichever channel will help reach us to consumers, we will go with that. We will be channel agnostic both offline and online. We currently cover close to 80,000 retailers but we plan to increase that in the future,&quot; Mehta said.</p>\r\n\r\n<p style=\"text-align:justify\">He said the company is also boosting its after sales service channel and will have direct presence in at least around 250 towns in the country by the time phones are launched.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(98, 98, 98); font-family:myriad-pro; font-size:15px\">Source:&nbsp;</span>http://www.abplive.in</p>\r\n', 0, 'aldivo5.png', '', 'Nokia 3310, other models to be made in India, launch in June', 'Nokia 3310, other models to be made in India, launch in June', 'Nokia 3310, other models to be made in India, launch in June', 1, '2017-04-07 00:00:00', NULL),
(13, '49', 'Motorola Moto G5 Plus', 'motorola-moto-g5-plus-is-the-best-selling-mobile-phones', 'post', 'Motorola Moto G5 Plus is the Best Selling Mobile Phones ', 0, '<p><strong>About Motorola Moto G5 Plus</strong></p>\r\n\r\n<p><span style=\"font-size:20px\"><span style=\"color:rgb(0, 188, 212); font-family:open sans,arial,sans-serif,ruble\">Specifications</span></span></p>\r\n\r\n<p><strong>NETWORK &nbsp; &nbsp; &nbsp;&nbsp;</strong><span style=\"color:#000000\">Technology&nbsp;&nbsp; &nbsp;</span>GSM / CDMA / HSPA / EVDO / LTE<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color:#000000\">2G bands</span>&nbsp;&nbsp; &nbsp;GSM 850 / 900 / 1800 / 1900 - SIM 1 &amp; SIM 2&nbsp; &nbsp; &nbsp;CDMA 800 / 1900 - XT1687 (USA)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color:#000000\">3G bands</span>&nbsp;&nbsp; &nbsp;HSDPA 850 / 900 / 1700(AWS) / 1900 / 2100 - XT1687 (USA)&nbsp; CDMA2000 1xEV-DO - XT1687 (USA)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;HSDPA 850 / 900 / 1900 / 2100 - XT1684, XT1685<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color:#000000\">4G bands</span>&nbsp;&nbsp; LTE band 1(2100), 2(1900), 3(1800), 4(1700/2100), 5(850), 7(2600), 8(900), 12(700), 13(700), 17(700), 25(1900), &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;26(850), 38(2600), 41(2500), 66(1700/2100) - XT1687 (USA)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;LTE band 1(2100), 3(1800), 5(850), 7(2600), 8(900), 19(800), 20(800), 28(700), 38(2600), 40(2300), 41(250