\n<p>&nbsp;</p>\r\n\r\n<p>Operating system<br />\r\nAndroid&trade; 7.0, Nougat</p>\r\n\r\n<p>System architecture/processor<br />\r\nQualcomm&reg; Snapdragon&trade; 625 processor with 2.0 GHz octa-core CPU and 650 MHz Adreno 506 GPU</p>\r\n\r\n<p>Memory (RAM)<br />\r\n3 GB / 4 GB</p>\r\n\r\n<p>Storage (ROM)<br />\r\n16 GB / 32 GB internal, up to 128 GB microSD Card support</p>\r\n\r\n<p>Dimensions<br />\r\nHeight: 150.2 mm<br />\r\nWidth: 74.0 mm<br />\r\nDepth: 7.7 mm to 9.7 mm</p>\r\n\r\n<p>Weight<br />\r\n155 g</p>\r\n\r\n<p>Display<br />\r\n13.20cm (5.2)<br />\r\nFull HD 1080p (1920 x 1080)<br />\r\n424 ppi<br />\r\nCorning&trade; Gorilla&trade; Glass 3</p>\r\n\r\n<p>Battery<br />\r\nAll-day battery&dagger; (3000 mAh)<br />\r\n15W TurboPower&trade; charger for up to 6 hours of power in 15 minutes of charging&dagger;</p>\r\n\r\n<p>Water protection<br />\r\nWater repellent nano-coating&sect;</p>\r\n\r\n<p>Networks<br />\r\n4G LTE<br />\r\nUMTS/HSPA+<br />\r\nGSM/EDGE</p>\r\n\r\n<p>Straps (by model)<br />\r\nMoto G Plus - XT1686<br />\r\nGSM/GPRS/EDGE (850, 900, 1800, 1900 MHz)<br />\r\nUMTS/HSPA+ (850, 900, 2100 MHz)<br />\r\n4G LTE (B1, 3, 5, 8, 40)</p>\r\n\r\n<p>Band coverage varies by model, country, and carrier.</p>\r\n\r\n<p>Sensors<br />\r\nFingerprint reader<br />\r\nAcceleromter<br />\r\nGyroscope<br />\r\nAmbient Light<br />\r\nProximity</p>\r\n\r\n<p>&nbsp;<br />\r\nRear camera<br />\r\n12 MP with Dual Autofocus Pixels<br />\r\n&fnof;/1.7 aperture<br />\r\nColour balancing dual LED flash<br />\r\n8X digital zoom for photos, 4X for video<br />\r\nDrag to focus &amp; exposure<br />\r\nQuick Capture<br />\r\nTap (anywhere) to capture<br />\r\nBest Shot<br />\r\nProfessional Mode<br />\r\nBurst mode<br />\r\nAuto HDR<br />\r\nPanorama<br />\r\nVideo stabilisation<br />\r\n4K Ultra HD (30 fps)<br />\r\nSlow Motion video</p>\r\n\r\n<p>Front camera<br />\r\n5 MP<br />\r\nWide-angle lens<br />\r\n&fnof;/2.2 aperture<br />\r\nDisplay flash<br />\r\nProfessional mode<br />\r\nBeautification mode</p>\r\n\r\n<p>Video capture<br />\r\n4K Ultra HD (30 fps)</p>\r\n\r\n<p>Speakers/microphones<br />\r\nFront-ported loud speaker<br />\r\n2-Mics</p>\r\n\r\n<p>SIM Card<br />\r\nDual nano-SIM</p>\r\n\r\n<p>Connectivity<br />\r\nMicro USB, 3.5mm headset jack</p>\r\n\r\n<p>Bluetooth&reg; technology<br />\r\nBluetooth version 4.2</p>\r\n\r\n<p>Wi-Fi<br />\r\n802.11 a/b/g/n (2.4 GHz + 5 GHz)</p>\r\n\r\n<p>Location services<br />\r\nGPS<br />\r\nA-GPS<br />\r\nGLONASS</p>\r\n\r\n<p>NFC<br />\r\nYes</p>\r\n\r\n<p>Base colour<br />\r\nLunar Gray or Fine Gold</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 0, 'Moto_G5.jpg', '', 'Motorola Moto G5 Plus', 'Motorola Moto G5 Plus', 'Motorola Moto G5 Plus', 1, '2017-04-10 00:00:00', NULL),
