ca,sans serif\">vailable on</span><span style=\"color:rgb(0, 0, 0); font-family:arial,helvetica,sans serif\">&nbsp; www.amazon.in</span></p>\r\n', 0, 'Honor_6X.jpg', '', 'Huawei Honor 6X', 'Huawei Honor 6X', 'Huawei Honor 6X', 1, '2017-04-10 00:00:00', NULL),
(16, '49', 'Redmi 4A', 'redmi-4a-is-the-best-selling-mobile-phones', 'post', 'Redmi 4A is the Best Selling Mobile Phones', 0, '<h4><span style=\"font-size:20px\"><strong>About Redmi 4A</strong></span></h4>\r\n\r\n<p><span style=\"font-size:20px\"><span style=\"color:rgb(0, 188, 212); font-family:open sans,arial,sans-serif,ruble\">Specifications</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><strong>Processor &amp; Memory</strong></span><br />\r\n2GB RAM + 16GB Flash<br />\r\nSnapdragon 425 quad-core 1.4GHz max<br />\r\nAdreno 308 500MHz<br />\r\nSupports expandable storage up to 128GB (VFAT format)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\"><strong>Dimensions</strong></span><br />\r\nHeight: 139.9mm<br />\r\nWidth: 70.4mm<br />\r\nThickness: 8.5mm<br />\r\nWeight: 131.5g</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\"><strong>Battery</strong></span><br />\r\n3120mAh (typ) / 3030mAh (min) high-capacity battery</p>\r\n\r\n<p>Non-removable</p>\r\n\r\n<p>5V/1A charging</p>\r\n\r\n<p><span style=\"font-size:18px\"><strong>Camera and video</strong></span><br />\r\n<strong>13MP rear camera</strong><br />\r\n5-element lens, &fnof;/2.2 aperture<br />\r\nSingle LED flash<br />\r\nLow light enhancement<br />\r\nHDR<br />\r\nPanorama<br />\r\nBurst mode<br />\r\nFace recognition<br />\r\nReal-time filters</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5MP front camera</strong><br />\r\n&fnof;/2.2 large aperture<br />\r\nSelfie countdown<br />\r\nFace recognition</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 0, 'Redmi_4A1.jpg', '', 'Redmi 4A', 'Redmi 4A', 'Redmi 4A', 1, '2017-04-10 00:00:00', NULL),
(17, '49', 'F3 Plus  Black Edition', 'oppo-launches-the-new-bold-variant-of-f3-plus-black-edition', 'post', 'OPPO launches the new bold variant of F3 Plus  Black Edition', 0, '<p style=\"text-align:justify\">OPPO, an ever-evolving global Smartphone brand, has officially begun the sale of the F3 Plus black edition on April 15. This black-hued variant of the flagship F3 Plus features OPPO&rsquo;s unique dual selfie camera: a 16MP front-facing selfie camera and a first-of-its-kind wide-angle group selfie camera, Priced at Rs 30,990, the F3 Plus black edition is an alternate color option along with the previously announced gold edition, and will be available in India.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;The black color offers a sleek and contemporary style that has been popular with smartphone users around the world. Most importantly, we want to give our customers the ability to personalize their F3 Plus by offering a variety of color options,&rdquo; said Sky Li, OPPO Vice President and Managing Director of International Mobile Business.<br />\r\n&nbsp;<br />\r\nIn addition to the dual selfie camera, the F3 Plus also contains a powerful 16-megapixel rear-facing camera. It utilizes a customized IMX398 sensor, OPPO&rsquo;s pioneering dual PDAF and f/1.7 big aperture to ensure picture-perfect image quality even in low-light conditions.<br />\r\n&nbsp;<br />\r\nOPPO&rsquo;s F3 Plus possesses other leading design features, including the ColorOS 3.0 operating system, thin body design with 6-inch screen, dual-slot card tray and an octa-core processor backed by 4GB RAM. Furthermore, a 4,000mAh built-in battery gives the F3 Plus an endurane of more than 17 hours in simulation test. And through OPPO&rsquo;s industry-leading VOOC Flash Charge Solution, the battery will charge four times faster than standard batteries.</p>\r\n\r\n<p style=\"text-align:justify\">Source:- Oppo Press</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n', 0, 'F3PlusBlackEdition__312x3202.jpg', '', 'OPPO launches the new bold variant of F3 Plus  Black Edition', 'OPPO launches the new bold variant of F3 Plus  Black Edition', 'OPPO launches the new bold variant of F3 Plus  Black Edition', 1, '2017-05-04 00:00:00', NULL),
(18, '49', 'OPPOs Master Stroke with Team India', 'oppos-master-stroke-with-team-india', 'post', 'Oppo will be the Indian cricket team\'s new jersey sponsor from April for five years', 0, '<p style=\"text-align:justify\"><strong>Experts Coming Together, OPPO&rsquo;s Master Stroke with Team India</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong><span style=\"font-family:arial,helvetica,sans serif\">Oppo will be the Indian cricket team&#39;s new jersey sponsor from April for five years</span></strong></p>\r\n\r\n<p style=\"text-align:justify\">OPPO, the world&rsquo;s leading camera phone brand is the proud new Official Team Sponsor of the Indian National Cricket Team, as declared by the Board of Control for Cricket in India (BCCI). The partnership with BCCI will start from 01st April 2017 and will run for a period of five years.<br />\r\n&nbsp;<br />\r\nThis is a new step of OPPO in the field of cricket after becoming the official Global Partners of the International Cricket Council for 4 years from 2016 onwards.<br />\r\n&nbsp;<br />\r\nSpeaking on the partnership, Mr. Rahul Johri, CEO, BCCI said &ldquo;On behalf of the BCCI, I would like to congratulate OPPO Mobiles India Pvt. Ltd., on winning the rights and welcome them to the BCCI family. OPPO Mobiles and the BCCI share a common vision and I am confident that we will work together to further grow Indian cricket.&rdquo;<br />\r\n&nbsp;<br />\r\nThe team sponsorship rights include the right to be called the official team sponsor, and to display a commercial logo on the National Men&#39;s, Women&#39;s, Under-19 and India A teams&#39; kits.<br />\r\n&nbsp;<br />\r\nMr. Sky Li, Global VP &amp; President of OPPO India said, &ldquo;Cricket in India is not just a sport, but also a way of life and culture, especially amongst the youth. The Indian National Cricket Team is the essence of cricket in India and the team&rsquo;s spirit of marching forward and pursuing newer heights is highly consistent with OPPO&rsquo;s pursuit of products with unmatched photography experience.&rdquo;<br />\r\n&nbsp;<br />\r\nSky added,&ldquo;The Indian national team receives high reputation and influence among young people. By partnering with the team, OPPO will not only further enhance its connection with the young consumers, but also engage with the country&rsquo;s youth in its endeavor of providing them with the outstanding selfie-led photography experience.&rdquo;<br />\r\n&nbsp;<br />\r\nOPPO leads the smartphone photography developments in the industry. It started the trend of selfie beautification, first launched the motorized rotating camera phone N3, screen flash and other photography feature. In 2015, in line with its deep insight of young people&rsquo;s behavior, OPPO first launched selfie focused smartphones&mdash;&mdash;Selfie Expert F series in India. And its first batch products F1, F1 Plus and F1s received warm welcome and the brand leads the selfie trend in the country. Now the brand&rsquo;s share in the offline market reached 11.7 percent and is ranked No.2 in the market, as of Jan 2017, as reported by research firm GFK.<br />\r\n&nbsp;<br />\r\nOPPO is a young and dynamic company and has already established itself as one of the world&rsquo;s leading smartphone brand with a base of more than 100 million young customers using OPPO mobile phones globally and the brand has become the most welcomed camera phone brand across the young Indians.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Source:- Oppo Press</p>\r\n', 0, 'Sky_Li-Global_VP_President-OPPO_India_Rahul_Johri-CEO_BCCI_Diana_Edulji-BCCI.jpg', '', 'Oppo will be the Indian cricket team\'s new jersey sponsor from April for five years', 'Oppo will be the Indian cricket team\'s new jersey sponsor from April for five years', 'Oppo will be the Indian cricket team\'s new jersey sponsor from April for five years', 1, '2017-05-04 00:00:00', NULL),
(19, '49', 'iOS 11 brings new features ', 'ios-11-brings-powerful-new-features-to-iphone-and-ipad-this-fall', 'post', 'Biggest Software Release Ever for iPad and New AR Experiences .', 0, '<p style=\"text-align:justify\"><strong>San Jose, California </strong>&mdash; Apple today previewed iOS 11, a major update to the world&rsquo;s most advanced mobile operating system, bringing new experiences and hundreds of features to iPhone and iPad this fall. iOS 11 is the biggest software release ever for iPad, with powerful multitasking features, the Files app and more ways to use Apple Pencil. Augmented reality is coming to hundreds of millions of iOS devices with a new platform for developers to build apps that let users place virtual content on top of real-world scenes. CoreML gives developers on-device machine learning capabilities so they can easily make apps that will predict, learn and become more intelligent. Additional features include the ability to pay friends using Apple Pay, Do Not Disturb while driving to help users stay more focused on the road, even more intelligence and a new voice for Siri and new professional capabilities to Photos and Camera. iOS 11 is available as a developer preview today and will be a free software update for iPhone and iPad this fall.&nbsp;<br />\r\nhttps://www.apple.com/in/newsroom/2017/06/ios-11-brings-new-features-to-iphone-and-ipad-this-fall/?imgid=1496264266548</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><img alt=\"\" src=\"http://www.aldivo.com/img/uploads/aldivo_blogs1.gif\" /><br />\r\n&nbsp;<br />\r\niOS 11 features deeper integration with Apple Pencil with Instant Markup, inline drawing and more.<br />\r\n&ldquo;With iOS 11, we&rsquo;re delivering the biggest AR platform in the world, and it&rsquo;s available today for developers to begin building AR experiences using ARKit for hundreds of millions of iPhone and iPad users,&rdquo; said Craig Federighi, Apple&rsquo;s senior vice president of Software Engineering. &ldquo;iOS 11 gives iPad users the powerful app functionality they need to take advantage of everything iPad is capable of, and brings hundreds of new features and incredible updates to the iOS apps iPhone and iPad users enjoy every day.&rdquo;<br />\r\niPad Becomes Even More Powerful&nbsp;<br />\r\nhttps://www.apple.com/in/newsroom/2017/06/ios-11-brings-new-features-to-iphone-and-ipad-this-fall/?imgid=1496264446029<br />\r\n&nbsp;<br />\r\n<strong>iOS 11 is the biggest release ever for iPad.</strong><br />\r\niOS 11 makes multitasking on iPad even more powerful with a new customisable Dock that provides quick access to frequently used apps and documents from any screen, and a redesigned app switcher makes it easier to move between pairs of active apps, used in Split View and now Slide Over. The new Files app keeps everything in one place, whether files are stored locally, in iCloud Drive or across other providers like Box, Dropbox and more, and with Drag and Drop available across the system, moving images and text is easier than ever. Apple Pencil is more deeply integrated into iPad with support for inline drawing and a new Instant Notes feature opens Notes from the Lock Screen by simply tapping Apple Pencil on the display.<br />\r\n<strong>AR Experiences for iPhone and iPad</strong><br />\r\nAR Kit makes it easy for developers to create new experiences for iPhone and iPad.<br />\r\nApple is introducing a new platform for developers to help them bring high-quality AR experiences to iPhone and iPad using the built-in camera, powerful processors and motion sensors in iOS devices. ARKit allows developers to tap into the latest computer vision technologies to build detailed and compelling virtual content on top of real-world scenes for interactive gaming, immersive shopping experiences, industrial design and more.<br />\r\n<strong>Siri Is Even More Useful and More Natural</strong><br />\r\nSiri is the most popular personal assistant in the world with more than 375 million active devices accessing Siri each month across 36 countries. Using the latest advancements in machine learning and artificial intelligence, new male and female voices are more natural and expressive, adjusting intonation, pitch, emphasis and tempo while speaking, and can translate English words and phrases into Chinese, French, German, Italian or Spanish. Siri extends beyond voice, using on-device learning to deliver more personal experiences and offers suggestions based on personal usage of Safari, News, Mail, Messages and more. For example, as Siri learns topics or places a user is interested in while browsing Safari, they will be suggested when typing in Mail, Messages and other apps.<br />\r\nProfessional Camera and Photos Features&nbsp;<br />\r\nhttps://www.apple.com/in/newsroom/2017/06/ios-11-brings-new-features-to-iphone-and-ipad-this-fall/?imgid=1496264696575<br />\r\n&nbsp;<br />\r\n<strong>New Loop and Bounce effects make every photo more expressive.</strong><br />\r\nWith iOS 11, Portrait Mode images can be taken with optical image stabilisation, True Tone flash and HDR, so every shot looks even more professional. Live Photos are more expressive with new Loop and Bounce effects that create continuous video loops, while Long Exposure can capture time and movement. In Photos, Memory movies are optimised to play in both portrait and landscape orientation, and more memories, such as photos of pets or birthdays, are automatically created. With iOS 11, Apple introduces a new technology called High Efficiency Image File Format (HEIF) that reduces the file size of every photo taken with iPhone 7 and iPhone 7 Plus.<br />\r\n<strong>Do Not Disturb While Driving</strong><br />\r\nprevious<br />\r\nnext<br />\r\nhttps://www.apple.com/in/newsroom/2017/06/ios-11-brings-new-features-to-iphone-and-ipad-this-fall/?imgid=1496538409615<br />\r\nhttps://www.apple.com/in/newsroom/2017/06/ios-11-brings-new-features-to-iphone-and-ipad-this-fall/?imgid=1496538412414<br />\r\nhttps://www.apple.com/in/newsroom/2017/06/ios-11-brings-new-features-to-iphone-and-ipad-this-fall/?imgid=1496538415326<br />\r\n&nbsp;<br />\r\nDo Not Disturb while driving helps drivers stay more focused on the road. Do Not Disturb while driving helps drivers stay more focused on the road. Do Not Disturb while driving helps drivers stay more focused on the road.<br />\r\niOS 11 introduces a new way to help drivers stay more focused on the road with Do Not Disturb while driving. iPhone can detect when you may be driving and automatically silence notifications to keep the screen dark. Users have the option of sending an auto reply to contacts listed in Favourites to let them know they are driving and cannot respond until they arrive at their destination.</p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<strong>Additional iOS 11 Features:</strong><br />\r\nApp Store is redesigned to make discovering apps and games easier than ever before. Through in-depth features and interviews, App Store editors will uncover the stories behind iOS developers, and the incredible apps and games they create.<br />\r\nApp Store for iMessage has a redesigned app drawer for more convenient access to apps and stickers, so it&rsquo;s easier to decorate messages, share a song and more.<br />\r\nControl Center offers more customisation, enabling quick access to frequently used controls all on one page, and a new Lock Screen delivers a more convenient way to see Notifications all in one place.<br />\r\nApple Maps adds indoor maps for major airports and shopping centers around the world and lane guidance to avoid missing a turn or exit.<br />\r\nHome supports more categories of accessories including AirPlay 2 speakers and more ways to automate your home with new triggers.<br />\r\nAirPlay 2 offers multi-room audio enabling users to easily control speakers using Control Center, the Home app or Siri.<br />\r\nApple Music offers more ways to discover music with friends. Subscribers can create a profile so their friends can follow them, listen to playlists they&rsquo;ve shared and see the music they listen to most.<br />\r\nApple News is even better at keeping readers informed and entertained with personalised top stories and suggestions from Siri, great stories curated daily by Apple News editors in the new Spotlight tab and the best videos of the day in Today View.*<br />\r\nOne-handed keyboard mode on iPhone makes typing on the go even easier and a new QuickType keyboard on iPad delivers quick access to numbers, symbols and punctuation.<br />\r\n<strong>iOS 11 for Developers</strong><br />\r\nAt the Worldwide Developers Conference, Apple demonstrated the power of bringing new AR experiences to iPhone and iPad and introduced additional tools to help millions of talented developers around the world bring new features and experiences to over one billion active Apple devices.<br />\r\nCoreML makes it easy for developers to create smarter apps with powerful machine learning that predict, learn and become more intelligent. Designed for iOS, this new framework for machine learning lets all processing happen locally on-device, using Apple&rsquo;s custom silicon and tight integration of hardware and software to deliver powerful performance while maintaining user privacy.<br />\r\nHomeKit is even more accessible, with easier ways for developers and hobbyists to get started and new ways to authenticate devices using software &mdash; a great way for existing accessories to support HomeKit.<br />\r\nSiriKit gives developers the ability to integrate Siri into their apps, and with iOS 11 it expands to support more categories, including to-do lists, notes and reminders; banking for account transfers and balances; and apps that display QR codes.<br />\r\nMusicKit allows developers to integrate Apple Music features into their apps, providing access to over 40 million songs, recommendations, featured content and recent search.<br />\r\nAvailability<br />\r\nThe developer preview of iOS 11 is available to iOS Developer Program members at developer.apple.com starting today, and a public beta program will be available to iOS users later this month at beta.apple.com. iOS 11 will be available this fall as a free software update for iPhone 5s and later, all iPad Air and iPad Pro models, iPad 5th generation, iPad mini 2 and later and iPod touch 6th generation. Person to person payments and Apple Pay Cash will be available in the US on iPhone SE, iPhone 6 and later, iPad Pro, iPad 5th generation, iPad Air 2, iPad mini 3 and Apple Watch this fall. For more information, visit apple.com/in/ios/ios-11-preview. Features are subject to change. Some features may not be available in all regions or all languages.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Source :-&nbsp;apple.com&nbsp;newsroom</p>\r\n', 0, 'aldivo23.jpg', '', '', '', '', 1, '2017-06-22 00:00:00', NULL);
INSERT INTO `post` (`id`, `category_id`, `post_title`, `slug`, `post_type`, `excerpt`, `route_id`, `description`, `layout`, `image`, `attachment`, `seo_title`, `seo_description`, `seo_keywords`, `status`, `created`, `updated`) VALUES
(20, '49', 'macOS High Sierra now available as a free update', 'macos-high-sierra-now-available-as-a-free-update', 'post', 'PRESS RELEASE\r\nmacOS High Sierra now available as a free update', 0, '<div class=\"pagebody-copy\" style=\"margin-bottom: 1em; margin-top: -9px; font-family: &quot;SF Pro Text&quot;, &quot;SF Pro Icons&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 17px; letter-spacing: -0.357px; text-align: justify;\">Cupertino, California &mdash; <a href=\"https://www.aldivo.com/mobile-covers/apple-case-cover\">Apple</a> today announced macOS High Sierra, the latest release of the world&rsquo;s most advanced desktop operating system, is now available as a free update.<br />\r\nWith macOS High Sierra, Mac users gain powerful new core storage, video and graphics technologies. A new file system ensures more efficient and reliable storage, and support for High-Efficiency Video Coding (HEVC) brings stunning 4K video at lower file sizes. Metal 2 powers virtual reality content creation, faster performance and more. The Core ML developer framework makes it easy to create apps with powerful machine learning that predict, learn and become more intelligent. macOS High Sierra also includes a number of refinements to the apps Mac users enjoy everyday, including Photos and Safari.</div>\r\n\r\n<div class=\"pagebody-copy\" style=\"margin-bottom: 1em; margin-top: -9px; font-family: &quot;SF Pro Text&quot;, &quot;SF Pro Icons&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 17px; letter-spacing: -0.357px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div class=\"pagebody-copy\" style=\"margin-bottom: 1em; margin-top: -9px; font-family: &quot;SF Pro Text&quot;, &quot;SF Pro Icons&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 17px; letter-spacing: -0.357px; text-align: justify;\">&ldquo;macOS High Sierra is an important update that makes the Mac more capable and responsive, while laying the foundation for future innovations,&rdquo; said Craig Federighi, Apple&rsquo;s senior vice president of Software Engineering. &ldquo;High Sierra introduces new technologies for VR, high-efficiency video streaming, advances in storage technology and more, while apps such as Photos, Safari, Mail and Notes are refined to give users even more reasons to love their Mac.&rdquo;</div>\r\n\r\n<div class=\"pagebody-copy\" style=\"margin-bottom: 1em; margin-top: -9px; font-family: &quot;SF Pro Text&quot;, &quot;SF Pro Icons&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 17px; letter-spacing: -0.357px;\">&nbsp;</div>\r\n\r\n<div class=\"pagebody-copy\" style=\"margin-bottom: 1em; margin-top: -9px; font-family: &quot;SF Pro Text&quot;, &quot;SF Pro Icons&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 17px; letter-spacing: -0.357px;\">\r\n<p>New features in macOS High Sierra:<br />\r\nApple File System (APFS)</p>\r\n\r\n<p style=\"text-align:justify\">APFS is a new, advanced storage architecture providing an extensible foundation to support new features and future storage technologies on the Mac.<br />\r\nAPFS brings support for the latest high-capacity storage devices and delivers enhanced performance, security and reliability.<br />\r\nWith APFS, common operations such as copying files and directories are nearly instantaneous.<br />\r\nData is protected from power outages and system crashes thanks to advanced data integrity features.<br />\r\nAPFS currently supports every Mac with allflash internal storage &mdash; support for Fusion and HDD Mac systems will be available in a future update.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>High-Efficiency Video Coding (HEVC) Support</p>\r\n\r\n<p>HEVC (H.265) is a new industry standard that enables extremely efficient compression, streaming and playback of video.<br />\r\nHEVC enables users to watch 4K video files at full quality, while requiring 40 percent less storage space than the current H.264 standard.1<br />\r\nWith HEVC, Apple is enabling high-quality 4K video streaming on networks where only HD streaming was previously possible.2<br />\r\nHardware acceleration on the new iMac and MacBook Pro delivers incredibly fast and power-efficient HEVC encoding and playback.<br />\r\nDevelopers like Adobe, Blackmagic Design, GoPro and more are joining Apple in adopting HEVC.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Metal 2</p>\r\n\r\n<p style=\"text-align:justify\">Metal is Apple&rsquo;s advanced graphics technology and the fastest, most efficient way to tap into GPU power on the Mac.<br />\r\nMetal 2 supports next-generation experiences like machine learning used in speech recognition, natural language processing and computer vision.<br />\r\nMetal 2 features a refined API and improved performance that&rsquo;s helping developers, including Unity, Epic, Valve, Pixelmator and more, accelerate their future apps.<br />\r\nWith the combination of Thunderbolt 3 and Metal 2, the most demanding Mac users can now access powerful external GPUs.</p>\r\n\r\n<p>Core ML</p>\r\n\r\n<p style=\"text-align:justify\">With Core ML, Apple brings the power of machine learning to all Apple developers, enabling the creation of entirely new kinds of apps.<br />\r\nCore ML takes full advantage of Metal and Accelerate, delivering incredible power, speed and efficiency to machine learning operations such as computer vision, natural language and support for convolutional and recurrent neural networks.<br />\r\nAll of the computation and processing driven through Core ML is done on-device in a way that respects customers&rsquo; data and privacy.<br />\r\nDevelopers are already using Core ML to enhance apps like Pixelmator Pro, which uses machine learning to detect and understand various features within images and create intelligent editing solutions.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Virtual Reality Support</p>\r\n\r\n<p style=\"text-align:justify\">macOS High Sierra adds support for VR content creation for the first time, enabling developers to create immersive gaming, 3D and VR content on the Mac.<br />\r\nLeading VR companies are working with Apple to drive VR innovation on the Mac with features coming later this year.<br />\r\nValve is optimizing its SteamVR platform for macOS and enabling connection of the HTC Vive headset, while Unity and Epic are bringing their VR development tools to macOS.<br />\r\nLater this year, Final Cut Pro X will add support for professional 360-degree VR workflows with the ability to import, edit and export 360-degree video on the Mac.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Source:- Apple Newsroom</p>\r\n</div>\r\n', 0, 'macbook_highsierra_hero_desktop.jpg', '', 'macOS High Sierra now available as a free update', 'macOS High Sierra now available as a free update', 'macOS High Sierra now available as a free update', 1, '2017-11-21 00:00:00', NULL),
(21, '49', 'Nokia 3', 'nokia-3-specifications-and-features', 'post', 'Nokia 3 - Specifications and features', 0, '<p>Nokia has launched a new dual SIM smartphone in February 2017, which comes with 5 inch HD IPS LCD capacitive touch screen display with resolution of HD (720 x 1280 Pixels), and runs of android V7.0 operating system.</p>\r\n\r\n<p><img alt=\"\" src=\"http://www.images-aldivo.com/img/uploads/nokia3_2.jpg\" style=\"height:248px; width:342px\" /></p>\r\n\r\n<p>Nokia 3 phone is powered by Quad Core, 1.3 GHz, Cortex A53 Processor paired with 2GB RAM, which ensure to run the phone smoothly with multiple applications open simultaneously. The phone is also packed with 16 GB internal storage and that can be expanded up to 128 GB via microSD card. As far as battery is concerned, it has 2630 mAh non removable battery.</p>\r\n\r\n<p><a href=\"https://www.aldivo.com/mobile-covers/nokia-case-cover\"><span style=\"color:#000080\">Nokia</span></a> 3 has 8MP primary camera CMOS image censor supporting a resolution of 3260 x 2448 Pixels, and a 8MP front shooter for selfies.&nbsp; Its other sensors include light sensor, proximity sensor, accelerometer, compass, and gyroscope.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://www.images-aldivo.com/img/uploads/nokia3_1.jpg\" style=\"height:306px; width:300px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To protect the <a href=\"https://www.aldivo.com/covers/nokia/nokia-3\"><span style=\"color:#0000CD\">nokia 3 mobile back case</span></a><span style=\"color:#0000CD\"> </span>there are lots of online mobile cover shopping website in India, through which you can buy nokia 3 cover, one of the most visited online mobile covers website in India is aldivo.com, here you can buy nokia 3 printed mobile covers, nokia 3 customised printed covers, personalised printed covers, designer printed covers at best deal price. These covers not only protect the nokia 3 back case from scratches and bumps but also make it looks stylish and trendy.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://www.aldivo.com/products/nokia-3-printed-case-cover/4548\"><img alt=\"\" src=\"http://www.images-aldivo.com/img/uploads/nokia3_3.jpg\" style=\"height:300px; width:232px\" /></a>&nbsp;&nbsp;<a href=\"https://www.aldivo.com/products/nokia-3-printed-case-cover/6196\"><img alt=\"\" src=\"http://www.images-aldivo.com/img/uploads/nokia3_4.jpg\" style=\"height:300px; width:232px\" /></a>&nbsp; &nbsp;<a href=\"https://www.aldivo.com/products/nokia-3-printed-case-cover/4960\"><img alt=\"\" src=\"http://www.images-aldivo.com/img/uploads/nokia3_5.jpg\" style=\"height:300px; width:232px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n', 0, 'nokia3.jpg', '', 'Nokia 3 - Specifications and features', 'Nokia has launched a new dual SIM smartphone in February 2017, which comes with 5 inch HD IPS LCD capacitive touch screen display with resolution of HD (720 x 1280 Pixels), and runs of android V7.0 operating system.', 'nokia 3 specification, about nokia 3, technology used in nokia 3, nokia 3 features', 1, '2017-11-22 00:00:00', NULL);
