(13, 'Himalaya MEN Pimple Clear Neem Face Wash ', 'fast-and-strong-action-on-pimples', '<p>Himalaya Men Pimple Clear Neem Face Wash is a soap-free, herbal formulation that helps fight pimples in men. It is a blend of Neem and Natural Salicylic Extract that brings together their antibacterial and antiseptic properties to fight pimples. Our face wash is specially designed for men&rsquo;s skin and contains White Spice Active Boost Technology which helps in the rapid action of herbal actives.</p>\r\n', '', '', '', '', NULL, NULL, '01', 78, NULL, 'https://www.raeesworld.com/img/uploads/men-pimple-clear-neem-face-wash1.jpg', 'https://www.raeesworld.com/img/uploads/men-pimple-clear-neem-face-wash1.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 101, 2, '1', '3', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Key ingredient: Neem effectively fights against skin infections, rashes, pimples and dark spots. Natural Salicylic Extract helps unclog pores, and resolves and prevents damage caused by pimples, giving you healthy, glowing skin. Directions for use: Moisten face and neck. Apply a small amount of Himalaya Herbals Men Pimple Clear Neem Face Wash. Gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</p>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '61', '2', 1, 0, 'https://youtu.be/BYaIHSbRHUs', '', '', NULL, 5, 1, '10', 'hhhhh hhh nbn bng hggf'),
(15, 'Purifying Neem Face Wash', 'neem-turmeric-get-rid-of-troublesome-pimples', 'What it does:\r\nHimalaya\'s Purifying Neem Face Wash is a soap-free, herbal formulation that cleans impurities and helps clear pimples. A natural blend of Neem and Turmeric bring together their antibacterial and antifungal properties to prevent the recurrence of acne over time.', '', '', 'No Returns Applicable', '', NULL, NULL, '02', 0, NULL, 'https://www.raeesworld.com/img/uploads/purifying-neem-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/purifying-neem-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'Usually delivered in 7-8 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nNeem is an excellent skin care ingredient known for its antibacterial properties. It improves general skin health and immunity, combating bacterial infections such as acne, boils and ulcers. Neem tackles bacteria from the root and prevents the recurrence of pimples and blemishes. \r\n</li><li>Turmeric has been used as an antiseptic for centuries, and it is regarded as one of nature\'s most powerful healers. The herb helps to even out your skin tone and color, making it an excellent ingredient in a face wash. It also helps to retain the skin\'s elasticity, making it supple. Turmeric has strong anti-inflammatory properties, which soothe your skin.</li><li>Directions:\r\nMoisten face, apply a small quantity of Purifying Neem Face Wash and gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.\r\n\r\nSuitable for all skin types. Best for acne-prone skin.</li><li>Pack size:\r\n15ml, 50ml, 100ml, 150ml, 200ml and 300ml. </li><li>Manufactured by:\r\nThe Himalaya Drug Company\r\nMakali, Bengaluru - 562162</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(16, 'Tan Removal Orange Face Wash', 'effectively-cleanses-and-visibly-reduces-tan', 'Usually delivered in8-9 days', '', '', 'Usually delivered in 2-3 days.', 'Tan Removal Orange Face Wash\r\nEffectively cleanses and visibly reduces tan', NULL, NULL, '03', 68, NULL, 'https://www.raeesworld.com/img/uploads/tan-removal-orange-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/tan-removal-orange-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nPapain, a rejuvenating enzyme, exfoliates the skin, washes away dead, dry skin and impurities, and helps reduce tan. \r\n\r\nOrange Peel, a potent cleanser with citric properties, conditions and improves skin texture. It protects skin from damage caused by free radicals. \r\n\r\nHoney is a humectant (moisture retainer) that helps hydrate skin. It seals in moisture, resulting in soft and supple skin.</li><li>Directions for use:\r\nApply a small amount of Himalaya Tan Removal Orange Face Wash on face and neck. Use a circular motion and gently work up a lather. Wash and then pat the skin dry.</li><li>Pack size:\r\n50ml and 100ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(17, 'Oil Clear Lemon Face Wash', 'oil-clear-lemon-face-wash', '', '', '', 'Usually Delivered in 2-3 Days', 'Oil Clear Lemon Face Wash\r\nFor Oil Free Skin', NULL, NULL, '04', 63, NULL, 'https://www.raeesworld.com/img/uploads/oil-clear-lemon-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/oil-clear-lemon-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Face Wash, Himalaya', 100, 1, '0', '', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\n\r\nLemon has an overall soothing and astringent effect. The citric acid present in Lemon lightens and softens your skin. It also helps fade freckles and age spots and eliminates blackheads. Lemon removes grime and dirt and leaves your skin feeling supple and smooth.\r\n\r\nHoney is very beneficial for the skin as it attracts water to maintain moisture as well as providing nourishment to the skin. It is also a natural antiseptic as it contains antimicrobial agents that kill bacteria.</li><li>Directions for use:\r\nMoisten face, apply a small quantity of Oil Clear Lemon Face Wash and gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack size:\r\n50ml, 100ml, 150ml and 200ml</li><li> </li><li></li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(18, 'Moisturizing Aleo Vera Face Wash', 'moisturizing-aleo-vera-face-wash', '', '', '', 'Usually Delivered In 2-3 Days', 'Moisturizing Aloe Vera Face Wash\r\nRelief for Dry Skin', NULL, NULL, '05', 170, NULL, 'https://www.raeesworld.com/img/uploads/moisturizing-aloe-vera-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/moisturizing-aloe-vera-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Face Wash, Himalaya', 100, 1, '0', '', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:</li><li>Cucumber makes an excellent toner as it immediately tightens open pores. The abundant antioxidants in Cucumber rejuvenate the skin and leave it feeling soft and smooth. </li><li>Aloe Vera, known for its many healing properties, is rich in enzymes, polysaccharides and nutrients which exhibit antibacterial and antifungal action. Its hydrating, softening and intense moisturizing properties nourish the skin.</li><li>Directions for use:    \r\nMoisten face, apply a small quantity of Moisturizing Aloe Vera Face Wash and gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily. </li><li>Pack size:\r\n50ml and 100ml.</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(19, 'Fairness Kesar Face Wash', 'fairness-kesar-face-wash', '', '', '', 'Usually Delivered In 2-3 Days', 'Fairness Kesar Face Wash\r\nBeautiful, clear skin just a wash away', NULL, NULL, '06', 68, NULL, 'https://www.raeesworld.com/img/uploads/fairness-kesar-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/fairness-kesar-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>What it does:\r\nHimalayas Fairness Kesar Face Wash is a soap-free, natural formulation that brightens and rejuvenates your skin, giving it a healthy, natural glow. Enriched with Kesar, proven for its complexion enhancing properties, this face wash gives you a fairer and clearer complexion. Pomegranate nourishes, Mint cools, and Cucumber soothes your skin, leaving it refreshed.</li><li>Key ingredients:\r\nKesar is a luxurious herb that has been used in skin care for centuries for a fairer, brighter complexion. The antibacterial property of Kesar kills bacteria, helping to treat infections.\r\nCucumber makes an excellent toner as it immediately tightens open pores. The abundant antioxidants in Cucumber rejuvenate the skin and leave it feeling soft and smooth.\r\n\r\nPomegranate is a rich source of polyphenols. It is reported to possess potent antioxidant and protective benefits against free radicals generated by the environment. Pomegranate softens, hydrates and nourishes the skin.\r\n\r\nMint is an antiseptic and an excellent skin cleanser. It soothes the skin, cures infections and alleviates itching. It is also an effective treatment for pimples and can be used for treating insect bites.\r\n</li><li>Directions for use:\r\nMoisten face, apply a small quantity of Fairness Kesar Face Wash and gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack size:\r\n50ml, 100ml and 150ml. </li><li>We also recommend:\r\nFairness Kesar Face Pack\r\nClear Complexion Whitening Face Scrub</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(20, 'Clear Complexion Whitening Face Wash', 'clear-complexion-whitening-face-wash', '', '', '', 'Usually Delivered in 2-3 Days', 'Clear Complexion Whitening Face Wash\r\nRemoves Dark Spots', NULL, NULL, '07', 73, NULL, 'https://www.raeesworld.com/img/uploads/clear-complexion-whitening-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/clear-complexion-whitening-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>What it does:\r\nHimalaya\'s Clear Complexion Whitening Face Wash essentially removes dark spots, cleanses and clarifies impurities, revealing a clear, radiant and even complexion.</li><li>Key ingredients:\r\nSaffron imparts a rich color and is used in various skin care preparations. It effectively moisturizes, soothes and promotes skin fairness. The crocin and crocetin present in Saffron promote a healthy complexion and whiten skin. Saffron is very effective in the treatment of acne, pimples, blemishes and black spots.\r\n\r\nPomegranate is a rich source of polyphenols. It is reported to possess potent antioxidant and protective benefits against free radicals generated by the environment. Pomegranate softens, hydrates and nourishes the skin.\r\n\r\nLicorice is known for its skin lightening and antioxidant properties. It improves skin tone and whitens skin.\r\n\r\nWhite Dammer is a rich source of flavonoids and phenols which exhibit potent antioxidant activity. It soothes and moisturizes damaged skin, and enhances and whitens the complexion.</li><li>Directions:\r\nApply Clear Complexion Whitening Face Wash on a moist face and massage. Rinse with water and pat dry. Use morning and evening for visibly brighter, clearer and glowing skin.</li><li>Pack Size:\r\n50ml & 100ml. </li><li>We also recommend:\r\nClear Complexion Whitening Face Scrub</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(21, ' Deep Cleansing Apricot Face Wash', 'deep-cleansing-apricot-face-wash', '', '', '', 'Usually delivered in 2-3 Days', 'Deep Cleansing Apricot Face Wash\r\nFor a smoother feel', NULL, NULL, '08', 68, NULL, 'https://www.raeesworld.com/img/uploads/deep-cleansing-apricot-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/deep-cleansing-apricot-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Facewash\r\nFace Wash\r\nHimalaya\r\nHimalaya Facewash\r\nHimalaya Face Wash', 100, 1, '0', '', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>What it does:\r\nHimalayas Deep Cleansing Apricot Face Wash gently removes dead skin cells and unclogs pores to reveal softer and smoother skin. It eliminates blackheads and prevents acne from recurring.\r\n\r\nEnriched with the goodness of Red Lentil, Apricot granules, Lemon and Honey, our Deep Cleansing Apricot Face Wash leaves your skin deeply cleansed and moisturized.</li><li>Key ingredients:\r\nApricot granules gently exfoliate dead skin cells, bringing out your skin\'s natural glow.\r\n\r\nAloe Vera, known for its many healing properties, is rich in enzymes, polysaccharides and nutrients which exhibit antibacterial and antifungal action. Aloe Vera helps your skin retain its natural moisture.\r\nNeem is an excellent skin care ingredient known for its antibacterial properties. It improves general skin health and immunity, combating bacterial infections such as acne, boils and ulcers.\r\n\r\nRed Lentil is enriched with proteins, improves the complexion and gives your skin an all-natural glow.</li><li>Pack size:\r\n50ml and 100ml</li><li>Directions for use:\r\nMoisten face, and apply a small quantity of Deep Cleansing Apricot Face Wash, and gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily. Suitable for all skin types. </li><li></li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(22, 'Oil Clear Lemon Foaming Face Wash', 'oil-clear-lemon-foaming-face-wash', '', '', '', 'Usually delivered in 2-3 Days', 'Naturally balanced and oil-free skin', NULL, NULL, '09', 65, NULL, 'https://www.raeesworld.com/img/uploads/oil-clear-lemon-foaming-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/oil-clear-lemon-foaming-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Himalaya Facewash\r\nHimalaya Face Wash\r\nHimalaya\r\nfacewash\r\nface wash', 100, 1, '1', '', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Himalaya\'s Oil Clear Lemon Foaming Face Wash is a soap-free, herbal formulation that gently cleanses your face and removes excess oil. Blended with Lemon, an astringent and cooling agent, and Honey, which has natural, deep cleansing properties, the face wash leaves your skin clean without feeling dry and stretched.</li><li>Key ingredients:\r\nLemon has an overall soothing and astringent effect. The citric acid present in Lemon lightens and softens your skin. It also helps fade freckles and age spots and eliminates blackheads. Lemon removes grime and dirt and leaves your skin feeling supple and smooth.\r\n\r\nHoney is very beneficial for skin as it attracts water to maintain moisture as well as providing nourishment to the skin. It is also a natural antiseptic as it contains antimicrobial agents that kill bacteria.</li><li>Directions for use:\r\nMoisten face, apply a small quantity of Oil Clear Lemon Foaming Face Wash and gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack size:\r\n50ml and 150ml. </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(23, 'Purifying Neem Foaming Face Wash', 'purifying-neem-foaming-face-wash', '', '', '', 'Usually Delivered in 2-3 Days', 'Purifying Neem Foaming Face Wash\r\nFights skin impurities\r\n', NULL, NULL, '10', 73, NULL, 'https://www.raeesworld.com/img/uploads/purifying-neem-foaming-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/purifying-neem-foaming-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Himalaya\'s Purifying Neem Foaming Face Wash, developed after extensive research, is a combination of Neem and Turmeric. Neem is well-known for its antibacterial, antiviral and germicidal properties, which help control acne, pimples and prevent their recurrence. Turmeric has antiseptic characteristics along with skin-soothing properties.</li><li>Key ingredients:\r\nNeem is an excellent skin care ingredient known for its antibacterial properties. It improves general skin health and immunity, combating bacterial infections such as acne, boils and ulcers. Neem tackles bacteria from the root and prevents the recurrence of pimples and blemishes. \r\n\r\nTurmeric has been used as an antiseptic for centuries, and it is regarded as one of nature\'s most powerful healers. The herb helps to even out your skin tone and color, making it an excellent ingredient in a face wash. It also helps to retain the skin\'s elasticity, making it supple. Turmeric contains strong anti-inflammatory properties, which soothe your skin.</li><li>Directions:\r\nMoisten face, apply Purifying Neem Foaming Face Wash and gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.\r\n\r\nSuitable for all skin types.</li><li>Pack size:\r\n50ml and 150ml. </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(24, 'Fresh Start Oil Clear Blueberry Face Wash', 'fresh-start-oil-clear-blueberry-face-wash', '', '', '', 'Usually Delivered in 2-3 Days', 'Fruity Freshness for Oil Free Skin', NULL, NULL, '11', 75, NULL, 'https://www.raeesworld.com/img/uploads/fresh-start-oil-clear-blueberry-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/fresh-start-oil-clear-blueberry-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>What it does:\r\nHimalaya Fresh Start Oil Clear Blueberry Face Wash is a special formulation with the energizing power of luscious Blueberry and the deep cleansing action of natural beads that helps remove excess oil, dirt, and impurities. It gives you oil-free freshness throughout the day and makes your face soft, healthy, and fresh.</li><li>Key ingredients:\r\nBlueberry: The fruit contains a rich store of nutrients and antioxidants that exhibit skin-conditioning properties.\r\n\r\nIndian Gooseberry: The astringent properties in Indian Gooseberry help reduce excess skin oiliness. The tannins act as free radical scavengers.</li><li>Directions for use:\r\nApply Himalaya Fresh Start Oil Clear Blueberry Face Wash on a moist face and massage. Gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack Size:\r\n50ml and 100ml </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(25, 'Fresh Start Oil Clear Lemon Face Wash', 'fresh-start-oil-clear-lemon-face-wash', '', '', '', 'Usually Delivered in 2-3 Days', 'Fresh Start Oil Clear Lemon Face Wash\r\nFruity Freshness for Oil-Free Skin', NULL, NULL, '12', 75, NULL, 'https://www.raeesworld.com/img/uploads/fresh-start-oil-clear-lemon-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/fresh-start-oil-clear-lemon-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>What it does:\r\nHimalaya Fresh Start Oil Clear Lemon Face Wash is a special formulation with the burst of citrusy Lemon and the deep cleansing action of natural beads that helps remove excess oil, dirt, and impurities. It gives you oil-free freshness throughout the day and makes your face soft, healthy, and fresh.</li><li>Key ingredients:\r\nLemon: Widely used in cosmetics for its great skin-conditioning properties, Lemon has refreshing and astringent properties which help reduce excess facial oil.\r\n\r\nIndian Gooseberry: The astringent properties in Indian Gooseberry help reduce excess skin oiliness. The tannins act as free radical scavengers.</li><li>Directions for use:\r\nApply Himalaya Fresh Start Oil Clear Lemon Face Wash on a moist face and massage. Gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack Size:\r\n50ml and 100ml </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(26, 'Fresh Start Oil Clear Peach Face Wash', 'fresh-start-oil-clear-peach-face-wash', '', '', '', 'Usually Delivered in 2-3 Days', 'Fruity Freshness for Oil-Free Skin', NULL, NULL, '13', 75, NULL, 'https://www.raeesworld.com/img/uploads/fresh-start-oil-clear-peach-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/fresh-start-oil-clear-peach-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>What it does:\r\nHimalaya Fresh Start Oil Clear Peach Face Wash is specially formulated with the peppy freshness of Peach and the deep cleansing action of natural beads that help remove excess oil, dirt, and impurities. It gives you oil-free freshness throughout the day and makes your face soft, healthy, and fresh.</li><li>Key ingredients:\r\nPeach: Containing skin-conditioning properties, Peach enhances the appearance of the skin and restores skin softness and suppleness. \r\n\r\nIndian Gooseberry: The astringent properties in Indian Gooseberry help reduce excess skin oiliness. The tannins act as free radical scavengers.2</li><li>Directions for use:\r\nApply Himalaya Fresh Start Oil Clear Peach Face Wash on a moist face and massage. Gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Feature 4 </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(27, 'Fresh Start Oil Clear Strawberry Face Wash', 'fresh-start-oil-clear-strawberry-face-wash', '', '', '', '', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/fresh-start-oil-clear-strawberry-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/fresh-start-oil-clear-strawberry-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>What it does:\r\nHimalaya Fresh Start Oil Clear Strawberry Face Wash is specially formulated with the scintillating goodness of Strawberry and the deep cleansing action of natural beads to remove excess oil, dirt, and impurities. It gives you oil-free freshness throughout the day and makes your face soft, healthy, and fresh.</li><li>Key ingredients:\r\nStrawberry: Known to possess skin-conditioning properties, Strawberry helps enhance the appearance of facial skin and restore suppleness.\r\n\r\nIndian Gooseberry: The astringent properties in Indian Gooseberry help reduce excess skin oiliness. The tannins act as free radical scavengers.</li><li>Directions for use:\r\nApply Himalaya Fresh Start Oil Clear Strawberry Face Wash on a moist face and massage. Gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack Size:\r\n50ml and 100ml </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '61', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(28, 'Himalaya MEN Anti-Dandruff Styling Gel - Strong Hold', 'himalaya-men-anti-dandruff-styling-gel-strong-hold', '', '', '', '', '', NULL, NULL, '', 48, NULL, 'https://www.raeesworld.com/img/uploads/men-anti-dandruff-styling-gel-strong.jpg', 'https://www.raeesworld.com/img/uploads/men-anti-dandruff-styling-gel-strong.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Himalaya Men Anti-Dandruff Styling Gel* is the first-of-its-kind hair gel that reduces and controls dandruff in addition to setting your hair with a glossy finish for many hours. It is a special formulation enriched with the goodness of Tea Tree Oil, Lemon, and Bamboo. The gel helps fight dandruff and binds the hair closely together, holding the style for several hours.</li><li>Benefits:\r\nNon-sticky\r\nWet look\r\nEasy to spread\r\nFree from alcohol, parabens, and phthalates</li><li>Key ingredient:\r\nTea Tree Oil: Tea Tree Oil has antifungal activity, which is known to inhibit the occurrence of dandruff.\r\n\r\nLemon: Lemon contains flavonoids which help control free radical scavenging and also inhibit the microbes associated with skin conditions like dandruff.\r\n\r\nBamboo:Bamboo shoots are rich in Silica, which is known to keep the hair healthy and strong by retaining moisture, making the hair appear beautiful and attractive.</li><li>Directions for use:\r\nTake an appropriate amount of Himalaya Men Anti-Dandruff Styling Gel onto your palm and apply to your scalp and hair. Shape to desired style using your fingers. </li><li>Pack size:\r\n50 ml and 100 ml</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(29, 'Himalaya MEN Anti-Hair Fall Styling Gel - Strong', 'himalaya-men-anti-hair-fall-styling-gel-strong', '', '', '', '', 'Himalaya MEN Anti-Hair Fall Styling Gel - Strong\r\nStyles Hair. Reduces Hair Fall.', NULL, NULL, '', 48, NULL, 'https://www.raeesworld.com/img/uploads/men-anti-hair-fall-styling-gel-strong.jpg', 'https://www.raeesworld.com/img/uploads/men-anti-hair-fall-styling-gel-strong.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Himalaya Men Anti-Hair Fall Styling Gel* is the first-of-its-kind hair gel that sets your hair with a glossy finish for many hours. The gel is a special formulation with natural ingredients that help reduce and control hair fall. Packed with the goodness of Bhringaraja, Palasha, and Bamboo, it improves hair texture to enhance styling.</li><li>Benefits:\r\nNon-sticky\r\nWet look\r\nEasy to spread\r\nFree from alcohol, parabens, and phthalates</li><li>Key ingredient:\r\nBhringaraja: Packed with flavonoids and triterpenoids, Bhringaraja stimulates hair growth and also controls hair loss.\r\n\r\nPalasha: Containing flavones and flavonoids, Palasha conditions the hair and reduces hair fall.\r\n\r\nBamboo:Bamboo shoots are rich in Silica, which is known to keep the hair healthy and strong by retaining moisture, making the hair appear beautiful and attractive.</li><li>Directions for use:\r\nTake an appropriate amount of Himalaya Men Anti-Hair Fall Styling Gel onto your palm and apply to your scalp and hair. Shape to desired style using your fingers. </li><li>Pack size:\r\n50 ml and 100 ml</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(30, 'Himalaya MEN Daily Nourish Styling Gel - Normal', 'himalaya-men-daily-nourish-styling-gel-normal', '<p>Himalaya Men Daily Nourish Styling Gel* offers effective hair setting power with a glossy finish for many hours. The gel is a special formulation that styles your hair while providing care. Enriched with the goodness of Almond and Bamboo, it nourishes your hair for enhanced styling.</p>\r\n', '', '', '', 'Himalaya MEN Daily Nourish Styling Gel - Normal\r\nStyles and Nourishes Hair.', NULL, NULL, '', 48, NULL, 'https://www.raeesworld.com/img/uploads/men-daily-nourish-styling-gel-normal.jpg', 'https://www.raeesworld.com/img/uploads/men-daily-nourish-styling-gel-normal.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Benefits: Non-sticky Wet look Easy to spread Free from alcohol, parabens, and phthalates</li>\r\n	<li>Key ingredient: Almond: A rich source of proteins, and antioxidant nutrients, Almond helps nourish and condition the hair. Bamboo:Bamboo shoots are rich in Silica, which is known to keep hair healthy and strong by retaining moisture, making the hair appear beautiful and attractive.</li>\r\n	<li>Directions for use: Take an appropriate amount of Himalaya Men Daily Nourish Styling Gel onto your palm and apply to your scalp and hair. Shape to desired style using your fingers.</li>\r\n	<li>Pack size: 50 ml and 100 ml</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '51', '2', 0, 0, '', '', '', 22, 0, 0, '', ''),
(31, 'Himalaya MEN Daily Nourish Styling Gel - Strong', 'himalaya-men-daily-nourish-styling-gel-strong', 'Himalaya Men Daily Nourish Styling Gel* offers effective hair setting power with a glossy finish for many hours. The gel is a special formulation that styles your hair while providing care. Enriched with the goodness of Almond and Bamboo, it nourishes your hair for enhanced styling.', '', '', '', 'Himalaya MEN Daily Nourish Styling Gel - Strong\r\nStyles and Nourishes Hair', NULL, NULL, '', 48, NULL, 'https://www.raeesworld.com/img/uploads/men-daily-nourish-styling-gel-strong.jpg', 'https://www.raeesworld.com/img/uploads/men-daily-nourish-styling-gel-strong.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Benefits:\r\nNon-sticky\r\nWet look\r\nEasy to spread\r\nFree from alcohol, parabens, and phthalates</li><li>Key ingredient:\r\nAlmond: A rich source of proteins, and antioxidant nutrients, Almond helps nourish and condition the hair.\r\n\r\nBamboo:Bamboo shoots are rich in Silica, which is known to keep hair healthy and strong by retaining moisture, making the hair appear beautiful and attractive.</li><li>Directions for use:\r\nTake an appropriate amount of Himalaya Men Daily Nourish Styling Gel onto your palm and apply to your scalp and hair. Shape to desired style using your fingers.</li><li>Pack size:\r\n50 ml and 100 ml </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(32, 'Himalaya Men Face and Beard Wash', 'himalaya-men-face-and-beard-wash', '<p>Sporting a beard needs special care. As facial hair grows, skin can get itchy and uncomfortable. The beard and the skin underneath require extra attention and care. Discover a well-groomed and clean beard with Himalaya Men Face and Beard Wash designed specifically to care for your facial skin and hair. Gentle on the skin and effective enough to work on a rough, coarse beard, the face wash is enriched with natural ingredients that provide deep cleansing, clear skin, and a soft beard.</p>\r\n', '', '', 'Usually Delivered in 2-3 Days', 'Himalaya Men Face and Beard Wash \r\nItch-Free Soft Beard and Clear Skin', NULL, NULL, '', 78, NULL, 'https://www.raeesworld.com/img/uploads/men-face-beard-wash.jpg', 'https://www.raeesworld.com/img/uploads/men-face-beard-wash.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '10', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Key ingredient: Aloe Vera conditions stubble and soothes irritation. Coconut Water deep cleanses and gives clear, fresh skin.</li>\r\n	<li>Directions for use: Moisten face, beard and neck. Apply a small amount of Himalaya Men Face and Beard Wash and gently work up a lather using a circular motion. Wash off and pat dry.</li>\r\n	<li>Pack size: 40ml and 80ml</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '61', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(33, 'Himalaya MEN ACTIVE SPORT Face Wash', 'himalaya-men-active-sport-face-wash', 'India\'s first-ever face wash created through an exclusive association with Royal Challengers Bangalore - Himalaya Men Active Sport Face Wash, a soap-free, herbal formulation, specially designed for men with an active lifestyle. The unique 3 herb complex of Orange, Mint, and Red Ginseng removes oil, sweat, and dirt to reenergize, refresh, and brighten skin. Experience long lasting freshness with its rich woody fragrance and deep cleansing action.', '', '', '', 'Himalaya MEN ACTIVE SPORT Face Wash \r\nFor Reenergized and Brighter Skin\r\n', NULL, NULL, '', 83, NULL, 'https://www.raeesworld.com/img/uploads/men-active-sport-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/men-active-sport-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredient:\r\nRed Ginseng is an antioxidant and skin conditioning agent that hydrates and regulates melanin synthesis for healthy and bright skin.\r\nOrange effectively rejuvenates by removing excess oil, resulting in glowing and toned skin.\r\nMint is a natural cooling agent with soothing properties that helps refresh the skin.</li><li>Directions for use:\r\nApply Himalaya Men Active Sport Face Wash on a moist face and massage. Gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack size:\r\n100ml and 50ml\r\n</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '61', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(34, 'Himalaya MEN Intense Oil Clear Lemon Face Wash ', 'himalaya-men-intense-oil-clear-lemon-face-wash', 'Himalaya Men Intense Oil Clear Lemon Face Wash is a soap-free, herbal formulation that gently cleanses your face and removes excess oil. It is enriched with Lemon and Indian Willow which help clear excess oil, impurities and pollutants.\r\n\r\nIt is powered with Active Boost Technology that increases the penetration of actives and helps in the rapid action of herbs.', '', '', 'Usually Delivered in 2-3 Days', 'Himalaya MEN Intense Oil Clear Lemon Face Wash \r\nLong lasting, Oil Free skin', NULL, NULL, '', 78, NULL, 'https://www.raeesworld.com/img/uploads/men-intense-oil-clear-lemon-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/men-intense-oil-clear-lemon-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredient:\r\nLemon peel extract is a well-known astringent. Rich in flavonoids, Lemon exhibits remarkable shrinking and absorbing properties, enabling the fruit to remove excess oil. It also possesses potent antimicrobial and cleansing properties.\r\n\r\nIndian Willow bark extract is rich in polyphenols which are known to exert skin conditioning and protectant activity. The plant possesses antimicrobial and astringent properties as it is rich in tannins. Indian Willow has been traditionally used to quicken wound healing and treat skin diseases.</li><li>Directions for use:\r\nApply Himalaya Men Intense Oil Clear Lemon Face Wash on a moist face and massage. Gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack size:\r\n100ml and 50ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '61', '2', 0, 0, 'https://youtu.be/5bKOGze7zcY', '', '', NULL, 0, 0, '', ''),
(35, 'Himalaya MEN Power Glow Licorice Face Wash', 'himalaya-men-power-glow-licorice-face-wash', 'Himalaya Men Power Glow Licorice Face Wash is a soap-free, herbal formulation that gently cleanses the face. It is a fine blend of Licorice, Alfalfa and Wood Apple which helps enhance the complexion and bring about a natural glow.\r\n\r\nIt is powered with Active Boost Technology that increases the penetration of actives and helps in the rapid action of herbs.', '', '', 'Usually Delivered in 2-3 Days', 'Himalaya MEN Power Glow Licorice Face Wash\r\nVisibly Fairer and Brighter skin', NULL, NULL, '', 78, NULL, 'https://www.raeesworld.com/img/uploads/men-power-glow-licorice-face-wash.jpg', 'https://www.raeesworld.com/img/uploads/men-power-glow-licorice-face-wash.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredient:\r\nWood Apple shell powder gently exfoliates dead skin cells, resulting in a mild, nonchemical, mechanical abrasion.\r\n\r\nAlfalfa is natural source of vitamins that helps maintain skin health. The herb possesses antioxidant benefits and is a skin conditioning agent.\r\n\r\nLicorice contains glycyrrhetic acid and flavonoids which have soothing and antioxidant properties. Applied topically, Licorice helps relieve itching and swelling, improves skin tone and whitens skin.</li><li>Directions for use:\r\nApply Himalaya Men Power Glow Licorice Face Wash on a moist face and massage. Gently work up a lather using a circular motion. Wash off and pat dry. Use twice daily.</li><li>Pack size:\r\n100ml and 50ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '61', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(36, 'Clear Complexion Whitening Face Scrub', 'clear-complexion-whitening-face-scrub', 'Himalaya\'s Clear Complexion Whitening Face Scrub is a complexion enhancing face scrub with mild exfoliants that bring out your natural fairness and reveal glowing skin. A combination of potent herbal ingredients like Apricot, White Dammer and Licorice soften, nourish and visibly brighten your skin.', '', '', 'Usually Delivered in 2-3 Days', 'Clear Complexion Whitening Face Scrub\r\nEnhance your glow', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/clear-complexion-whitening-face-scrub.jpg', 'https://www.raeesworld.com/img/uploads/clear-complexion-whitening-face-scrub.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nLicorice helps regulate melanin synthesis\r\n\r\nWhite Dammer lightens skin, clears spots, enhances the complexion and gives skin an even tone. \r\nApricot granules gently exfoliate dead skin cells. </li><li>Directions:\r\nApply Clear Complexion Whitening Face Scrub in a circular motion on the face and neck. Rinse with water and pat dry. Use at least once a week for clear, glowing skin.</li><li>Pack Size:\r\n50g & 100g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(37, 'Gentle Exfoliating Apricot Scrub', 'gentle-exfoliating-apricot-scrub', 'Himalayas Gentle Exfoliating Apricot Scrub exfoliates dead skin cells and blackheads and unclogs pores. It also deep cleanses facial skin and stimulates fresh cell growth to keep skin soft and glowing.\r\n\r\nRoutine cleansing does not remove dead skin cells and deeply embedded impurities, leaving skin lifeless and prone to blackheads.\r\n\r\nGentle Exfoliating Apricot Scrub has Apricot kernel granules that gently scrub the skin to remove dead skin cells and blackheads. Wheat Germ Oil, rich in natural Vitamin E, moisturizes the skin, and Crab Apple provides nourishment for healthy, glowing skin.', '', '', 'Usually Delivered in 2-3 Days', 'Gentle Exfoliating Apricot Scrub\r\nReveal pure and soft skin', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/Gentle-exfoliating-apricot-scrub.jpg', 'https://www.raeesworld.com/img/uploads/Gentle-exfoliating-apricot-scrub.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nApricot Seed Powder, known for its abrasive action, removes dead skin cells and blackheads which brings out your skins natural glow.\r\nWheat Germ Oil, due to its high concentration of Vitamin E, along with proteins and natural antioxidants, is ideal for most skin types. It is the perfect ingredient for our face scrub as it nourishes the skin and boosts the skins elasticity.\r\nCrab Apple has antiseptic, cooling, soothing, nutritive and keratolytic properties. It reduces skin inflammation and helps remove dead skin fragments. Crab Apple is also a rich source of vitamins and antioxidants which prevent skin cell degeneration and premature skin aging.1</li><li>Directions for use\r\nApply Gentle Exfoliating Apricot Scrub in a circular motion on the face and neck. Wipe off with a moist cotton pad. Rinse with water and pat dry. Use at least once a week for a glowing, healthy complexion.\r\n\r\nSuitable for dry to normal skin.\r\n\r\nGentle Exfoliating Apricot Scrub is dermatologically-tested, non-comedogenic and hypoallergenic.</li><li>Pack size:\r\n50g and 100g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(38, 'Gentle Exfoliating Walnut Scrub', 'gentle-exfoliating-walnut-scrub', 'Himalayas Gentle Exfoliating Walnut Scrub exfoliates dead skin cells to remove impurities that routine cleansing cannot tackle. It contains Crab Apple, a soothing antiseptic and keratolytic agent that helps loosen dead skin fragments. Walnut Shell granules scrub away dirt, blackheads and dead cells, and Wheat Germ Oil is a rich source of natural Vitamin E. These natural ingredients cleanse, nourish and moisturize your skin to make it soft, fresh and radiant.', '', '', 'Usually Delivered in 2-3 Days', 'Gentle Exfoliating Walnut Scrub\r\nGently scrub skin impurities', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/Gentle-exfoliating-walnut-scrub.jpg', 'https://www.raeesworld.com/img/uploads/Gentle-exfoliating-walnut-scrub.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCrab Apple has antiseptic, cooling, soothing, nutritive and keratolytic properties. It reduces skin inflammation and helps remove dead skin fragments. It is also a rich source of vitamins and prevents skin cell degeneration and premature skin aging.\r\n\r\nWheat Germ Oil, due to its high concentration of Vitamin E, along with proteins and natural antioxidants, is ideal for most skin types. It is the perfect ingredient for our face scrub as it nourishes the skin and boosts the skins elasticity.\r\n\r\nThe exfoliating micro-particles in Walnut Shell scrub away dirt, blackheads and dead skin cells.</li><li>Directions for use:\r\nApply Gentle Exfoliating Walnut Scrub in a circular motion on the face and neck. Wipe off with a moist cotton pad. Rinse with water and pat dry. Use at least once a week for a glowing, healthy complexion.\r\n\r\nSuitable for all skin types.\r\n\r\nGentle Exfoliating Walnut Scrub is dermatologically-tested, non-comedogenic and hypoallergenic.</li><li>Pack size:\r\n50g and 100g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(40, 'Purifying Neem Scrub', 'purifying-neem-scrub', 'Himalaya\'s Purifying Neem Scrub removes impurities and dead skin cells. It also cleanses excess oil from the skin\'s surface, which is the root cause of acne. The scrub is blended with the goodness of Neem, which clears blackheads and acne, and Apricot, which hydrates the skin. The natural ingredients cleanse, nourish and moisturize your skin to make it soft, fresh and radiant.', '', '', 'Usually Delivered in 2-3 Days', 'Purifying Neem Scrub\r\nGently scrub away blackheads', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/Purifying-Neem-Scrub.jpg', 'https://www.raeesworld.com/img/uploads/Purifying-Neem-Scrub.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nNeem is an excellent skin care ingredient known for its antibacterial properties. It improves general skin health and immunity, combating bacterial infections such as acne, boils and ulcers. Neem tackles bacteria from the root and prevents the recurrence of pimples and blemishes. \r\n\r\nApricot granules gently exfoliate dead skin cells, to bring out your skin\'s natural glow</li><li>Directions:\r\nApply Purifying Neem Scrub in a circular motion on the face and neck. Rinse with water and pat dry. Use at least once a week for clear, acne-free skin.</li><li>Pack size:\r\n50g and 100g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(41, 'Refreshing Cleansing Milk', 'refreshing-cleansing-milk', 'Himalaya\'s Refreshing Cleansing Milk contains a special blend of herbs that gently remove dirt, makeup and daily impurities while maintaining your skin\'s natural moisture balance. Lemon, a natural cleanser and astringent, clarifies and refreshes, while Grape Seed rejuvenates, and Mint cools your skin to keep it clear, healthy and radiant.', '', '', 'Usually Delivered in 2-3 Days', 'Refreshing Cleansing Milk\r\nGive your skin a clean feel', NULL, NULL, '', 83, NULL, 'https://www.raeesworld.com/img/uploads/refreshing-cleansing-milk.jpg', 'https://www.raeesworld.com/img/uploads/refreshing-cleansing-milk.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nLemon is an effective cleanser, which removes skin debris and impurities, leaving your skin supple, smooth and fresh.\r\n\r\nGrape Seed provides nourishment and helps to tone and tighten skin.\r\n\r\nMint is an antiseptic and an excellent skin cleanser. It soothes skin, helps eliminate infections and alleviates itching.</li><li>Directions for use:\r\nApply Refreshing Cleansing Milk using a circular motion on the face and neck. Wipe off with a moist cotton pad. Rinse with water and pat dry.</li><li>Pack size:\r\n100ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(42, 'Refreshing & Clarifying Toner', 'refreshing-clarifying-toner', 'Himalaya\'s Refreshing & Clarifying Toner is made from a blend of natural ingredients that control excess oil secretion and cleanse oil from the skin\'s surface. The herbal goodness of ingredients like Lentil, which deep cleanses pores, Citrus Lemon, a natural astringent and cleanser which tightens pores and refreshes skin, and Boerhavia Root extract which controls excess oil secretion, leave your skin clear, soft and radiant.', '', '', 'Usually Delivered in 2-3 Days', 'Refreshing & Clarifying Toner\r\nBeautiful, Clear skin', NULL, NULL, '', 83, NULL, 'https://www.raeesworld.com/img/uploads/refereshing-clarifying-toner.jpg', 'https://www.raeesworld.com/img/uploads/refereshing-clarifying-toner.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCitrus Lemon is an effective cleanser, which removes dead skin cells and impurities, leaving your skin supple, smooth and fresh.\r\n\r\nLentil deep cleanses pores and gives your skin back lost nutrients like protein. \r\n\r\nBoerhavia Root controls excess oil secretion to leave your skin clear, soft and radiant.</li><li>Directions for use:\r\nAfter cleaning your face with Himalaya\'s Refreshing Cleansing Milk, pour a few drops of Refreshing & Clarifying Toner on a cotton pad and wipe thoroughly over your face and neck.</li><li>Pack size:\r\n100ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(43, 'Aloe & Cucumber Refreshing Body Lotion', 'aloe-cucumber-refreshing-body-lotion', 'Himalayas Aloe & Cucumber Refreshing Body Lotion is a light and cool body lotion that hydrates and refreshes your skin without leaving it sticky. The fast-absorbing, daily-use body lotion is enriched with Aloe Vera and Cucumber, which leave your skin smooth and refreshed.', '', '', 'Usually Delivered in 2-3 Days', 'Aloe & Cucumber Refreshing Body Lotion\r\nFor a refreshing and cool feel', NULL, NULL, '', 75, NULL, 'https://www.raeesworld.com/img/uploads/aloe-cucumber-refreshing-body-lotion.jpg', 'https://www.raeesworld.com/img/uploads/aloe-cucumber-refreshing-body-lotion.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAloe Vera, known for its many healing properties, is rich in polysaccharides and nutrients that exhibit antibacterial and antifungal action. A natural UV inhibitor, Aloe Veras hydrating, softening and intense moisturizing properties nourish the skin.\r\n\r\nCucumber cools, invigorates, refreshes and helps maintain skins moisture. It keeps skin soft, has healing and soothing effects on damaged skin and is also a natural sunscreen. The abundant antioxidants in Cucumber rejuvenate the skin and leave it feeling soft and smooth.</li><li>Directions for use:\r\nApply Aloe & Cucumber Refreshing Body Lotion gently all over the body, slowly massaging it in.\r\n\r\nBest used after bathing when your skin is most receptive to hydration.</li><li>Pack size:\r\n100ml, 200ml and 400ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', '');
INSERT INTO `products` (`id`, `ptitle`, `slug`, `description`, `fit_details`, `fabric_details`, `delivery_info`, `short_description`, `sizes`, `size_price`, `sku`, `price`, `p_price`, `image`, `gallery`, `min_order`, `max_order`, `status`, `h_page`, `created`, `params`, `meta_title`, `meta_description`, `meta_keywords`, `qty`, `discount_type`, `discount`, `discount_rate`, `available`, `ship_charge`, `ship_notes`, `pincodes`, `brand_id`, `models`, `material`, `theme`, `specification`, `highlights`, `customize`, `cod`, `feature`, `sequence`, `event`, `design_code`, `model_code`, `name`, `is_printed`, `campus_id`, `offer`, `cod_available`, `price_other`, `sale_price_other`, `ship_charge_other`, `category`, `product_type`, `featured`, `m_featured`, `video_url`, `attr`, `cloth_color`, `user_id`, `gst`, `cashback_type`, `discount_amount`, `note`) VALUES
(44, 'Cocoa Butter Intensive Body Lotion', 'cocoa-butter-intensive-body-lotion', 'Himalaya\'s Cocoa Butter Intensive Body Lotion is specially formulated for dry skin. It intensely moisturizes, softens and smoothens your skin. Cocoa Butter\'s deep-penetrating, natural ingredients help repair and nourish skin as well as making it supple.\r\n\r\nOur moisturizer is enriched with the goodness of Cocoa Butter and Wheat Germ Oil, which replenish the lost moisture in dry skin. Naturally derived ingredients restore skin\'s elasticity, leaving it softer and more toned than before.', '', '', 'Usually Delivered in 2-3 Days', 'Cocoa Butter Intensive Body Lotion', NULL, NULL, '', 235, NULL, 'https://www.raeesworld.com/img/uploads/cocoa-butter-intensive-body-lotion.jpg', 'https://www.raeesworld.com/img/uploads/cocoa-butter-intensive-body-lotion.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCocoa Butter, also known as the oil of theobroma, is a high-quality emollient and a skin softening and moisturizing agent. It promotes healing and prevents the skin from drying and cracking. Cocoa Butter also contains antioxidants that can help repair damaged skin.\r\n\r\nWheat Germ Oil is a rich source of natural Vitamin E, which nourishes and boosts the skin\'s elasticity.</li><li>Directions for use:\r\nApply Cocoa Butter Intensive Body Lotion gently all over the body, with special attention to severely dry areas, slowly massaging it in.\r\n\r\nBest used after bathing when your skin is most receptive to hydration.</li><li>Pack size:\r\n100 ml, 200ml and 400 ml\r\n</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(45, 'Nourishing Body Lotion', 'nourishing-body-lotion', 'Himalaya\'s Nourishing Body Lotion combines 100% herbal actives to restore your body\'s water content, as varying weather conditions make skin lose its moisture. The non-greasy body lotion leaves skin feeling soft, supple and toned.\r\n\r\nBlended with all natural ingredients such as Aloe Vera and Winter Cherry, which are known for their intense hydrating properties, our body lotion deeply penetrates into the skin to moisturize it fully.', '', '', 'Usually Delivered in 2-3 Days ', 'Nourishing Body Lotion\r\nNourishes, moisturizes and protects', NULL, NULL, '', 75, NULL, 'https://www.raeesworld.com/img/uploads/nourishing-body-lotion.jpg', 'https://www.raeesworld.com/img/uploads/nourishing-body-lotion.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAloe Vera, known for its many healing properties, is rich in polysaccharides and nutrients which exhibit antibacterial and antifungal action. A natural UV inhibitor, its hydrating, softening and intense moisturizing properties nourish the skin.\r\n\r\nWinter Cherry is an effective anti-stress agent. In skin care, this plant is used for its antioxidant action, which helps skin cell regeneration and softens skin.</li><li>Directions for use:\r\nApply Nourishing Body Lotion gently all over the body, with special attention to severely dry areas, slowly massaging it in.\r\n\r\nBest used after bathing when your skin is most receptive to hydration.</li><li>Pack size:\r\n100 ml, 200ml and 400 ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(46, 'Soothing Body Lotion', 'soothing-body-lotion', 'Himalaya\'s Soothing Body Lotion is a silky, lightweight and non-greasy body lotion that combines all the goodness of naturally derived ingredients to soothe and moisturize your skin, making it look noticeably softer and smoother.\r\n\r\nThe oils of Almond and Grape Seed prevent skin from cracking and provide hydration to help maintain the skins natural moisture balance.', '', '', 'Usually Delivered in 2-3 Days', 'Soothing Body Lotion\r\nSoothes and moisturizes skin', NULL, NULL, '', 75, NULL, 'https://www.raeesworld.com/img/uploads/soothing-body-lotion.jpg', 'https://www.raeesworld.com/img/uploads/soothing-body-lotion.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAlmond Oil is an excellent skin softener which moisturizes your skin. The Vitamin A in the oil fights infections.\r\n\r\nGrape Seed Oil possesses astringent qualities which help to tighten and tone the skin. Grape has a high content of linoleic acid, a fatty acid essential for the skin. It also serves as a wonderful moisturizer which nourishes the skin</li><li>Directions for use:\r\nApply Soothing Body Lotion gently all over the body, slowly massaging it in.\r\n\r\nBest used after bathing when your skin is most receptive to hydration.</li><li>Pack size:\r\n100 ml, 200 ml and 400 ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(47, 'Anti-Dandruff Hair Oil', 'anti-dandruff-hair-oil', 'Himalaya\'s Anti-Dandruff Hair Oil prevents dandruff by eliminating microbial infections of the scalp. It nourishes the scalp and keeps hair healthy.\r\n\r\nMassaging hair with this nutrient-rich hair oil provides extra nourishment to the scalp and prevents dandruff. Massaging also increases blood circulation to the scalp, which strengthens hair roots. Regular scalp massages add luster and shine to hair. Tea Tree Oil has antimicrobial properties that fight scalp infections and relieve itching. It also acts as an antiseptic agent, which helps heal the scalp.', '', '', 'Usually Delivered in 2-3 Days', 'Anti-Dandruff Hair Oil\r\nLove your healthy, dandruff-free hair', NULL, NULL, '', 93, NULL, 'https://www.raeesworld.com/img/uploads/Anti-dandruff-hair-oil.jpg', 'https://www.raeesworld.com/img/uploads/Anti-dandruff-hair-oil.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nTea Tree Oil is a preferred ingredient in anti-dandruff treatments. Tea Tree Oil is a known anti-fungal agent which effectively treats dandruff. It moisturizes hair and keeps the scalp free of fungal infections. It also helps strengthen the hair and protects it from scalp infections, making it a key ingredient in daily-use hair products.\r\n\r\nRosemary is traditionally used in hair care treatments. Extracts of the plant are used to treat dandruff and other scalp infections. It is also used to prevent premature balding. Rosemary strengthens hair follicles, making hair grow longer and stronger.</li><li>Directions for use:\r\nApply Anti-Dandruff Hair Oil into the scalp by parting the hair. Massage the scalp gently in a circular motion using your fingertips so that the oil is absorbed into the scalp. Leave for an hour or two before washing with shampoo.\r\n\r\nFor best results, wash hair with Himalaya\'s Anti-Dandruff Shampoo.\r\n\r\nSuitable for all hair types.</li><li>Pack size\r\n100 ml and 200 ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(48, 'Anti-Hair Fall Hair Oil', 'anti-hair-fall-hair-oil', 'Himalaya\'s Anti-Hair Fall Hair Oil prevents hair fall and stimulates hair growth. It is enriched with the goodness of Bhringaraja and Amalaki which strengthen the root shafts and prevent hair fall.', '', '', 'Usually Delivered in 2-3 Days', 'Anti-Hair Fall Hair Oil\r\nStrong and healthy hair', NULL, NULL, '', 93, NULL, 'https://www.raeesworld.com/img/uploads/anti-hair-fall-hair-oil-1.jpg', 'https://www.raeesworld.com/img/uploads/anti-hair-fall-hair-oil-1.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nBhringaraja is rich in phytochemicals like eclalbosaponins and wedelolactone which help promote hair growth and strengthen the hair root, and keeping hair healthy. \r\n\r\nAmalaki, a natural hair tonic used extensively in Ayurveda, is an effective ingredient for treating the hair and scalp. It strengthens hair follicles and promotes hair growth.</li><li>Directions for use:\r\nPart your hair and apply Anti-Hair Fall Hair Oil on the scalp. Massage the scalp gently in a circular motion using your fingertips so that the oil is absorbed into the scalp. Leave for an hour or more before washing.</li><li>Pack size\r\n100 ml and 200 ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(49, 'Himalaya Kajal', 'himalaya-kajal', 'Enriched with Damask Rose and Triphala, Himalaya\'s herbal Kajal combines traditional ingredients like Almond Oil and Castor Oil with Damask Rose to cool and nourish eyes. Triphala, a unique herbal composite of three power-packed berries, adds luster, making eyes look bright and attractive.', '', '', 'Usually Delivered in 2-3 Days', 'Kajal\r\nDefine your eyes, naturally', NULL, NULL, '', 45, NULL, 'https://www.raeesworld.com/img/uploads/kajal.jpg', 'https://www.raeesworld.com/img/uploads/kajal.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAlmond Oil nourishes lashes and also acts as an anti-aging agent for the eyelids.\r\n\r\nCastor Oil is an emollient or skin softener and also acts as a protective barrier between the skin and harsh environmental conditions such as wind, dust and dry air.\r\n\r\nCamphor aids in retaining eye moisture, which helps keep eyes hydrated.\r\n\r\nDamask Rose is known for its cooling properties, which help alleviate eye strain.\r\n\r\nTriphala, a herbal concoction made from the Indian Gooseberry, Inknut and Beleric Myrobalan fruits, is a well-known eye tonic. Its anti-inflammatory properties help reduce eye redness and swelling.1</li><li>Directions for use:\r\nApply Kajal along the lash line.</li><li>Pack size:\r\n1g & 2.6g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '55', '2', 1, 0, '', '', '', NULL, 0, 0, '', ''),
(50, 'Under Eye Cream', 'himalaya-under-eye-cream', 'Himalayas Under Eye Cream contains a proven and safe blend of herbs specially created to care for the delicate area around the eyes. The breakthrough herbal actives reduce the appearance of dark circles and protect the sensitive area under the eyes from sunlight. Our Under Eye Cream detoxifies and moisturizes the under eye area and smoothens wrinkles and fine lines. Its regular use helps prevent new wrinkle formation.', '', '', 'Usually Delivered in 2-3 Days', 'Under Eye Cream\r\nNo more dark circles', NULL, NULL, '', 170, NULL, 'https://www.raeesworld.com/img/uploads/under-eye-cream.jpg', 'https://www.raeesworld.com/img/uploads/under-eye-cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Under Eye Cream contains the breakthrough herbal actives of Cipadessa Baccifera and Winter Begonia which together help reduce dark circles by 50% in four weeks making the eye contours brighter and smooth. Himalaya has filed an US patent for this breakthrough product.</li><li>Key ingredients:\r\nCipadessa Baccifera prevents fine lines and lightens dark circles.\r\n\r\nWinter Begonia is a herb with various medicinal benefits. Used in the composition of Under Eye Cream, it lightens under eye skin.\r\n\r\nWheat Germ Oil is a rich source of natural Vitamin E, which protects your skin from the damage caused by pollution and harsh UV rays. Its antioxidant properties nourish the skin.</li><li>Directions for use:\r\nGently massage Under Eye Cream into the delicate area beneath the eyes after thorough cleansing. Use twice daily.\r\n\r\nSuitable for all skin types.</li><li>Pack size:\r\n15ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(51, 'Active Fresh Mouthwash', 'himalaya-active-fresh-mouthwash', 'A refreshing herbal formulation especially power packed with Fennel and Mint, Himalaya Active Fresh Mouthwash helps prevent mouth odor. It kills 99.9% of bacteria, giving long-lasting fresh breath. Providing up to 12 hours of protection from germs, our mouthwash also prevents plaque build-up and maintains cleaner, fresher and healthier oral hygiene.', '', '', 'Usually Delivered in 2-3 Days', 'Active Fresh Mouthwash\r\nLong-lasting fresh breath\r\n', NULL, NULL, '', 95, NULL, 'https://www.raeesworld.com/img/uploads/mouthwash_activefresh.jpg', 'https://www.raeesworld.com/img/uploads/mouthwash_activefresh.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Himalaya Active Fresh Mouthwash contains no alcohol and does not cause a burning sensation post use. It is fluoride free and clinically tested.</li><li>Key ingredients:\r\nFennel Oil contains terpenes, which give the herb its antimicrobial property. Fennel is also a potent astringent that tightens gums.\r\n\r\nMint has cooling and analgesic properties which give long-lasting fresh breath.</li><li>Directions for use:\r\nFill cap with 15 ml of mouthwash, rinse thoroughly and expel after 30 seconds. Do not swallow. For best results, use after Himalaya Active Fresh Herbal Toothpaste twice daily.</li><li>Pack size:\r\n215 ml </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(52, 'Complete Care Mouthwash', 'himalaya-complete-care-mouthwash', 'Specially formulated with an active combination of Neem, Pomegranate and Miswak, Himalaya Complete Care Mouthwash provides complete protection to strengthen teeth and gums. It kills 99.9% of bacteria, giving long-lasting fresh breath. Providing up to 12 hours of protection from germs, our mouthwash also prevents plaque build-up and maintains cleaner, fresher and healthier oral hygiene.\r\n\r\nHimalaya Complete Care Mouthwash contains no alcohol and does not cause a burning sensation post use. It is clinically tested.', '', '', 'Usually Delivered in 2-3 Days', 'Complete Care Mouthwash\r\nHealthy gums and teeth\r\n', NULL, NULL, '', 90, NULL, 'https://www.raeesworld.com/img/uploads/mouthwash_completecare.jpg', 'https://www.raeesworld.com/img/uploads/mouthwash_completecare.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nMiswak inhibits the build-up of dental plaque and is therefore beneficial in the prevention of tooth decay. It reduces gum inflammation, prevents gum bleeding, and has an astringent property which strengthens gums.\r\n\r\nPomegranate fruit rind has astringent, antibacterial and antioxidant properties. Studies show that Pomegranate helps to combat dental plaque.\r\n\r\nNeem is a herb for total oral hygiene. Neem bark possesses phenolic and antioxidant activity and also has anti-inflammatory and antimicrobial properties.</li><li>Directions for use:\r\nFill cap with 15 ml of mouthwash, rinse thoroughly and expel after 30 seconds. Do not swallow. For best results, use after Himalaya Complete Care Herbal Toothpaste twice daily.</li><li>Pack size:\r\n215 ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(53, 'Sparkling White Mouthwash', 'himalaya-sparkling-white-mouthwash', 'Himalaya Sparkling White Mouthwash is a unique herbal formulation based on Plant Enzyme Technology from Papaya and Pineapple that gently removes surface stains on teeth in two weeks, leaving your teeth naturally white and sparkling. This no chemical bleach formula kills 99.9% of bacteria and provides up to 12 hours of protection from germs.\r\n\r\nHimalaya Sparkling White Mouthwash contains no alcohol and does not cause a burning sensation post use. It is fluoride free and clinically tested.', '', '', 'Usually Delivered in 2-3 Days', 'Sparkling White Mouthwash\r\nWhiter teeth without chemical bleach', NULL, NULL, '', 95, NULL, 'https://www.raeesworld.com/img/uploads/mouthwash_sparklingwhite2.jpg', 'https://www.raeesworld.com/img/uploads/mouthwash_sparklingwhite2.jpg,https://www.raeesworld.com/img/uploads/mouthwash_sparklingwhite3.jpg,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nPineapple contains a natural enzyme, bromelian, which loosens stains on tooth enamel.\r\n\r\nPapaya contains the enzyme, papain, which is a mild whitening agent helpful in removing enamel stains.</li><li>Directions for use:\r\nFill cap with 15 ml of mouthwash, rinse thoroughly and expel after 30 seconds. Do not swallow. For best results, use after Himalaya Sparkling White Herbal Toothpaste twice daily.</li><li>Pack size:\r\n215 ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(54, 'Sparkling White Fresh Gel', 'himalaya-sparkling-white-fresh-gel', 'Himalaya\'s Sparkling White Fresh Gel is a breakthrough herbal formulation based on plant enzyme technology that gently removes surface stains on your teeth. It contains papain and bromelain, enzymes present in Papaya and Pineapple, which safely whiten teeth.\r\nAlong with that, cinnamon, clove with Menthol, have anti-microbial property that help fight odor causing bacteria to give you natural burst of refreshing long lasting fresh breath for upto 12 Hours.\r\n\r\nMiswak and Clove provide all-day protection from germs.', '', '', 'Usually Delivered In 2-3 Days', 'Sparkling White Fresh Gel\r\nWhiter teeth in two weeks without chemical bleach | Long Lasting Fresh Breath for upto 12 Hours', NULL, NULL, '', 30, NULL, 'https://www.raeesworld.com/img/uploads/sparkling-white-fresh-gel.jpg', 'https://www.raeesworld.com/img/uploads/sparkling-white-fresh-gel.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nPineapple contains a natural enzyme, bromelian, which loosens stains on tooth enamel.\r\nPapaya contains an enzyme, papain, which is a mild whitening agent and is used in toothpastes to remove enamel stains.\r\nThe antimicrobial properties of Cinnamon, Clove with Menthol prevent mouth odor and freshen breath.\r\nMiswak inhibits the build-up of dental plaque and is therefore beneficial in the prevention of tooth decay. The herb reduces gum inflammation, prevents gum bleeding, and its astringent property strengthens gums.\r\nAlmond, rich in tannins, has astringent properties that tighten gums. Almond Shell contains triterpenoids, flavonoids and phenolics, which possess free radical scavenging properties.</li><li>Directions for use:\r\nSqueeze a small amount of Sparkling White Toothpaste on a toothbrush and brush teeth. Brush twice daily for optimal results.</li><li>Pack size:\r\n40g & 80g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(55, 'Active Fresh Gel', 'himalaya-active-fresh-gel', 'Himalaya\'s Active Fresh Gel is packed with refreshing herbal ingredients that ensure long-lasting fresh breath. Menthol is a natural refreshing agent, Indian Dill prevents mouth odor, while Clove and Fennel are effective natural astringents that tighten gums.', '', '', 'Usually Delivered In 2-3 Days', 'Active Fresh Gel\r\nFor a fresh feel', NULL, NULL, '', 48, NULL, 'https://www.raeesworld.com/img/uploads/active-fresh-gel1.jpg', 'https://www.raeesworld.com/img/uploads/active-fresh-gel1.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nMiswak inhibits the build-up of dental plaque and is therefore beneficial in the prevention of tooth decay. It reduces gum inflammation, prevents gum bleeding, and its astringent property strengthens gums.\r\nIndian Dill is effective in preventing oral odor.\r\nMenthol from mint oils has cooling and analgesic properties which give long lasting fresh breath.\r\nFennel contains terpenes, which give the herb its antimicrobial property. Fennel is also a potent astringent that tightens gums.\r\nClove contains an anesthetic chemical compound called eugenol, which numbs nerves and controls pain. The essential oil of Clove is also an antiseptic which helps to eliminate oral bacteria. It also possesses astringent and anti-inflammatory properties that protect gums.\r\nCardamom contains chemical constituents like terpenes, which significantly inhibit the growth of oral microbes, leading to healthy gums and fresh breath.</li><li>Directions for use:\r\nSqueeze a small amount of Active Fresh Gel on a toothbrush and brush teeth. Brush twice daily for optimal results.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(56, 'Complete Care Toothpaste', 'himalaya-complete-care-toothpaste', 'Himalaya\'s Complete Care Toothpaste, with its rare selection of herbal ingredients rich in anti- oxidants, has been specially developed to make teeth and gums strong. Toothache Tree, found in the valley of the subtropical Himalayas, is excellent for bleeding gums. This lemon-scented tree has been used in home remedies around the world to relieve toothaches. Neem and Pomegranate in Complete Care Toothpaste fight germs and give your teeth all-day protection.\r\n\r\nThe new Himalaya Complete Care Toothpaste not only protects teeth and gums from germs, but also has antioxidants that assist in removing toxins, helping your gums maintain their natural health.', '', '', 'Usually Delivered In 2-3 Days', 'Complete Care Toothpaste\r\nComplete oral care with antioxidants', NULL, NULL, '', 20, NULL, 'https://www.raeesworld.com/img/uploads/complete-care-toothpaste.jpg', 'https://www.raeesworld.com/img/uploads/complete-care-toothpaste.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nPomegranate fruit rind has astringent, antibacterial and antioxidant properties. Recent studies have shown that Pomegranate also helps to combat dental plaque.\r\nIndian Gum Arabic Tree\'s fresh twigs are used to protect gums and teeth. The bark extract has tannins which are known for their antioxidant properties.\r\nNeem has been used for hundreds of years as an extremely effective method of total oral hygiene. Neem bark possesses phenolic and antioxidant activity and also has anti-inflammatory and antimicrobial properties.\r\nTriphala is an astringent which stops gum bleeding. Rich in tannins and phenolic compounds which possess antioxidant properties, the herb helps in healing mouth ulcers.\r\nBishop\'s Weed, a revered herb in Ayurveda, is used as a home-remedy for various ailments. It has mouth-freshening, antiseptic, astringent and carminative properties.\r\nFalse Black Pepper has anti-inflammatory properties, which are effective in treating swollen gums. The fruit is rich in the antioxidant component known as flavonoids.\r\nFive-Leaved Chaste Tree is valued for its oral anti-inflammatory, analgesic and antioxidant properties.</li><li>Directions for use:\r\nSqueeze a small amount of Complete Care Toothpaste on a toothbrush and brush teeth. Brush twice daily for optimal results.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(57, 'Stain Removal Toothpaste', 'himalaya-stain-removal-toothpaste', 'Himalaya Stain Removal Toothpaste, is an advanced herbal formulation that uses Plant Enzyme Technology from Papaya and Pineapple, which removes up to 80% tea and coffee stains in 12 weeks and prevents further stain build-up. The powerful blend of Papaya and Pineapple enzymes prevents plaque build-up and provides benefits such as:\r\n\r\nUp to an 80% reduction in tea and coffee stains in 12 weeks*\r\nPrevents stain build-up\r\nNo chemical bleach\r\nLong-lasting fresh breath\r\nFree from parabens and fluoride', '', '', '', 'Stain Removal Toothpaste\r\nUp to an 80% reduction in tea and coffee stains', NULL, NULL, '', 67, NULL, 'https://www.raeesworld.com/img/uploads/stainremovaltoothpaste.jpg', 'https://www.raeesworld.com/img/uploads/stainremovaltoothpaste.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '0', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nPineapple contains a natural enzyme, bromelain, which helps reduce stains on the tooth enamel.\r\nPapaya contains an enzyme, papain, which is a mild whitening agent that helps fade enamel stains.\r\nMiswak prevents tooth decay by inhibiting the build-up of dental plaque. Miskwak also reduces gum inflammation, prevents gum bleeding, and its astringent property strengthens gums.\r\nAlmond, rich in tannins, has astringent properties that tighten gums. Almond Shell contains triterpenoids, flavonoids, and phenolics, which possess free radical scavenging properties.\r\nMenthol , from Mint Oils has cooling and analgesic properties, which give long-lasting fresh breath.\r\nClove contains an anesthetic chemical compound called eugenol, which numbs nerves and controls pain. It has antiseptic properties that help eliminate oral bacteria. Clove also possesses astringent and anti-inflammatory properties that protect gums.\r\nCinnamon has antimicrobial properties that prevent mouth odor and freshen breath.</li><li>Directions for use:\r\nBrush twice daily to achieve up to an 80% reduction in tea and coffee stains in 12 weeks*.</li><li>Pack size:\r\n80g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(58, 'Sensitive Toothpaste', 'himalaya-sensitive-toothpaste', 'Himalaya\'s Sensitive Toothpaste is a herbal formulation that gives you rapid and lasting relief from tooth sensitivity. It contains Spinach, which blocks exposed dentinal tubules that are sources of teeth sensitivity. Almond Shell extract is an excellent astringent, and Menthol helps maintain long-lasting fresh breath.', '', '', 'Usually Delivered In 2-3 Days', 'Sensitive Toothpaste\r\nRelief from sensitive teeth', NULL, NULL, '', 90, NULL, 'https://www.raeesworld.com/img/uploads/sensitive-tooth-paste.jpg', 'https://www.raeesworld.com/img/uploads/sensitive-tooth-paste.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Directions for use:\r\nSqueeze a small amount of Sensitive Toothpaste on a toothbrush and brush teeth. Brush twice daily for optimal results.</li><li>Pack size:\r\n80g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(59, 'Sparkling White Toothpaste', 'himalaya-sparkling-white-toothpaste', 'Himalaya\'s Sparkling White Toothpaste is a breakthrough herbal formulation based on plant enzyme technology that gently removes surface stains on your teeth. It contains papain and bromelain, enzymes present in Papaya and Pineapple, which safely whiten teeth. Miswak and Clove provide all-day protection from germs.', '', '', 'Usually Delivered In 2-3 Days', 'Sparkling White Toothpaste\r\nWhiter teeth in two weeks without chemical bleach', NULL, NULL, '', 25, NULL, 'https://www.raeesworld.com/img/uploads/sparkling-white-toothpaste.jpg', 'https://www.raeesworld.com/img/uploads/sparkling-white-toothpaste.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nMiswak inhibits the build-up of dental plaque and is therefore beneficial in the prevention of tooth decay. The herb reduces gum inflammation, prevents gum bleeding, and its astringent property strengthens gums.\r\nMenthol from mint oils has cooling and analgesic properties which give long lasting fresh breath.\r\nAlmond, rich in tannins, has astringent properties that tighten gums. Almond Shell contains triterpenoids, flavonoids and phenolics, which possess free radical scavenging properties.\r\nPineapple contains a natural enzyme, bromelian, which loosens stains on tooth enamel.\r\nPapaya contains an enzyme, papain, which is a mild whitening agent and is used in toothpastes to remove enamel stains.\r\nThe antimicrobial properties of Cinnamon prevent mouth odor and freshen breath.\r\nClove contains an anesthetic chemical compound called eugenol, which numbs nerves and controls pain. The essential oil of Clove is also an antiseptic which helps to eliminate oral bacteria.</li><li>Directions for use:\r\nSqueeze a small amount of Sparkling White Toothpaste on a toothbrush and brush teeth. Brush twice daily for optimal results.</li><li>Pack size:\r\n40g, 80g and 175g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(60, 'Dental Cream', 'himalaya-dental-cream', 'Himalaya Dental Cream is a refreshing herbal toothpaste for overall dental care. It is enriched with Neem that fights germs and bad breath, Miswak which prevents gum bleeding, Pomegranate, known for its astringent properties which keep gums healthy, and natural fluoride to prevent dental caries.', '', '', 'Usually Delivered In 2-3 Days', 'Himalaya Dental Cream\r\nProtect and keep your gums healthy', NULL, NULL, '', 76, NULL, 'https://www.raeesworld.com/img/uploads/dental-cream.jpg', 'https://www.raeesworld.com/img/uploads/dental-cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nPomegranate fruit rind has astringent, antibacterial and antioxidant properties. Recent studies have shown that Pomegranate also helps combat dental plaque.\r\nNeem has been used for hundreds of years as an extremely effective method of total oral hygiene. Neem bark possesses phenolic and antioxidant activity and also has anti-inflammatory and antimicrobial properties.\r\nMiswak inhibits the build-up of dental plaque and is therefore beneficial in the prevention of tooth decay. The herb reduces gum inflammation, prevents gum bleeding, and its astringent property strengthens gums.</li><li>Directions for use:\r\nSqueeze a small amount of Dental Cream on a toothbrush and brush teeth. Brush twice daily for optimal results.</li><li>Pack size:\r\n200g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '53', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(61, 'Intensive Face Moisturizing Lotion', 'himalaya-intensive-face-moisturizing-lotion', 'Himalaya\'s Intensive Face Moisturizing Lotion has been formulated to tackle dry skin, especially during winter. It is enriched with herbs like Aloe Vera, Indian Madder and Country Mallow that provide extra nutrients and enzymes to nourish and moisturize your skin when you need it most.', '', '', 'Usually Delivered In 2-3 Days', 'Himalaya Intensive Face Moisturizing Lotion\r\nGet rid of dryness', NULL, NULL, '', 85, NULL, 'https://www.raeesworld.com/img/uploads/intensive-face-moisturizing-lotion.jpg', 'https://www.raeesworld.com/img/uploads/intensive-face-moisturizing-lotion.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCountry Mallow has a host of medicinal benefits, including antimicrobial, anti-inflammatory and wound-healing properties. \r\nAloe Vera is used extensively in Ayurveda for wounds, burns, dermatitis and other skin troubles. It acts as an antibacterial agent and an astringent, which accelerates the healing of injured skin. A heaven-sent for dry skin, Aloe Vera also soothes and moisturizes.\r\n\r\nIndian Madder is an antiseptic and anti-inflammatory agent that has a soothing effect on the skin, providing moisture. The herb is used to treat wounds and ulcers to ensure quick healing. </li><li>Directions for use:\r\nApply Intensive Face Moisturizing Lotion all over the face and neck with gentle upward strokes.</li><li>Pack size:\r\n100ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(62, 'Nourishing Face Moisturizing ', 'himalaya-nourishing-face-moisturizing', 'Himalaya\'s Nourishing Face Moisturizing Lotion helps you recover lost natural moisture and nutrients due to the skin\'s frequent exposure to environmental extremes, pollution and chemicals. It combines natural ingredients that restore your skin\'s vitality throughout the day. It is enriched with Aloe Vera, a natural moisturizer, rich in polysaccharides and enzymes, and White Lily that lighten your skin. The oils of Almond and Carrot Seed combine to protect your skin from the damage caused by exposure to pollution and sunlight. Nourishing Face Moisturizing Lotion is a perfect base for make-up.', '', '', 'Usually Delivered In 2-3 Days', 'Himalaya Nourishing Face Moisturizing Lotion\r\nRehydrate your skin', NULL, NULL, '', 75, NULL, 'https://www.raeesworld.com/img/uploads/nourishing-face-moisturizing-lotion.jpg', 'https://www.raeesworld.com/img/uploads/nourishing-face-moisturizing-lotion.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAloe Vera soothes and moisturizes dry skin. \r\n\r\nAlmond Oil is an excellent skin softener, which hydrates your skin.\r\n\r\nCarrot Seed Oil contains Vitamin A in the form of beta-carotene, which is essential for tissue growth on the skin\'s surface. It is also beneficial in reversing the effects of sun damage.\r\n\r\nWhite Lily is reported to possess soothing, astringent, anti-inflammatory and skin conditioning properties.</li><li>Directions for use:\r\nApply Nourishing Face Moisturizing Lotion all over the face and neck with gentle, upward strokes.</li><li>Pack size:\r\n100ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(63, 'Protective Sunscreen Lotion', 'himalaya-protective-sunscreen-lotion', 'Himalayas Protective Sunscreen Lotion is a double-action formulation that protects you from harmful UV rays, and at the same time, nourishes your skin.\r\n\r\nCINNABLOC is extracted from the herbs Spiked Ginger Lily and Greater Galangal, which have natural UV ray shielding properties. With an SPF of 15, Himalayas Protective Sunscreen Lotion gives your skin protection from UV rays.\r\n\r\nA blend of naturally derived ingredients including Spiked Ginger Lily, Aloe Vera, Greater Galangal and Crab Apple, Protective Sunscreen Lotion helps safeguard skin from the damaging effects of the sun, which include tanning and premature aging.', '', '', 'Usually Delivered In 2-3 Days', 'Protective Sunscreen Lotion\r\nShielded from the sun\'s rays', NULL, NULL, '', 105, NULL, 'https://www.raeesworld.com/img/uploads/protective-sunscreen-lotion.jpg', 'https://www.raeesworld.com/img/uploads/protective-sunscreen-lotion.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nSpiked Ginger Lily has a wide range of therapeutic benefits. The rhizomes of the plant are used as antiseptic agents for muscle aches and pain. Spiked Ginger Lily is also an effective skin moisturizer.\r\n\r\nAloe Vera, known for its many healing properties, is rich in enzymes, polysaccharides and nutrients which exhibit mild antibacterial and antifungal action. A natural UV inhibitor, its hydrating, softening and intense moisturizing properties nourish the skin.\r\n\r\nGreater Galangal, also known as Thai or Siamese ginger, is a natural skin protector which guards the skin from UV rays and premature aging.\r\n\r\nCrab Apple is a rich source of antioxidants and vitamins which prevents skin cell degeneration and premature skin aging.1</li><li>Directions for use:\r\nApply Protective Sunscreen Lotion liberally on exposed skin including the face, neck and arms before going outdoors during the day. Avoid the area around the eyes.\r\n\r\nSuitable for all skin types.</li><li>Pack size:\r\n50ml and 100 ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(64, 'Fairness Kesar Face Pack', 'himalaya-fairness-kesar-face-pack', 'Himalaya\'s Fairness Kesar Face Pack is a unique natural formulation that evens out skin tone for a fairer you! Turmeric, Walnut, Indian Aloe and Kesar rejuvenate and cleanse your skin of impurities, to reveal a natural glow. Walnut and Indian Aloe heal the skin and remove blackheads. Turmeric and Kesar enhance your skin\'s complexion and elasticity. CINNABLOC, our patented, herbal sunscreen agent, protects your skin from the sun\'s harmful UV rays.', '', '', 'Usually Delivered In 2-3 Days', 'Himalaya Fairness Kesar Face Pack\r\nReveal your inner glow', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/fairness-kesar-face-pack.jpg', 'https://www.raeesworld.com/img/uploads/fairness-kesar-face-pack.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nWalnut has slightly acidic properties. It is particularly effective in treating acne and in soothing sunburned skin and eczema. Walnut helps in skin cell regeneration and in toning the skin because of its astringent properties.\r\n\r\nIndian Aloe acts as an antibacterial and an astringent, which accelerates the healing of injured skin. Indian Aloe also softens and hydrates skin.\r\n\r\nTurmeric has strong anti-inflammatory properties, which soothe your skin gently. The herb helps to even out your skin tone and complexion. It also helps to retain the skin\'s elasticity and makes it supple.\r\n\r\nKesar lightens skin, clears spots, enhances the complexion and gives skin an even tone.</li><li>Directions:\r\nApply Fairness Kesar Face Pack evenly over cleansed face and neck, avoiding the area around the eyes and mouth. Let the pack dry for 10-15 minutes, and remove with a wet sponge or towel. Rinse with cool water. For best results, use twice a week. </li><li>Pack Size:\r\n50g and 100g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(65, 'Moisturizing Cucumber Peel-Off Mask', 'himalaya-moisturizing-cucumber-peel-off-mask', 'Packed with herbal nutrients like AHAs and antioxidants, Himalaya Moisturizing Cucumber Peel-Off Mask peels away dead skin cells and rejuvenates facial skin. Enriched with Cucumber and Almond, this formulation cools, moisturizes, tones and firms facial skin.', '', '', 'Usually Delivered In 2-3 Days', 'Moisturizing Cucumber Peel-Off Mask\r\nMoisturizes and provides soft and supple skin', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/moisturizing-cucumber-peel-off-mask.jpg', 'https://www.raeesworld.com/img/uploads/moisturizing-cucumber-peel-off-mask.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCucumber contains an enzyme that helps keep facial skin soft and has a healing and soothing effect on damaged skin. It acts as a toner and lightens facial skin. The abundant antioxidants in Cucumber rejuvenate the skin, making it soft and smooth. \r\n\r\nAlmond has soothing and softening properties. It also moisturizes and cleanses the skin.\r\n\r\nTurmeric is a herb that has antiseptic and strong anti-inflammatory properties which soothe skin gently, making skin soft and supple.</li><li>Directions for use:\r\nApply Himalaya Moisturizing Cucumber Peel-Off Mask evenly over cleansed face and neck, avoiding the area around the eyes. Allow the mask to dry for 10-15 minutes. Gently remove the peel from the side of the face. Use once or twice a week, based on skin type. Do not apply on broken or inflamed skin. For best results, follow a regimen using Moisturizing Aloe Vera Face Wash, Gentle Exfoliating Apricot Scrub and Moisturizing Cucumber Peel-Off Mask.\r\n\r\nA patch test is recommended before using on the face for the first time. Apply the mask in a 2x2 cm area on the inside of the hand below the wrist 24 hours before facial application. Follow the directions for use to ensure skin tolerance.</li><li>Pack size:\r\n50g and 100g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(66, 'Oil Clear Mud Face Pack', 'himalaya-oil-clear-mud-face-pack', 'Himalaya\'s Oil Clear Mud Face Pack is a unique formulation of natural ingredients that refreshes and rejuvenates facial skin by absorbing excess oil and removing impurities. It is enriched with Walnut, which removes blackheads and dead cells, and Fuller\'s Earth, which removes deep-seated impurities. Mineral Clay improves circulation and makes skin soft and tender.', '', '', 'Usually Delivered In 2-3 Days', 'Oil Clear Mud Face Pack\r\nEarth\'s benefits for the skin', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/oil-clear-mud-face-pack.jpg', 'https://www.raeesworld.com/img/uploads/oil-clear-mud-face-pack.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nWalnut removes dirt, blackheads and dead skin cells and helps delay skin aging by preventing wrinkles and dark spots. The natural Vitamin B and Vitamin E in Walnut act as antioxidants that fight free radical damage. The essential oil in Walnut helps to tone up the skin and maintain skin glow.\r\n\r\nKhus Grass cleans and tones the facial skin. Its aromatic, coolant and anti-fungal properties help cleanse the skin and give a refreshing feel. \r\n\r\nMineral Clay heals, improves circulation and keeps skin fresh and soft. It helps maintain the natural pH of the skin and has deep cleansing and detoxifying properties, leaving the skin cleansed and revitalized.\r\n\r\nFuller\'s Earth removes deep-seated dirt and pollutants. It absorbs oil, clears clogged pores and blemishes and helps remove dead skin. Fuller\'s Earth also helps lighten tanned skin caused by UV rays.</li><li>Directions for use:\r\nApply Oil Clear Mud Face Pack evenly over cleansed face and neck, avoiding the area around the eyes and mouth. Let the pack dry for 10-15 minutes, and remove with a wet sponge or towel. Rinse with cool water. For best results, use twice a week.</li><li>Pack size:\r\n50g and 100g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(67, 'Purifying Neem Pack', 'himalaya-purifying-neem-pack', 'Himalaya\'s Purifying Neem Pack brings together the goodness of Neem, Fuller\'s Earth and Turmeric, which work together to regulate excess oil secretion, clean clogged pores and prevent the recurrence of pimples.', '', '', 'Usually Delivered In 2-3 Days', 'Purifying Neem Pack\r\nClean, clear and healthy complexion', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/Purifying-Neem-Pack.jpg', 'https://www.raeesworld.com/img/uploads/Purifying-Neem-Pack.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nNeem is an excellent skin care ingredient known for its antibacterial properties. It improves general skin health and immunity, combating bacterial infections such as acne, boils and ulcers. Neem tackles bacteria from the root and prevents the recurrence of pimples and blemishes. \r\n\r\nTurmeric has been used as an antiseptic for centuries. The herb also has strong anti-inflammatory properties which soothe your skin gently. It also makes your skin soft and supple.\r\n\r\nFuller\'s Earth is an excellent cleanser. It removes deep-seated dirt and skin pollutants.</li><li>Directions:\r\nApply Purifying Neem Pack evenly over cleansed face and neck, avoiding the area around the eyes and mouth. Let the mask dry for 10-15 minutes, and remove with a wet sponge or towel. Rinse with cool water. For optimal results, use once a week.\r\n\r\nBest for oily and pimple-prone skin.</li><li>Pack size:\r\n50g and 100g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(68, 'Purifying Neem Peel-Off mask', 'himalaya-purifying-neem-peel-off-mask', 'Himalaya Purifying Neem Peel-Off Mask is power packed with Neem and Turmeric, a tried and tested herbal combination, well-known for its antimicrobial and anti-inflammatory properties. This mask reduces oiliness, helps prevent pimples, and lightens pimple marks, leaving you with clear and healthy skin.', '', '', 'Usually Delivered In 2-3 Days', 'Purifying Neem Peel-Off mask\r\nRemoves pimple marks and provides clear, blemish-free skin', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/purifying-neem-peel-off-mask.jpg', 'https://www.raeesworld.com/img/uploads/purifying-neem-peel-off-mask.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nNeem is a herb known for its antibacterial properties. It improves general skin health and immunity, combating bacterial infections such as acne, boils and ulcers. Neem tackles bacteria from the root and prevents the recurrence of pimples and blemishes.\r\n\r\nTurmeric is a herb that has antiseptic and strong anti-inflammatory properties which soothe skin gently, making skin soft and supple.</li><li>Directions for use:\r\nApply Himalaya Purifying Neem Peel-Off Mask evenly over cleansed face and neck, avoiding the area around the eyes. Allow the mask to dry for 10-15 minutes. Gently remove the peel from the side of the face. Use once or twice a week, based on skin type. Do not apply on broken or inflamed skin. For best results, follow a regimen using Purifying Neem Face Wash, Purifying Neem Scrub and Purifying Neem Pack.\r\n\r\nA patch test is recommended before using on the face for the first time. Apply the mask in a 2x2 cm area on the inside of the hand below the wrist 24 hours before facial application. Follow the directions for use to ensure skin tolerance.</li><li>FPack size:\r\n50g and 100g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(69, 'Tan Removal Orange Peel-Off Mask', 'himalaya-tan-removal-orange-peel-off-mask', 'Himalaya Tan Removal Orange Peel-Off Mask is an effective blend of the natural skin lightening extracts of Orange Peel and Honey which help reduce skin tan from the very first use. Orange Peel works to control melanin synthesis with the peeling action helping to remove skin tan and lightening the skin tone. Honey soothes and moisturizes skin.', '', '', 'Usually Delivered In 2-3 Days', 'Tan Removal Orange Peel-Off Mask\r\nRemoves skin tan', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/tan-removal-orange-peel-off-mask.jpg', 'https://www.raeesworld.com/img/uploads/tan-removal-orange-peel-off-mask.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nOrange Peel effectively lightens skin tone and can be very beneficial as it eliminates excess facial oil without damaging the skin. The Vitamin C and antioxidants present in Orange Peel work collectively to provide even-textured skin while acting as natural cleansers.\r\nHoney contains superior antibacterial, probiotic, and healing properties and is extremely nourishing and hydrating.</li><li>Directions for use:\r\nApply Himalaya Tan Removal Orange Peel-Off Mask evenly over cleansed face and neck, avoiding the area around the eyes. Allow the mask to dry for 10-15 minutes. Gently remove the peel from the side of the face. Use once or twice a week, based on skin type. Do not apply on broken or inflamed skin.\r\n\r\nA patch test is recommended before using on the face for the first time. Apply the mask in a 2x2 cm area on the inside of the hand below the wrist 24 hours before facial application. Follow the directions for use to ensure skin tolerance.</li><li>Pack size:\r\n50g and 100g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', '');
