(70, 'Refreshing Fruit Pack', 'himalaya-refreshing-fruit-pack', 'Himalayas Refreshing Fruit Pack blends together a host of natural fruity ingredients that leave your skin feeling rejuvenated and soft.\r\n\r\nThe extracts of Papaya, Fig, Crab Apple, Cucumber and Fullers Earth nourish the skin and improve skin glow. Our Refreshing Fruit Pack cools the skin, smoothening it and removing deeply embedded impurities.', '', '', 'Usually Delivered In 2-3 Days', 'Refreshing Fruit Pack\r\nFruity afterglow', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/Refreshing-fruit-pack.jpg', 'https://www.raeesworld.com/img/uploads/Refreshing-fruit-pack.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '0', 1, '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nPapaya is a key ingredient in skin whitening products because it contains papain, a natural enzyme that promotes skin renewal and cell turnover. It helps in exfoliating the skin to reveal newer cells and has restorative properties that soften the skin. \r\n\r\nFig has a cooling effect, which refreshes and rejuvenates the skin, and is also rich in antioxidants. \r\n\r\nCrab Apple is a rich source of antioxidants and vitamins which prevent skin cell degeneration and premature skin aging.\r\n\r\nCucumber is an excellent toner as it immediately tightens open pores. The abundant antioxidants in Cucumber rejuvenate the skin and leave it feeling soft and smooth. \r\n\r\nFuller\'s Earth is an excellent cleanser that removes deep-seated dirt and skin pollutants.</li><li>Directions for use:\r\nApply Refreshing Fruit Pack evenly over cleansed face and neck, avoiding the area around the eyes and mouth. Let the mask dry for 10-15 minutes, and remove with a wet sponge or towel. Rinse with cool water. For optimal results, use once a week.</li><li>Best for normal to dry skin.</li><li>Pack size:\r\n50g and 100g. </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(71, 'Anti-Dandruff Hair Cream', 'himalaya-anti-dandruff-hair-cream', 'Himalaya\'s Anti-Dandruff Hair Cream gently and effectively removes dandruff while keeping hair nourished and moisturized. It soothes an itchy and flaky scalp, which in turn helps strengthen the hair shaft and control hair fall.\r\n\r\nTea Tree Oil is an excellent anti-dandruff agent. With a high content of terpinen-4-ol, the major antimicrobial compound in Tea Tree Oil, dead cells and dandruff are eliminated.', '', '', 'Usually Delivered In 2-3 Days', 'Anti-Dandruff Hair Cream\r\nAll-day confidence in a jar', NULL, NULL, '', 75, NULL, 'https://www.raeesworld.com/img/uploads/anti-dandruff-hair-cream_100.jpg', 'https://www.raeesworld.com/img/uploads/anti-dandruff-hair-cream_100.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nTea Tree Oil is a known anti-fungal agent which effectively treats dandruff. It moisturizes hair and keeps the scalp free of fungal infections.\r\n\r\nTulsi helps nourish hair, making it healthy and leaving it moisturized throughout the day.</li><li>Directions for use:\r\nMassage Anti-Dandruff Hair Cream gently into the scalp using a circular motion. Use regularly before and after shampooing to maintain dandruff-free, soft and healthy hair.\r\n\r\nFor best results, shampoo hair with Himalaya\'s Anti-Dandruff Shampoo.\r\n\r\nSuitable for all hair types. Safe to use on artificially colored or permed hair.</li><li>Pack size\r\n100ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(72, 'Anti-Hair Fall Cream', 'reduces-hair-fall-and-promotes-hair-growth', 'Himalaya\'s Anti-Hair Fall Cream is a unique, daily-use formula which reduces hair fall and strengthens hair follicles. The goodness of essential herbs like Bhringaraja and Amla nourish hair from the roots, help reduce hair fall, improve hair growth, and strengthen hair follicles.', '', '', 'No Return Applicable', '', NULL, NULL, '', 75, NULL, 'https://www.raeesworld.com/img/uploads/anti-hair-fall-cream_100.jpg', 'https://www.raeesworld.com/img/uploads/anti-hair-fall-cream_100.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'facewash,\r\nhimalaya facewash\r\n', 100, 2, '1', '0', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nBhringaraja is rich in phytochemicals like eclalbosaponins and wedelolactone which help promote hair growth and strengthen the hair root, and keeping hair healthy.</li><li>Amla, a natural hair tonic used extensively in Ayurveda, is an effective ingredient for treating the hair and scalp. It is a rich source of Vitamin C and polyphenols. Amla helps maintain hair color, delays premature greying and supports the strength of hair follicles.</li><li>Directions for use:\r\nMassage Anti-Hair Fall Cream gently into the scalp using a circular motion. Use regularly before and after shampooing to reduce hair fall and maintain healthy hair.</li><li>For best results, shampoo hair with Himalaya\'s Anti-Hair Fall Shampoo.\r\n\r\nSuitable for all hair types. Safe to use on artificially colored or permed hair. </li><li>Pack size:\r\n100ml.</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(73, 'Protein Hair Cream', 'a-little-bit-of-heaven-for-hair', 'A natural hair cream full of goodness, Himalayas Protein Hair Cream nourishes the hair root and shaft. Its specially formulated ingredients strengthen hair, promote hair growth and leave your hair soft and shiny. Protein Hair Cream nourishes your hair with natural proteins derived from Chickpea, while Amla promotes hair growth.', '', '', ' No Return Applicable', '', NULL, NULL, '', 75, NULL, 'https://www.raeesworld.com/img/uploads/Protein-Hair-Cream_100.jpg', 'https://www.raeesworld.com/img/uploads/Protein-Hair-Cream_100.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'protein hair cream,\r\nanti hair fall cream,\r\nhair fall cream,\r\nhimalaya hair fall cream', 100, 2, '1', '0', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAmla, a natural hair tonic used extensively in Ayurveda, is an effective ingredient for treating the hair and scalp. It prevents dandruff, strengthens hair follicles and promotes hair growth. It also acts as an antioxidant.</li><li>Chickpea, a natural source of proteins, effectively nourishes hair, making it healthy and strong.</li><li>Directions for use:\r\nMassage Protein Hair Cream gently on scalp using a circular motion before and after shampooing.\r\n</li><li>Best for dry, lifeless hair and hair loss. Safe to use on artificially colored or permed hair. </li><li>Pack size\r\n100ml.</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(74, 'Lip Balm', 'total-lip-protection', 'Himalayas Lip Balm, made up of completely natural actives, relieves sore and chapped lips, especially during the winter season.\r\n\r\nEnriched with the oils of Castor, Coconut, Wheat Germ and Carrot and the extracts of Sweet Indrajao, Lip Balm protects your lips against the drying effects of the cold, wind and central heating.', '', '', 'usually delevered in 2-3 days,\r\nNo Return Applicable.', '', NULL, NULL, '', 28, NULL, 'https://www.raeesworld.com/img/uploads/Lip-Balm.jpg', 'https://www.raeesworld.com/img/uploads/Lip-Balm.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'lip balm,\r\nhimalaya lip balm,\r\n', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCastor Oil is used externally to relieve various inflammatory skin conditions. It is helpful in treating sunburn, acne, dry skin, boils, warts and stretch marks.\r\n\r\nCarrot Seed Oil contains Vitamin A in the form of beta-carotene which is essential for tissue growth in the body. Carrot is an excellent natural antioxidant, which slows down the aging process by scavenging free radicals.</li><li>Wheat Germ Oil is a rich source of natural Vitamin E which nourishes the skin and prevents moisture loss. It tones and softens the lips and exhibits potent antioxidant activity.\r\n\r\nSweet Indrajao leaves are used in various skin disorders including herpes. Its astringent, anti-inflammatory and antibacterial properties make it ideal to treat a broad range of skin disorders.</li><li>Coconut Oil extract is an effective emollient and can be used externally for softening lips. In addition, it is an effective moisturizer for all skin types including dry skin. Coconut Oil can delay the onset of wrinkles and sagging skin which typically become prominent with age. The oil also helps in treating various skin conditions including psoriasis, dermatitis and eczema.</li><li>Directions for use:\r\nApply a thin, smooth layer of Lip Balm on your lips. Reapply throughout the day as needed for supple, smooth lips.\r\n\r\nBest for dry, chapped lips.</li><li>Pack size:\r\n5g and 10g.</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(75, 'Litchi Shine Lip Care', 'naturally-glossy-soft-and-younger-looking-lips', 'Shine with Himalaya Herbals naturally glossy Litchi Shine Lip Care. Our luxurious lip balm moisturizes your lips to keep them soft and supple.\r\n\r\nThe moisture-retention formula with skin soothers makes your lips naturally glossy while the antioxidants and natural actives care for your lips by protecting them from environmental damage.\r\n\r\nEnriched with 100% natural color, Vitamin E and antioxidants, Litchi Shine Lip Care is free from preservatives, petroleum jelly, mineral oil and silicone.', '', '', 'usually delivered in 2-3 days\r\n\r\nNo Return Applicable', '', NULL, NULL, '', 134, NULL, 'https://www.raeesworld.com/img/uploads/litchi-shine-lip-care-1.jpg', 'https://www.raeesworld.com/img/uploads/litchi-shine-lip-care-1.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Litchi Shine Lip Care,\r\nlitchi lip care,\r\nhimalaya lip care', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nLitchi has antioxidants that help protect skin.</li><li>Castor Oil has soothing emollient properties that make lips soft and supple.</li><li>Directions for use:\r\nApply Litchi Shine Lip Care evenly and liberally on your lips, as often as needed.</li><li>Pack size:\r\n4.5g </li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(76, 'Rich Cocoa Butter Lip Care', 'rich-cocoa-butter-lip-care', 'Indulge your lips with Himalaya Herbals intensely moisturizing Rich Cocoa Butter Lip Care. Our luxurious lip balm moisturizes your lips to keep them soft and supple.\r\n\r\nThe moisture-retention formula with skin soothers makes your lips naturally glossy while the antioxidants and natural actives care for your lips by protecting them from environmental damage.\r\n\r\nEnriched with 100% natural color, Vitamin E and antioxidants, Rich Cocoa Butter Lip Care is free from preservatives, petroleum jelly, mineral oil and silicone.', '', '', 'usually delivered in 2-3 days No Return Applicable', 'Repairs, heals and intensely moisturizes lips', NULL, NULL, '', 134, NULL, 'https://www.raeesworld.com/img/uploads/rich-cocoa-butter-lip-care.jpg', 'https://www.raeesworld.com/img/uploads/rich-cocoa-butter-lip-care.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'rich cocoa butter lip balm,\r\ncocoa lip balm,\r\ncocoa butter lip balm\r\n', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCocoa Butter provides intense hydration, effectively moisturizes chapped lips and makes lips soft, supple and healthy. \r\n</li><li>Castor Oil has soothing emollient properties that make lips soft and supple.</li><li>Directions for use:\r\nApply Rich Cocoa Butter Lip Care evenly and liberally on your lips, as often as needed.</li><li>Pack size:\r\n4.5g </li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(77, 'Strawberry Shine Lip Care', 'for-soft-supple-and-shiny-lips', 'Shine with Himalaya Herbals naturally glossy Strawberry Shine Lip Care. Our luxurious lip balm moisturizes your lips to keep them soft and supple.\r\n\r\nThe moisture-retention formula with skin soothers makes your lips naturally glossy while the antioxidants and natural actives care for your lips by protecting them from environmental damage.\r\n\r\nEnriched with 100% natural color, Vitamin E and antioxidants, Strawberry Shine Lip Care is free from preservatives, petroleum jelly, mineral oil and silicone.', '', '', 'usually delivered in 2-3 days No Return Applicable', '', NULL, NULL, '', 134, NULL, 'https://www.raeesworld.com/img/uploads/strawberry-shine-lip-care1.jpg', 'https://www.raeesworld.com/img/uploads/strawberry-shine-lip-care1.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'strawberry shine lip balm,\r\nlip balm,\r\nstrawberry flavour lip balm', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nStrawberry Seed Oil is a rich source of essential fatty acids, acts as an excellent emollient and helps maintain the skin\'s moisture balance. \r\n</li><li>Apricot Kernel Oil is a rich source of Vitamin E and an emollient which effectively moisturizes dry and chapped lips.</li><li>Directions for use:\r\nApply Strawberry Shine Lip Care evenly and liberally on your lips, as often as needed.</li><li>Pack size:\r\n4.5g </li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(78, 'Peach Shine Lip Care', 'naturally-glossy-soft-and-rejuvenated-lips', 'Shine with Himalaya Herbals naturally glossy Peach Shine Lip Care. Our luxurious lip balm moisturizes your lips to keep them soft and supple.\r\n\r\nThe moisture-retention formula with skin soothers makes your lips naturally glossy while the antioxidants and natural actives care for your lips by protecting them from environmental damage.\r\n\r\nEnriched with 100% natural color, Vitamin E and antioxidants, Peach Shine Lip Care is free from preservatives, petroleum jelly, mineral oil and silicone.', '', '', 'usually delivered in 2-3 days No Return Applicable', '', NULL, NULL, '', 134, NULL, 'https://www.raeesworld.com/img/uploads/peach-shine-lip-care-1.jpg', 'https://www.raeesworld.com/img/uploads/peach-shine-lip-care-1.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Peach Shine Lip balm,\r\npeach lip balm,\r\nhimalaya peach lip balm', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nPeach Kernel Oil is a good moisturizing agent that nourishes the skin and is rich in antioxidants which rejuvenate lips.</li>\r\n<li>Castor Oil has soothing emollient properties that help make lips soft and supple.</li><li>Directions for use:\r\nApply Peach Shine Lip Care evenly and liberally on your lips, as often as needed.</li><li>Pack size:\r\n4.5g </li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(79, 'Natural Moisturizing Lip Butter', 'creamy-goodness-for-your-lips', 'Himalaya\'s Natural Moisturizing Lip Butter is a luxurious blend of herbal butters that intensely moisturize your lips all day long. A combination of Cocoa and Sal Butters hydrates your lips and prevents them from chapping.', '', '', 'usually delivered in 2-3 days No Return Applicable', '', NULL, NULL, '', 134, NULL, 'https://www.raeesworld.com/img/uploads/Natural-Moisturizing-Lip-Butter.jpg', 'https://www.raeesworld.com/img/uploads/Natural-Moisturizing-Lip-Butter.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Natural Moisturizing Lip cream,\r\nlip cream,\r\nhimalaya lip cream', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCocoa Butter, also known as the oil of theobroma, is a high-quality emollient and a skin softening and moisturizing agent. It promotes healing and prevents the lips from drying and cracking. </li><li>Sal Butter has excellent emollient properties, moisturizing and softening lips. It also prevents lips from drying and cracking.</li><li>Directions for use:\r\nApply Natural Moisturizing Lip Butter evenly and liberally on your lips, as often as needed.</li><li>Pack size:\r\n10g </li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(80, ' Natural Soft Vanilla Lip Care', 'softens-nourishes-and-smoothens-lips', 'Care for your lips with Himalaya Herbals daily moisturizing Natural Soft Vanilla Lip Care. Our luxurious lip balm moisturizes your lips to keep them soft and supple.\r\n\r\nThe moisture-retention formula with skin soothers makes your lips naturally glossy while the antioxidants and natural actives care for your lips by protecting them from environmental damage.\r\n\r\nEnriched with 100% natural color, Vitamin E and antioxidants, Natural Soft Vanilla Lip Care is free from preservatives, petroleum jelly, mineral oil and silicone.', '', '', 'usually delivered in 2-3 days No Return Applicable', '', NULL, NULL, '', 134, NULL, 'https://www.raeesworld.com/img/uploads/natural-soft-vanilla-lip-care.jpg', 'https://www.raeesworld.com/img/uploads/natural-soft-vanilla-lip-care.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', ' Natural Soft Vanilla Lip balm,\r\nvanilla flavour lip balm,\r\nhimalaya lip balm', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nVanilla Oil reduces lip dryness and improves softness. Its anti-inflammatory properties heal chapped and damaged lips.</li>\r\n<li>Castor Oil has soothing emollient properties that make lips soft and supple.</li><li>Directions for use:\r\nApply Natural Soft Vanilla Lip Care evenly and liberally on your lips, as often as needed.</li><li>Pack size:\r\n4.5g</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(81, 'Sun Protect Orange Lip Care', 'nourishes-and-soothes-lips-shields-against-harmful-uv-rays', 'Himalaya Sun Protect Orange Lip Care, with SPF 30 and PA+++ (protection against UVA rays), protects your lips from sun damage. It keeps your lips soft and supple with its luxurious moisture-retention formula. Packed with antioxidants and the goodness of nature, Himalaya Sun Protect Orange Lip Care protects lips from environmental damage.', '', '', 'usually delivered in 2-3 days No Return Applicable', '', NULL, NULL, '', 175, NULL, 'https://www.raeesworld.com/img/uploads/sun-protect-orange-lip-care.jpg', 'https://www.raeesworld.com/img/uploads/sun-protect-orange-lip-care.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Sun Protect Orange Lip balm,\r\norange flavour lip balm,\r\nhimalaya  orange lip balm', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>USP:\r\nSPF 30 \r\n\r\nPA+++\r\n\r\nFree from Preservatives, Petroleum Jelly, Silicones and Mineral Oil.</li><li>Key ingredients:\r\nOrange, known for its skin conditioning and photo-protection properties, helps protect lips</li><li>Vitamin E, known to nourish and soothe lips, makes them soft and supple.</li><li>Directions for use:\r\nApply Himalaya Sun Protect Orange Lip Care evenly and liberally on your lips. Reapply throughout the day as needed for supple, smooth lips.</li><li>Pack size:\r\n4.5g</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(82, 'Rich Cocoa Butter Body Cream', 'intensely-moisturizes-for-healthy-radiant-skin', 'Indulge in this exotically rich body cream enriched with the goodness of Natural Cocoa Butter that absorbs easily, and eliminates dryness and dullness, leaving your skin intensely moisturized, healthy and radiant.\r\n\r\nHimalaya Rich Cocoa Butter Body Cream improves the moisture content of skin by helping retain moisture between skin layers and preventing moisture loss. The Vitamin E in Cocoa Butter protects skin from damage due to the harmful effects of the sun and pollution.\r\n\r\nRich Cocoa Butter Body Cream is non-greasy and contains 100% herbal actives.\r\n\r\nDermatologically tested and hypoallergenic', '', '', 'usually delivered in 2-3 days No Return Applicable', '', NULL, NULL, '', 225, NULL, 'https://www.raeesworld.com/img/uploads/rich-cocoa-butter-body-cream.jpg', 'https://www.raeesworld.com/img/uploads/rich-cocoa-butter-body-cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', 'Moisturizing cream,\r\ncocoa flavour moisturizing cream,\r\nhimalaya moisturizing cream', 100, 2, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCocoa butter retains moisture, nourishes and protects skin with long lasting hydration, leaving skin soft and smooth due to its intense emollient property. The Vitamin E in Cocoa Butter protects skin from damage.</li><li>Directions for use:\r\nApply Himalaya Rich Cocoa Butter Body Cream generously and evenly using a circular motion. Pay special attention to severely dry areas, gently massaging the body cream in.</li><li>Best used after bathing when your skin is most receptive to hydration.</li>\r\n<li> Available As:\r\nCream</li><li>Pack size:\r\n200 ml.</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(83, 'Winter Defense Moisturizing Cream', 'for-dry-extra-dry-skin', 'An effective blend of herbal extracts that moisturizes even the extremely dry areas of your skin, Himalaya Herbals Winter Defense Moisturizing Cream is enriched with Wheat Germ, a rich source of Natural Vitamin E that protects skin from environmental damage. Jojoba Oil and Almond Oil repair and deeply nourish dry skin, keeping it soft and supple even during the harshest, winter months.', '', '', 'usually delivered in 2-3 days No Return Applicable', '', NULL, NULL, '', 120, NULL, 'https://www.raeesworld.com/img/uploads/winter-defense-moisturizing-cream.jpg', 'https://www.raeesworld.com/img/uploads/winter-defense-moisturizing-cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 2, '1', '0', 0, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nJojoba Oil repairs dry skin\r\nWheat Germ protects skin from damage\r\nAlmond Oil deeply moisturizes skin</li><li>Directions for use\r\nApply Himalaya Herbals Winter Defense Moisturizing Cream gently all over the body, with special attention to severely dry areas, slowly massaging it in</li><li>Best used after bathing when your skin is most receptive to hydration.</li><li>Pack size:\r\n50ml and 100ml. </li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(84, 'Youth ETERNITY DAY CREAM', 'himalaya-youth-eternity-day-cream', 'Himalaya Youth Eternity Day Cream is a breakthrough anti-aging formulation based on Plant Stem Cell Research and exotic Herbal Actives. Edelweiss Plant Stem Cells are power packed with antioxidants, while Woodfordia, Rose Myrtle, and Cipadessa regulate youth genes and work with your innate Skin Cell Matrix, responsible for the anti-aging mechanism of your skin. This light, non-greasy, fast-absorbing day cream is a powerful blend of botanical extracts that reduce fine lines and wrinkles, and re-plump your skin, leaving it looking healthier and younger.\r\n\r\nSoftens your skin\r\nReduces fine lines and wrinkles in 4 weeks*\r\n96% of consumers noticed significant improvement in skin hydration*\r\nVisible reduction in age spots and pigmentation in 4 weeks*\r\nImproves Skin Cell Matrix** to fight signs of aging\r\nPrevents daily damage caused by #PHOTOAGEING and provides deep moisture to skin\r\nReduces visible pores, evens skin tone, and enhances skin luminance', '', '', 'Usually delivered in 2-3 days.', 'Youth ETERNITY DAY CREAM\r\nRe-Plumps. Reduces Fine Lines and Wrinkles', NULL, NULL, '', 99, NULL, 'https://www.raeesworld.com/img/uploads/youth_eternity_day_cream.jpg', 'https://www.raeesworld.com/img/uploads/youth_eternity_day_cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nEdelweiss Derived Stem Cells: Found in the Alps in Europe, Edelweiss has proven antioxidant, anti-aging, and skin conditioning properties.\r\n\r\nCipadessa, Rose Myrtle and Woodfordia: These herbs promote skin elasticity and hydration, improving the Skin Cell Matrix to fight signs of aging.</li><li>Directions for use:\r\nApply Youth Eternity Day Cream liberally on thoroughly cleansed face and neck, once or twice a day. For best results, use daily along with Himalaya Youth Eternity Night Cream and Himalaya Youth Eternity Under Eye Cream.</li><li>Pack size:\r\n10ml, 20ml, and 50ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(85, 'Youth ETERNITY NIGHT CREAM', 'youth-eternity-night-cream', 'Himalaya Youth Eternity Night Cream is a breakthrough anti-aging formulation based on Plant Stem Cell Research and Exotic Herbal Actives. A special blend of Edelweiss Plant Stem Cells, Woodfordia, Rose Myrtle, Cipadessa, and Apple, rich in powerful antioxidants, polyphenols, and anti-aging properties, works overnight to provide intense hydration, reduce fine lines and wrinkles, leaving skin even-toned, healthy, and visibly youthful.\r\n\r\nReduces fine lines and wrinkles in 4 weeks\r\nImproves and evens skin tone\r\nImproves skin elasticity and hydration\r\nSmoothens your skin', '', '', 'Usually delivered in 2-3 days.', 'Youth ETERNITY NIGHT CREAM\r\nRe-Plumps and Restores Youthful Skin', NULL, NULL, '', 465, NULL, 'https://www.raeesworld.com/img/uploads/youth_eternity_night_cream.jpg', 'https://www.raeesworld.com/img/uploads/youth_eternity_night_cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nEdelweiss Derived Stem Cells: Found in the Alps in Europe, Edelweiss has proven antioxidant, anti-aging, and skin conditioning properties.\r\n\r\nCipadessa, Rose Myrtle and Woodfordia: These herbs promote skin elasticity and hydration, improving the Skin Cell Matrix to fight signs of aging.\r\n\r\nApple, a natural astringent, works as an effective antioxidant and conditions the skin.</li><li>Directions for use:\r\nMassage Himalaya Youth Eternity Night Cream gently over cleansed face and neck at night before retiring. For best results, use regularly with Himalaya Youth Eternity Day Cream and Himalaya Youth Eternity Under Eye Cream.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(86, 'Youth ETERNITY UNDER EYE CREAM CREAM', 'youth-eternity-under-eye-cream-cream', 'Himalaya Youth Eternity Under Eye Cream is a breakthrough anti-aging formulation derived from Plant Stem Cell Research and Exotic Herbal Actives. Rich in anti-aging and anti-inflammatory properties, this is a superior blend of ingredients like Edelweiss Plant Stem Cells, Woodfordia, Rose Myrtle, Cipadessa, and Amla. The under eye cream gently nourishes and hydrates the tender skin around your eyes, leaving it remarkably bright, healthy, and youthful.\r\n\r\nReduces Crow\'s feet wrinkles and fine lines from 4th week*\r\nVisibly reduces the intensity of under eye dark circles\r\nHelps manage morning puffy eyes', '', '', 'Usually delivered in 2-3 days.', 'Youth ETERNITY UNDER EYE CREAM CREAM\r\nReduces Wrinkles, Puffiness and Dark Circles\r\n', NULL, NULL, '', 490, NULL, 'https://www.raeesworld.com/img/uploads/youth_eternity_under_eye_cream.jpg', 'https://www.raeesworld.com/img/uploads/youth_eternity_under_eye_cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nEdelweiss Derived Stem Cells: Found in the Alps in Europe, Edelweiss has proven antioxidant, anti-aging, and skin conditioning properties.\r\n\r\nCipadessa, Rose Myrtle, and Woodfordia: These herbs promote skin elasticity and hydration, improving the Skin Cell Matrix to fight signs of aging.\r\n\r\nAmla, a rich, natural source of Vitamin C, possesses antioxidant properties that help prevent signs of skin aging.\r\n</li><li>Directions for use:\r\nGently dab a dot of Himalaya Youth Eternity Under Eye Cream around the eye area until the product is absorbed. Apply once or twice a day. Works well with make-up. For best results, use daily along with Himalaya Youth Eternity Day Cream and Himalaya Youth Eternity Night Cream.</li><li>Pack size:\r\n15ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(87, 'ANTI-WRINKLE CREAM', 'himalaya-anti-wrinkle-cream', 'Himalaya Herbals Anti-Wrinkle Cream is a perfect solution for younger looking skin. The cream deeply penetrates skin and provides three essential benefits to keep worry lines away:\r\n\r\nReduces fine lines and wrinkles\r\nMoisturizes skin\r\nHelps reduce age spots', '', '', 'Usually delivered in 2-3 days.', 'ANTI-WRINKLE CREAM\r\nReduces wrinkles, fine lines and age spots', NULL, NULL, '', 235, NULL, 'https://www.raeesworld.com/img/uploads/anti-wrinkle-cream-new.jpg', 'https://www.raeesworld.com/img/uploads/anti-wrinkle-cream-new.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAloe Vera, known for its many healing properties, is rich in polysaccharides and nutrients which exhibit antibacterial and antifungal action. Its hydrating, softening and intense moisturizing properties nourish the skin and keep it soft and supple all day.\r\n\r\nGrape is rich in AHAs (Alpha Hydroxy Acids) that reduce wrinkles and fine lines.</li><li>Directions for use:\r\nMassage Anti-Wrinkle Cream gently over cleansed face twice a day. For best results, use regularly.\r\n\r\nAnti-Wrinkle Cream is dermatologically tested, non-comedogenic, free of mineral oils and parabens, and hypoallergenic.</li><li>Pack size:\r\n50g</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(88, 'Clear Complexion Whitening Day Cream', 'himalaya-clear-complexion-whitening-day-cream', 'Himalayas Clear Complexion Whitening Day Cream gives a radiant glow and brighter skin tone. Our day cream is light and non-greasy, enriched with unique herbal extracts and CINNABLOC to provide three effective actions:\r\n\r\nHydrates skin\r\nLightens skin tone\r\nClears complexion\r\nThe breakthrough herbal sunblock CINNABLOC provides UV protection and prevents skin darkening.', '', '', 'Usually delivered in 2-3 days.', 'Himalaya Clear Complexion Whitening Day Cream\r\nLightens skin tone. Provides UV protection', NULL, NULL, '', 235, NULL, 'https://www.raeesworld.com/img/uploads/clear-complexion-whitening-day-cream-new.jpg', 'https://www.raeesworld.com/img/uploads/clear-complexion-whitening-day-cream-new.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nLicorice is known to help lighten skin and fade dark spots and blemishes, to give your skin a brighter complexion by inhibiting melanin synthesis. \r\n\r\nWhite Dammer is a rich source of flavonoids and phenols which exhibit potent antioxidant activity. It helps reduce mild pigmentation and spots, resulting in an even skin tone. </li><li>Directions for use:\r\nApply Clear Complexion Whitening Day Cream gently over face and neck twice daily, after cleansing. For best results, use regularly.\r\n\r\nClear Complexion Whitening Day Cream is dermatologically tested, non-comedogenic, free of mineral oils and parabens, and hypoallergenic. </li><li>Pack Size:\r\n50g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(89, 'Natural Glow Fairness Cream', 'himalaya-natural-glow-fairness-cream', 'Himalayas Natural Glow Fairness Cream is an advanced skin lightening formula. Its unique formulation ensures five visible actions: lightening and evening of skin tone, reducing blemishes and dark spots, helping reduce under-eye dark circles, nourishing skin and moisturizing skin without making it greasy.\r\n\r\nThe unique Phyto Vitamin Complex in Natural Glow Fairness Cream comes from a complex of Alfalfa, Saffron, Vitamin B3, and Vitamin E. Vitamin B3 is an effective skin lightening compound while Vitamin E helps protect the skin against oxidative damage.', '', '', 'Usually delivered in 2-3 days.', 'Natural Glow Fairness Cream\r\nNature\'s way to fairer skin', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/natural-glow-fairness-cream.jpg', 'https://www.raeesworld.com/img/uploads/natural-glow-fairness-cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nSaffron (Kesar) is a luxurious herb that has been used in skin care for centuries for a fairer, brighter complexion. Saffron keeps the skin moisturized and smooth. The crocin and crocetin present in Saffron help to enhance the complexion and lighten skin.\r\n\r\nAlfalfa is a source of Vitamins A, K and D, polyphenols and flavonoids. It is also high in calcium, phosphorus, iron, potassium and essential enzymes.\r\n</li><li>Directions for use:\r\nClean the face and neck thoroughly. Apply Natural Glow Fairness Cream all over the face and neck using an upward circular motion, twice a day.\r\n\r\nSuitable for all skin types.\r\n\r\nNatural Glow Fairness Cream is dermatologically-tested and hypoallergeni.</li><li>Pack size:\r\n25g and 50g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(90, 'Nourishing Skin Cream', 'himalaya-nourishing-skin-cream', 'Himalayas Nourishing Skin Cream is a light, nongreasy, daily-use cream, which provides all day moisturizing, nourishment and protection.\r\n\r\nThe cream is blended with the extracts of Aloe Vera, Winter Cherry, Indian Kino Tree and Indian Pennywort, which protect your skin from pollution and dry weather, providing nourishment and moisture.', '', '', 'Usually delivered in 2-3 days.', 'Nourishing Skin Cream\r\nFor a well-nourished skin', NULL, NULL, '', 70, NULL, 'https://www.raeesworld.com/img/uploads/Nourishing-Skin-Cream.jpg', 'https://www.raeesworld.com/img/uploads/Nourishing-Skin-Cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAloe Vera, known for its many healing properties, is rich in enzymes, polysaccharides and nutrients which exhibit antibacterial and antifungal action. A natural UV inhibitor, its hydrating, softening and intense moisturizing properties nourish the skin.\r\n\r\nWinter Cherry is an effective anti-stress agent. In skin care, this plant is used for its antioxidant action, which helps skin cell regeneration.\r\n\r\nIndian Kino Tree has astringent properties which work as a skin tonic to tone and rejuvenate facial skin.\r\n\r\nIndian Pennywort is regarded as the best home remedy for skin disorders such as chronic ulcers and persistent eczema.</li><li>Directions for use:\r\nApply Nourishing Skin Cream gently over face and neck twice daily, after cleansing. For best results, use regularly.\r\n\r\nSuitable for all skin types. Can also be used as a base for make-up.\r\n\r\nNourishing Skin Cream is dermatologically-tested, non-comedogenic and hypoallergenic.</li><li>Pack size:\r\n50ml, 100ml and 200ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '52', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(91, 'OIL-FREE RADIANCE GEL CREAM', 'himalaya-oil-free-radiance-gel-cream', 'Himalaya Herbals Oil-Free Radiance Gel Cream is a light and non-greasy, daily-use gel cream that gently hydrates to give an oil-free radiant glow. It is a light gel textured cream enriched with special herbs that provides three essential benefits:\r\n\r\nAbsorbs quickly into skin\r\nHydrates skin\r\nGives skin a natural radiance', '', '', 'Usually delivered in 2-3 days.', 'OIL-FREE RADIANCE GEL CREAM\r\nGently hydrates for an oil-free glow', NULL, NULL, '', 235, NULL, 'https://www.raeesworld.com/img/uploads/oil-free-radiance-gel-cream.jpg', 'https://www.raeesworld.com/img/uploads/oil-free-radiance-gel-cream.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nBarbary Fig contains polysaccharides that provide moisture.\r\n\r\nWinter Melon exhibits antioxidant properties that keep skin healthy, protected and rejuvenated. </li><li>Directions for use:\r\nApply Oil-Free Radiance Gel Cream gently over face and neck twice daily, after cleansing. For best results, use regularly.\r\n\r\nOil-Free Radiance Gel Cream is dermatologically tested, non-comedogenic, free of mineral oils and parabens, and hypoallergenic.</li><li>Pack Size:\r\n50g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(92, 'REVITALIZING NIGHT CREAM', 'himalaya-revitalizing-night-cream', 'Himalaya Herbals Revitalizing Night Cream is a deep- penetrating, luxurious cream that works overnight with the skin\'s natural renewal cycle. The cream provides three essential benefits that make skin soft, supple and rejuvenated:\r\n\r\nRenews skin cells\r\nHydrates skin\r\nRepairs daily damage', '', '', 'Usually delivered in 2-3 days.', 'REVITALIZING NIGHT CREAM\r\nRestores moisture balance, and nourishes and repairs\r\n', NULL, NULL, '', 235, NULL, 'https://www.raeesworld.com/img/uploads/revitalizing-night-cream-new.jpg', 'https://www.raeesworld.com/img/uploads/revitalizing-night-cream-new.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nWhite Lily is rich in antioxidants which help to neutralize free radicals and repair daily damage. \r\n\r\nTomato fruit is rich in flavonoids and AHAs (Alpha Hydroxy Acids) that help in cell renewal.</li><li>Directions for use:\r\nMassage Revitalizing Night Cream gently over cleansed face at night before retiring. For best results, use regularly.\r\n\r\nRevitalizing Night Cream is dermatologically tested, non-comedogenic, free of mineral oils and parabens, and hypoallergenic.</li><li>Pack size:\r\n50g. </li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '55', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(94, 'Honey & Cream Soap', 'himalaya-honey-cream-soap', 'A specially formulated soap for normal to dry skin, Honey & Cream Soap intensely nourishes, softens and smoothens your skin. The soaps deep penetrating natural ingredients help repair and moisturize skin as well as making it supple.\r\n\r\nEnriched with the natural goodness of Honey and Milk, Honey & Cream Soap restores the skin\'s elasticity, leaving it soft and toned.', '', '', 'Usually delivered in 2-3 days.', 'Honey & Cream Soap\r\nPure skin luxury', NULL, NULL, '', 29, NULL, 'https://www.raeesworld.com/img/uploads/honey-and-cream-soap.jpg', 'https://www.raeesworld.com/img/uploads/honey-and-cream-soap.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', 'Usually delivered in 2-3 days.', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nHoney is very beneficial to the skin as it attracts water to maintain moisture as well as providing nourishment. It is also a natural antiseptic as it contains many antimicrobial agents that kill bacteria.\r\n\r\nMilk is perfect for dry, itchy skin because of its natural softening and soothing properties. Milk contains natural lipids that moisturize skin deeply. The skins moisture level plays a major factor in skin cell renewal. Milk cream, with its rich fatty content, is an effective emollient and moisturizer. It imparts a glow to the skin, improves skin texture and softness and also gently heals itchy and dry skin.</li><li>Directions for use:\r\nWet the body, apply Honey & Cream Soap generously, work up a lather and rinse.</li><li>Pack size:\r\n75g and 125g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '54', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(95, 'Almond & Rose Soap', 'himalaya-almond-rose-soap', 'Himalayas Almond & Rose Soap combines 100% natural actives to restore the bodys water content. This non-greasy soap leaves skin feeling soft, supple and toned.\r\n\r\nBlended with all natural ingredients such as Almond Oil and Persian Rose, this body soap deeply penetrates into the skin to hydrate it fully.', '', '', 'Usually delivered in 2-3 days.', 'Almond & Rose Soap\r\nFully hydrated', NULL, NULL, '', 29, NULL, 'https://www.raeesworld.com/img/uploads/almond-and-rose-soap.jpg', 'https://www.raeesworld.com/img/uploads/almond-and-rose-soap.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'Usually delivered in 2-3 days.', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAlmond Oil is an excellent skin softener which moisturizes your skin.\r\nPersian Rose revitalizes the skin and leaves it feeling rejuvenated.</li><li>Directions for use:\r\nWet the body, apply Almond & Rose Soap generously, gently work up a lather and rinse.</li><li>Pack size:\r\n75g and 125g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '0', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(96, 'Neem & Turmeric Soap', 'himalaya-neem-turmeric-soap', 'Himalaya\'s Neem & Turmeric Soap blends together all the goodness of naturally derived ingredients to keep your skin protected at all times.\r\n\r\nThe oils of Neem and Turmeric, which contain antibacterial and antifungal properties, protect your skin from harsh environmental conditions.', '', '', 'Usually delivered in 2-3 days.', 'Neem & Turmeric Soap\r\nStay protected', NULL, NULL, '', 29, NULL, 'https://www.raeesworld.com/img/uploads/neem-and-turmeric-soap.jpg', 'https://www.raeesworld.com/img/uploads/neem-and-turmeric-soap.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'Usually delivered in 2-3 days.', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nNeem is an excellent skin care ingredient. Neem Oil relieves dry skin and soothes itchiness, redness and irritation. It also improves general skin health and immunity, combating bacterial infections such as acne, boils and ulcers.\r\n\r\nTurmeric has strong anti-inflammatory properties, which soothe your skin gently. The herb helps to even out your skin tone and complexion. Turmeric also helps to retain the skin\'s elasticity and makes it more supple.</li><li>Directions for use:\r\nWet the body, apply Neem & Turmeric Soap generously, work up a lather and rinse.</li><li>Pack size:\r\n75g and 125g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '54', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(97, 'Cucumber & Coconut Soap', 'himalaya-cucumber-coconut-soap', 'Himalayas Cucumber & Coconut Soap is ideal for rejuvenating and refreshing your skin.\r\n\r\nBlended together with the extracts of Cucumber and Coconut Oil, the soap tones your skin, leaving it soothed, nourished and moisturized.', '', '', 'Usually delivered in 2-3 days.', 'Cucumber & Coconut Soap\r\nTo freshen you up', NULL, NULL, '', 29, NULL, 'https://www.raeesworld.com/img/uploads/cucumber-and-coconut-soap.jpg', 'https://www.raeesworld.com/img/uploads/cucumber-and-coconut-soap.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 0, '', 'Usually delivered in 2-3 days.', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nCoconut Oil acts as an effective moisturizer for all skin types including dry skin. It also delays the onset of wrinkles and sagging skin which become prominent with age. Coconut Oil acts as an excellent moisturizer in dry skin conditions like eczema and psoriasis.\r\n\r\nCucumber is an excellent toner as it immediately tightens open pores. The abundant antioxidants in Cucumber rejuvenate the skin, leaving it feeling soft and smooth.</li><li>Directions for use:\r\nWet the body, apply Cucumber & Coconut Soap generously, work up a lather and rinse.</li><li>Pack size:\r\n75g and 125g.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '54', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(98, 'Anti-Dandruff Shampoo', 'himalaya-anti-dandruff-shampoo', 'Himalaya\'s Anti-Dandruff Shampoo gently removes dandruff, and nourishes and strengthens hair roots, ensuring a healthy scalp. Natural ingredients help moisturize the hair, preventing dryness. It addresses the root cause of dandruff such as Malassezia fungus and dry scalp, while being gentle on hair. Fortified with herbal ingredients like Tea Tree Oil, Chickpea and Aloe Vera, Himalaya\'s Anti-Dandruff Shampoo effectively helps control dandruff and provides nourishment to the hair shaft.', '', '', 'Usually delivered in 2-3 days.', 'Anti-Dandruff Shampoo\r\nRemoves dandruff and soothes scalp', NULL, NULL, '', 68, NULL, 'https://www.raeesworld.com/img/uploads/anti-dandruff-shampoo.jpg', 'https://www.raeesworld.com/img/uploads/anti-dandruff-shampoo.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', '', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nTea Tree Oil is a known anti-fungal agent which effectively treats dandruff. It moisturizes hair and keeps the scalp free of fungal infections.\r\n\r\nAloe Vera softens hair and soothes the scalp, helping to alleviate itching.</li><li>Directions for use:\r\nGently massage the shampoo into wet hair and scalp. Rinse thoroughly. Repeat if necessary.\r\n\r\nEffective for all hair types. Safe for use on artificially colored or permed hair.</li><li>Pack size:\r\n100 ml, 200 ml, 400 ml and 700ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(99, 'Anti-Hair Fall Shampoo', 'himalaya-anti-hair-fall-shampoo', 'Himalaya\'s Anti-Hair Fall Shampoo is a breakthrough 2-in-1 formula that reduces hair fall and provides nourishment to hair shafts. It also conditions and improves your hair texture to reduce hair fall due to breakage. The herbs Butea Frondosa and Bhringaraja stimulate hair follicle growth and are effective in strengthening hair roots and controlling hair fall.', '', '', 'Usually delivered in 2-3 days', 'Reduces hair fall and promotes hair growth\r\n', NULL, NULL, '', 68, NULL, 'https://www.raeesworld.com/img/uploads/anti-hair-fall-shampoo.jpg', 'https://www.raeesworld.com/img/uploads/anti-hair-fall-shampoo.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nButea Frondosa or \'flame of the forest\' is native to India and Southeast Asia. It strengthens hair and helps promote hair growth.\r\n\r\nBhringaraja is traditionally used in Ayurveda for hair growth and hair dyeing. It nourishes the hair root, improves hair texture and reduces hair fall.</li><li>Directions for use:\r\nGently massage the shampoo into wet hair and scalp. Leave for two to three minutes, and rinse thoroughly. Repeat if necessary.\r\n\r\nEffective for all hair types. Safe to use on artificially colored or permed hair.</li><li>Pack size\r\n100ml, 200ml, 400ml and 700ml.</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', '');
