(100, 'Damage Repair Protein Conditioner', 'himalaya-damage-repair-protein-conditioner', 'Himalayas Damage Repair Protein Conditioner provides intensive conditioning for dry, frizzy or damaged hair. Enriched with the extracts of protein-rich herbs, it provides necessary nourishment to hair, leaving it silky, smooth and healthy. This conditioner gently repairs, strengthens and protects your hair from future damage.', '', '', 'Usually delivered in 2-3 days', 'Damage Repair Protein Conditioner\r\nDeeply conditions and repairs', NULL, NULL, '', 78, NULL, 'https://www.raeesworld.com/img/uploads/damage-repair-protein-conditioner.jpg', 'https://www.raeesworld.com/img/uploads/damage-repair-protein-conditioner.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nYarrow, traditionally used in Ayurvedic formulations for shampoos, promotes a healthy scalp and strengthens the hair shaft. Yarrow extract is known to possess polyphenols and flavonoids which are reported to possess hair conditioning properties.\r\n\r\nBean Sprout is a rich source of natural proteins which effectively nourish the hair, providing hair conditioning benefits to make hair strong and healthy.</li><li>Directions for use:\r\nAfter shampooing, gently apply along the length of wet hair from base to tip. Leave for two minutes. Rinse thoroughly.\r\n\r\nBest for dry or damaged hair. Safe to use on artificially colored or permed hair.</li><li>Pack size\r\n100ml and 200ml.</li></ul>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(101, 'Anti-Dandruff Conditioner', 'himalaya-anti-dandruff-conditioner', 'Himalaya Anti-Dandruff Conditioner effectively conditions a dandruff prone and itchy scalp. Fortified with herbal protein-rich ingredients, the conditioner nourishes and moisturizes hair and also removes dandruff. It soothes an itchy and flaky scalp, which in turn helps strengthen the hair shaft.', '', '', 'Usually delivered in 2-3 days', 'Anti-Dandruff Conditioner\r\nFights Dandruff. Leaves Hair Soft and Smooth', NULL, NULL, '', 88, NULL, 'https://www.raeesworld.com/img/uploads/anti-dandruff-conditioner.jpg', 'https://www.raeesworld.com/img/uploads/anti-dandruff-conditioner.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 0, 1, '0', '', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nTea Tree Oil is a known anti-fungal agent which effectively treats dandruff. It moisturizes hair and keeps the scalp free of fungal infections.\r\n\r\nAloe Vera, softens and soothes hair with its moisturizing property.\r\n\r\nChickpea, a rich source of natural protein, helps nourish hair.</li><li>Directions for use:\r\nAfter shampooing, gently apply Himalaya Anti-Dandruff Conditioner along the length of wet hair from base to tip. Leave for two minutes. Rinse thoroughly.\r\n\r\nFor best results, use in combination with Himalaya Anti-Dandruff Shampoo and Himalaya Anti-Dandruff Hair Cream. Safe to use on artificially colored or permed hair.</li><li>Pack size:\r\n100ml and 200ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(102, 'Anti-Hair Fall Conditioner', 'himalaya-anti-hair-fall-conditioner', 'Himalaya Anti-Hair Fall Conditioner nourishes, fortifies, and improves the texture of hair, making it smooth, soft, and healthy. Enriched with protein-rich herbs like Bringaraja and Chickpea, it stimulates hair follicle growth and effectively strengthens hair strands and roots, helping control hair fall.\r\n\r\n', '', '', 'Usually delivered in 2-3 days', 'Anti-Hair Fall Conditioner\r\nReduces Excess Hair Fall*. Leaves Hair Soft and Smooth', NULL, NULL, '', 88, NULL, 'https://www.raeesworld.com/img/uploads/anti-hair-fall-conditioner.jpg', 'https://www.raeesworld.com/img/uploads/anti-hair-fall-conditioner.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 0, 1, '0', '', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nBhringaraja, traditionally used in Ayurveda for hair growth, is rich in phytochemicals like eclalbosaponins and wedelolactone which help promote hair growth and strengthen the hair root, helping maintain hair health.\r\n\r\nButea Frondosa (Palasha) or \'Flame of the Forest\' is native to India and Southeast Asia. It strengthens hair, helps reduce hair fall, and prevents hair thinning.</li><li>Directions for use:\r\nAfter shampooing, gently apply Himalaya Anti-Hair fall Conditioner along the length of wet hair from base to tip. Leave for two minutes. Rinse thoroughly.\r\n\r\nFor best results, use in combination with Himalaya Anti-Hair Fall Oil, Himalaya Anti-Hair Fall Shampoo, and Anti-Hair Fall Hair Cream. Safe to use on artificially colored or permed hair.</li><li>Pack size:\r\n100ml and 200ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(103, 'Damage Repair  Protein Shampoo', 'himalaya-damage-repair-protein-shampoo', 'Himalaya\'s Damage Repair Protein Shampoo is specially formulated for dry, frizzy and damaged hair caused by blow-drying and chemicals. The unique blend of herbs including Chickpea and Beach Almond provides nourishment and intensive conditioning from the root to the tip by repairing and strengthening the hair. Himalaya\'s Damage Repair Protein Shampoo also helps protect hair from future damage', '', '', 'Usually delivered in 2-3 days', 'Damage Repair \r\nProtein Shampoo\r\nRepairs and protects hair from damage', NULL, NULL, '', 68, NULL, 'https://www.raeesworld.com/img/uploads/damage-repair-protein-shampoo.jpg', 'https://www.raeesworld.com/img/uploads/damage-repair-protein-shampoo.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nBeach Almond fruit extract is rich with tannins which are reported to possess antimicrobial and antioxidant properties. The fruit of Beach Almond intensely conditions hair and helps prevent hair damage.\r\n\r\nChickpea seed extract is a rich source of protein. It is an effective hair conditioner which provides daily nourishment to hair, keeping it soft, smooth and healthy.</li><li>Directions for use:\r\nGently massage the shampoo into wet hair and scalp. Leave for two to three minutes, and rinse thoroughly. Repeat if necessary.\r\n\r\nEffective for all hair types. Safe to use on artificially colored or permed hair.</li><li>Pack size\r\n100ml, 200ml and 400ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(104, 'Dryness Defense Detangler & Conditioner', 'himalaya-dryness-defense-detangler-conditioner', 'Himalaya Dryness Defense Detangler & Conditioner is specially formulated for dry, frizzy and tangled hair. Enriched with herbal ingredients, our conditioner deeply moisturizes hair strands, without weighing hair down. This unique detangling formula provides manageability to tangled hair, reduces static and protects hair from future damage.', '', '', 'Usually delivered in 2-3 days', 'Dryness Defense Detangler & Conditioner\r\nDeeply Conditions and Detangles Hair', NULL, NULL, '', 88, NULL, 'https://www.raeesworld.com/img/uploads/dryness-defense-detangler-conditioner.jpg', 'https://www.raeesworld.com/img/uploads/dryness-defense-detangler-conditioner.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nHibiscus is a natural conditioner that moisturizes and detangles.\r\n\r\nBlue Water Lily nourishes, softens and promotes hair growth</li><li>Directions for use:\r\nAfter shampooing, apply conditioner on wet hair strands, focusing along the length of hair. Leave for two minutes and rinse thoroughly. Safe to use on artificially coloured or permed hair.</li><li>Pack size\r\n100 ml and 200 ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(105, 'Dryness Defense Protein Shampoo', 'himalaya-dryness-defense-protein-shampoo', 'Himalaya Dryness Defense Protein Shampoo is power-packed with ACTIVE NOURISHMENT TECHNOLOGY, enriched with natural protein which provides necessary nourishment to keep hair soft, shiny and manageable.', '', '', 'Usually delivered in 2-3 days', 'Dryness Defense Protein Shampoo\r\nFights dryness, keeps hair soft and moisturized', NULL, NULL, '', 68, NULL, 'https://www.raeesworld.com/img/uploads/dryness-defense-protein-shampoo.jpg', 'https://www.raeesworld.com/img/uploads/dryness-defense-protein-shampoo.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAloe Vera rich in nutrients, prevents hair from drying\r\n\r\nSesame Oil an effective emollient, provides deep moisture to scalp and hair, from root to tip.\r\n\r\nChickpea a rich source of natural protein, helps nourish hair.</li><li>Directions for use:\r\nMassage Himalaya Dryness Defense Protein Shampoo gently into wet hair and scalp. Rinse thoroughly. Repeat if necessary. Safe to use on artificially colored or permed hair.</li><li>Pack size\r\n100ml, 200ml and 400ml</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(106, 'Gentle Daily Care  Protein Conditioner', 'himalaya-gentle-daily-care-protein-conditioner', 'Himalayas Gentle Daily Care Protein Conditioner has a gentle formulation that conditions and keeps your hair silky-smooth, soft and tangle-free. It is enriched with protein-rich herbs that nourish, moisturize and condition your hair.', '', '', 'Usually delivered in 2-3 days', 'Gentle Daily Care \r\nProtein Conditioner\r\nKeeps your hair detangled, soft and radiant', NULL, NULL, '', 78, NULL, 'https://www.raeesworld.com/img/uploads/gentle-daily-care-protein-conditioner.jpg', 'https://www.raeesworld.com/img/uploads/gentle-daily-care-protein-conditioner.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nChickpea seed extract is a rich source of protein, and an effective hair conditioner which provides daily nourishment to your hair, keeping it soft, smooth and healthy.\r\nLotus effectively revitalizes hair and exhibits antioxidant properties with hair conditioning benefits</li><li>Directions for use:\r\nAfter shampooing, gently apply along the length of wet hair from base to tip. Leave for two minutes. Rinse thoroughly.\r\n\r\nBest for normal hair. Safe to use on artificially colored or permed hair.</li><li>Pack size\r\n100ml and 200ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(107, 'Gentle Daily Care  Protein Shampoo', 'himalaya-gentle-daily-care-protein-shampoo', 'Himalaya\'s Gentle Daily Care Protein Shampoo has a mild formulation for those who lead an active life, requiring frequent shampooing. Enriched with natural proteins, it gently cleanses and provides the necessary nourishment to hair.\r\n\r\nHimalaya\'s Gentle Daily Care Protein Shampoo keeps your hair soft, smooth and healthy.\r\n\r\nExtracts of protein-rich herbs like Chickpea and Amla provide nourishment to your hair while Licorice conditions and helps promote growth. The ingredients thoroughly cleanse hair, making it healthy and manageable.', '', '', 'Usually delivered in 2-3 days', 'Gentle Daily Care \r\nProtein Shampoo\r\nCleans gently and nourishes hair\r\n', NULL, NULL, '', 68, NULL, 'https://www.raeesworld.com/img/uploads/gentle-daily-care-protein-shampoo.jpg', 'https://www.raeesworld.com/img/uploads/gentle-daily-care-protein-shampoo.jpg,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '1', '0', 1, '', 'usually deliverd in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul><li>Key ingredients:\r\nAmla is a natural hair tonic, used extensively in Ayurveda as a key ingredient for treating hair and scalp conditions. It strengthens hair follicles and promotes hair growth.\r\n\r\nLicorice root extracts have been reported to possess glycyrrhizic acid which is stated to exhibit antioxidant and humectant properties which condition and maintain healthy hair.</li><li>Directions for use:\r\nGently massage the shampoo into wet hair and scalp. Rinse thoroughly. Repeat if necessary.\r\n\r\nBest for normal hair. Safe to use on artificially colored or permed hair.</li><li>Pack size\r\n100ml, 200ml and 400ml.</li><li>', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '51', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
