(130, 'Kurkure Namkeen - Masala Munch', 'kurkure-namkeen-masala-munch', '<table class=\"descr table\" style=\"height:119px; width:465px\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>\r\n			<p><strong>Brand History</strong></p>\r\n\r\n			<p>Launched in 1999, this perfect &lsquo;namkeen&rsquo; snack, developed entirely in India, has come to be identified with fun and lovable human quirks. It developed an even stronger identity through associations with well-known Indian actors.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 10, NULL, 'https://www.raeesworld.com/img/uploads/514GuE4z4cL__SY355_.jpg', 'https://www.raeesworld.com/img/uploads/514GuE4z4cL__SY355_.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '0', 1, '20', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Total sugars</p>\r\n\r\n<ul>\r\n	<li>\r\n	<div style=\"left: 120.04px; top: 623.431px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.08674);\">Ingredients:</div>\r\n\r\n	<div style=\"left: 120.04px; top: 644.631px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.996307);\">Rice meal,Ediblevegetableoil,cornmeal,gram meal,</div>\r\n\r\n	<div style=\"left: 368.683px; top: 665.865px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.00247);\">Spices and Condiments (Onion powder, Chilli powder, Amchur, Coriander seed powder, Ginger powder, Garlic powder,</div>\r\n\r\n	<div style=\"left: 120.04px; top: 708.065px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.00679);\">Black pepper powder, Turmeric powder, Spices extracts, FenugreekLeafpowder),Salt, BlackSalt,TomatoPowder,SugarCitricAcid,</div>\r\n\r\n	<div style=\"left: 503.283px; top: 708.065px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.02989);\">Tartaric Acid</div>\r\n	</li>\r\n	<li>\r\n	<div style=\"left: 180.033px; top: 793.265px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.00947);\">Vegetarian</div>\r\n\r\n	<div style=\"left: 180.033px; top: 860.265px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.996355);\">No added MSG</div>\r\n	</li>\r\n	<li>\r\n	<div style=\"left: 180.033px; top: 860.265px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.996355);\">Trans fat freeNo artificial flavouring&nbsp;Used as natural flavouring agent</div>\r\n	</li>\r\n</ul>\r\n\r\n<div style=\"left: 518.683px; top: 944.715px; font-size: 18.4px; font-family: sans-serif;\">The term &ldquo;Trans-fat free&rdquo; means where trans-</div>\r\n\r\n<div style=\"left: 524.683px; top: 944.715px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.946385);\">fat is less than 0.2 g per serving of food</div>\r\n\r\n<div style=\"left: 135.04px; top: 965.715px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.01712);\">[Regulation No. 2.2.2 (3) proviso 2, of The Indian Food Safety and Standards (Packaging</div>\r\n\r\n<div style=\"left: 866.367px; top: 986.715px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.988021);\">and Labeling) Regulation, 2011]. As per the globally accepted norm, serving size for</div>\r\n\r\n<div style=\"left: 155.44px; top: 1007.91px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.996467);\">namkeen is considered as 30g.</div>\r\n\r\n<p>&nbsp;</p>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '45', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
