(132, 'Kurkure Hyderabadi Hungama', 'kurkure-hyderabadi-hungama', '<table class=\"descr table\" style=\"height:264px; width:480px\">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n			<div style=\"left: 698.917px; top: 644.631px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.995092);\">Ingredients:</div>\r\n\r\n			<div style=\"left: 698.917px; top: 644.631px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(0.995092);\">Rice Meal, Edible Vegetable Oil, Corn Meal, Gram Meal, Salt,Sugar,Spices &amp;</div>\r\n\r\n			<div style=\"left: 278.233px; top: 708.065px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.0011);\">Condiments (Chilli Powder, Pepper Powder,Garlic Powder, Curry leaf powder,OnionPowder, TurmericPowder,FenugreekPowder, Mace Powder, Coriander powder, CinnamonPowder), Tomato Powder (0.5%), Citric Acid, Tartaric Acid.</div>\r\n			</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/kurkure-hyderabadi-hungama-v-50-g.png', 'https://www.raeesworld.com/img/uploads/kurkure-hyderabadi-hungama-v-50-g.png,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 0, '20', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>\r\n	<div style=\"left: 180.033px; top: 836.865px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.00947);\">Vegetarian</div>\r\n	</li>\r\n	<li>\r\n	<div style=\"left: 180.033px; top: 881.465px; font-size: 18.4px; font-family: sans-serif; transform: scaleX(1.00318);\">Trans fat free</div>\r\n	</li>\r\n	<li>No added MSG</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '45', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(133, 'Britannia Good Day Cookies - Rich Butter, 66 gm Pouch', 'britannia-good-day-cookies-rich-butter-66-gm-pouch', '<table class=\"descr table\" style=\"height:293px; width:447px\">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n			<div class=\"para1\">\r\n			<h2>the ALL NEW GOOD Day</h2>\r\n\r\n			<p><strong>It&rsquo;s a Smile that makes it a Good Day!</strong> The smaller joys of life that can brighten up one&rsquo;s life everyday often get ignored in the pursuit of larger joys. With its tagline of <strong>&ldquo;Har cookie mein kayi Smiles.&rdquo;</strong> Good Day will act as an enabler in enjoying all those small moments in everyday life!</p>\r\n\r\n			<p>In its brand new tastier avatar, Britannia Good Day brings alive its philosophy of <strong><em>Smiles</em></strong> through its new Logo, packaging and cookie, the New Good Day cookie comes with a smiley design on it as well!</p>\r\n			</div>\r\n			</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 10, NULL, 'https://www.raeesworld.com/img/uploads/item_XL_22941367_32149629.jpg', 'https://www.raeesworld.com/img/uploads/item_XL_22941367_32149629.jpg,https://www.raeesworld.com/img/uploads/263586_4-britannia-good-day-cookies-rich-butter.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '20', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '45', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(134, 'Britannia Bourbon Cream Biscuit - Chocolate Flavor', 'britannia-bourbon-cream-biscuit-chocolate-flavor', '<table class=\"descr table\" style=\"height:701px; width:534px\">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n			<div class=\"para1\">\r\n			<h2>Thoda aur chocaletey, thoda aur crunchy!</h2>\r\n\r\n			<p>Britannia Bourbon is all about showing off your wickedly smooth side. It has always been the chocolate lover&rsquo;s favourite guilt trip. One bite of this smooth, luscious chocolate cream enveloped in crunchy, sugary chocolate biscuit and the smooth operator in you will be unleashed!</p>\r\n			</div>\r\n			</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>\r\n			<h2>Bourbon Original</h2>\r\n\r\n			<div class=\"description mCustomScrollbar _mCS_2 mCS_no_scrollbar\" style=\"height: 719px; overflow-y: auto;\">\r\n			<div class=\"mCustomScrollBox mCS-britannia mCSB_vertical mCSB_inside\" id=\"mCSB_2\">\r\n			<div class=\"mCSB_container mCS_y_hidden mCS_no_scrollbar_y\" dir=\"ltr\" id=\"mCSB_2_container\" style=\"position:relative; top:0; left:0;\">\r\n			<div class=\"para2\">\r\n			<div id=\"temp2\">Smooth chocolate cream spread in between crunchy chocolate biscuits topped with sugar crystals, best relished in the company of your craziest, naughtiest friends, as you spend hours gossiping and planning your next trick. We have a Pocket Pack, a Hangout Pack and a Party Pack!</div>\r\n			</div>\r\n			</div>\r\n			</div>\r\n			</div>\r\n\r\n			<hr /></th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 10, NULL, 'https://www.raeesworld.com/img/uploads/bourbon-orgina700.jpg', 'https://www.raeesworld.com/img/uploads/bourbon-orgina700.jpg,https://www.raeesworld.com/img/uploads/530391356.jpg,https://www.raeesworld.com/img/uploads/bourbon-main__large.jpg,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '45', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(136, 'Parle Rusk', 'parle-rusk1', '<table class=\"descr table\" style=\"height:197px; width:76px\">\r\n	<tbody>\r\n		<tr>\r\n			<th>ParleRuskisa crunchy,crispy toast which is every family&rsquo;s teatime essential.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 40, NULL, 'https://www.raeesworld.com/img/uploads/51F+66Kf-XL.jpg', 'https://www.raeesworld.com/img/uploads/51F+66Kf-XL.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '45', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(137, 'Britania Fruit bar cake', 'britania-fruit-bar-cake', '<table class=\"descr table\" style=\"height:60px; width:572px\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Soft and delicious cake slices with the goodness of milk fruit and eggs. Available in six exciting flavours - Fruit, Chocolate , Orange, Milk, Butter and Pineapple.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/fruity-fun-cake.png', 'https://www.raeesworld.com/img/uploads/fruity-fun-cake.png,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>NON-VEGETARIAN</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '45', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(138, 'Lotte Choco - Pie', 'lotte-choco-pie', '<table class=\"descr table\" style=\"height:125px; width:583px\">\r\n	<tbody>\r\n		<tr>\r\n			<th>A <strong>choco pie</strong>&nbsp; is a <a href=\"https://en.wikipedia.org/wiki/Snack_cake\" title=\"Snack cake\">snack cake</a> consisting of two small round layers of cake with <a href=\"https://en.wikipedia.org/wiki/Marshmallow\" title=\"Marshmallow\">marshmallow</a> filling and a <a href=\"https://en.wikipedia.org/wiki/Chocolate\" title=\"Chocolate\">chocolate</a> covering. The term originated in America but is now also used in parts of Japan, South Korea and many other countries as either a brand name or a generic term. Names for similar confections in other places include chocolate marshmallow pie</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/4607084351385_1_2.jpg', 'https://www.raeesworld.com/img/uploads/4607084351385_1_2.jpg,https://www.raeesworld.com/img/uploads/512YYwM+JgL.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>vegetarian</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '45', '2', 0, 0, '', '', '', NULL, 0, 0, '', '');
