(139, 'Surf excel Bar', 'surf-excel-bar', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>As your child explores the world and learns different things, his clothes attract a lot of tough stains.<br />\r\n			To remove these tough stains you often need to use a host of other products.<br />\r\n			Now use New Surf excel Bar which has power of 4 stain removing products.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/surf_excel_bar_90_gm_rs_10-735653.jpg', 'https://www.raeesworld.com/img/uploads/surf_excel_bar_90_gm_rs_10-735653.jpg,https://www.raeesworld.com/img/uploads/41uaMwD4hGL.jpg,https://www.raeesworld.com/img/uploads/481555_1_jpgwidth600.jpeg,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Combines the cleaning benefits similar to that of vinegar, blue, bleach, and lemon</li>\r\n	<li>India&rsquo;s most premium detergent bar</li>\r\n	<li>Remove tough stains like tea, coffee, turmeric, curry, ketchup, and chocolate with just 1 product</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '47', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(140, 'Surf excel Liquid Detergent', 'surf-excel-liquid-detergent', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>How does Surf excel Liquid Detergent work?<br />\r\n			Surf excel Liquid Detergent works with the Dip Dab Drop formula. You don&rsquo;t have to scrub the shirt endlessly to remove the stains.<br />\r\n			Here&rsquo;s what you need to do:<br />\r\n			&bull; DIP &ndash; Take a capful of Surf excel Liquid. If you spot a tough stain, dip your finger in the liquid.<br />\r\n			&bull; DAB &ndash; Apply the liquid on the tough stain directly with your finger.<br />\r\n			&bull; DROP &ndash; Drop the remaining liquid into the bucket or into the top loading machine.<br />\r\n			&bull; WHISK &ndash; Whisk the water in the bucket. You will see that it foams as good as powder.<br />\r\n			Wash as usual.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/surf-excel-detergent-liquid-v-500-ml-1.png', 'https://www.raeesworld.com/img/uploads/surf-excel-detergent-liquid-v-500-ml-1.png,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '30', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>&nbsp;Better Dissolution</li>\r\n	<li>Colour Care</li>\r\n	<li>Faster Stain Removal</li>\r\n	<li>Safe for Hands</li>\r\n	<li>Superior Fragrance</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '47', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(141, 'Surf Excel Liquid Detergent - Matic, Top Load', 'surf-excel-liquid-detergent-matic-top-load', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Now remove tough stains in the machine in 3 easy steps:<br />\r\n			&bull; Step 1 : Pour some liquid on the tough stain<br />\r\n			&bull; Step 2 : Rub the stain with the revolutionary Stain Scrubber cap<br />\r\n			&bull; Step 3 : Pour the remaining liquid in the machine.<br />\r\n			The 7-layer deep penetration formula of Matic liquid works in partnership with the machine to give tough stain removal in the machine itself.<br />\r\n			Hurry up buy Surf Excel Matic Washing Machine Laundry Detergent Top Load 1 l, right here!</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/41Hwet2f-sL.jpg', 'https://www.raeesworld.com/img/uploads/41Hwet2f-sL.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '30', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Being liquid its best suited for washing machines and ensures a superior laundry experience and offers the following benefits:</li>\r\n	<li>FASTER STAIN REMOVAL: New Surf Excel Matic liquid with a powerful cleaning technology penetrates stains faster and removes tough stains in machines itself.</li>\r\n	<li>EASY &amp; BETTER DISSOLUTION:Being liquid it dissolves quickly in high water level environment of washing machines, reaches stains effortlessly and leaves no residue on clothes or in machines</li>\r\n	<li>SUPERIOR FRAGRANCE:It ensures that your clothes not only look fresh but also smell fresh while being safe on your hands.COLOUR CARE:It removes tough stains in machines but retains the original color of the fabric.</li>\r\n	<li>MACHINE CARE:Bring liquid it leaves no residue, causing no scaling and produces the right amount of foam</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '47', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(142, 'Surf excel Easy Wash', 'surf-excel-easy-wash', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>We understand that washing and removing stains can be extremely tiring and cumbersome.<br />\r\n			Especially if you are a mother of a young kid who fills your laundry basket with clothes covered in grass stains from football practice, ketchup stains from lunch and paint stains from art class!<br />\r\n			Till now you would have to soak his dirty clothes for a couple of hours and then scrub them with your hands using a brush and a bar, and wondered why it takes so much time to remove stains from your kid&rsquo;s clothes?<br />\r\n			The answer is because regular detergents do not dissolve completely.<br />\r\n			But with Surf excel Easy Wash, a superfine powder, tough stains will now be taken off in a jiffy.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/SURF-ESY-104.jpg', 'https://www.raeesworld.com/img/uploads/SURF-ESY-104.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '30', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Makes the powder superfine and fluffy so that it dissolves instantly</li>\r\n	<li>New Surf excel Easy Wash is made with a superior technology</li>\r\n	<li>Unleashes the Power of 10 Hands which remove tough stains like mud, ink, oil, chocolate very easily</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '47', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
