</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '47', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(144, 'Surf excel Quickwash', 'surf-excel-quickwash', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>While learning new skills and having fun, children often come home with a variety of stains on their clothes.<br />\r\n			To clean these difficult stains you have to put in extra effort and use additional stain removers.<br />\r\n			No more! New Surf excel Quickwash with X-tra clean particles combines the power of stain removing products like blue, bleach and lemon.<br />\r\n			Now you can remove multiple stains with just 1 product.<br />\r\n			Put your multiple stain worries to rest with Surf excel Quick Wash.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/615vZ0OoC5L__SX466_.jpg', 'https://www.raeesworld.com/img/uploads/615vZ0OoC5L__SX466_.jpg,https://www.raeesworld.com/img/uploads/Surf-Excel-Quick-Wash-Detergent-Powder-500gm.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '30', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>.</p>\r\n\r\n<ul>\r\n	<li>Combine the power of stain removing products like blue, bleach and lemon.</li>\r\n	<li>Great cleaning and multiple stain removal</li>\r\n	<li>Removes various stains like curry, mud, pickle, grease and link.</li>\r\n	<li>With extra cleaning particles, it makes for the perfect wash</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '47', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(145, 'Surf excel Matic Front Load', 'surf-excel-matic-front-load', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Surf excel matic has introduced a new and improved front load detergent that gives you a machine wash as good as your mom&rsquo;s hand wash.<br />\r\n			Its hand rub action power penetrates clothes and removes tough stains in the washing itself.<br />\r\n			This means no more soaking or scrubbing and saves up the time and effort you put behind everyday laundry.<br />\r\n			Just dump your clothes in the washing machine and leave the rest to Surf excel matic.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 250, NULL, 'https://www.raeesworld.com/img/uploads/Surf-Excel-Matic-Front-Load-SDL632915357-2-0a5fa.jpg', 'https://www.raeesworld.com/img/uploads/Surf-Excel-Matic-Front-Load-SDL632915357-2-0a5fa.jpg,https://www.raeesworld.com/img/uploads/61VGDFjhfmL__SX466_.jpg,https://www.raeesworld.com/img/uploads/71And5vl6XL__SL1500_.jpg,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '30', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Created to work in high water levels of front load washing machines</li>\r\n	<li>Its hand rub action power ensures, no more soaking &amp; scrubbing</li>\r\n	<li>It&rsquo;s low suds formula creates the right amount of foam that takes care of your expensive machine</li>\r\n	<li>Dissolves completely leaving no residue on clothes or in your machines</li>\r\n	<li>Recommended by 9 leading washing machine manufacturers</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '47', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(146, 'Surf excel Matic Top Load', 'surf-excel-matic-top-load', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Surf excel matic has introduced a new and improved top load detergent that gives you a machine wash as good as your mom&rsquo;s hand wash.<br />\r\n			Its hand rub action power penetrates clothes and removes tough stains in the washing itself.<br />\r\n			This means no more soaking or scrubbing and saves up the time and effort you put behind everyday laundry.<br />\r\n			Just dump your clothes in the washing machine and leave the rest to Surf excel matic.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/surf-excel-matic-top-load-v-2-kg-1.png', 'https://www.raeesworld.com/img/uploads/surf-excel-matic-top-load-v-2-kg-1.png,https://www.raeesworld.com/img/uploads/Surf-Excel-Matic-Top-Load-Washing-Powder-1000GM.jpg,https://www.raeesworld.com/img/uploads/266979-5_1-surf-excel-matic-top-load-detergent-powder.jpg,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '30', 'usually delivered in 2-3 days', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Created to work in high water level of top load washing machines</li>\r\n	<li>Its hand rub action power ensures, no more soaking &amp; scrubbing</li>\r\n	<li>Dissolves completely leaving no residue on your clothes or in your machines</li>\r\n	<li>Recommended by 9 leading washing machine manufacturers</li>\r\n	<li>Value for money (1 scoop of Surf excel matic = 2 scoops of regular hand wash detergent*)</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '47', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(147, 'Extra Moisturizing Baby Wash', 'extra-moisturizing-baby-wash', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya <strong>Extra Moisturizing Baby Wash</strong> is designed to effectively cleanse baby&rsquo;s skin and bring softness. Indian Aloe, Almond Oil, and Olive Oil work together to nourish and maintain the moisture balance of baby&rsquo;s skin. Milk softens and improves the skin&rsquo;s texture. Ideal for use during winter, Extra Moisturizing Baby Wash is free from artificial colors.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/extra-moisturizing-baby-wash.jpg', 'https://www.raeesworld.com/img/uploads/extra-moisturizing-baby-wash.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Himalaya Extra Moisturizing Baby Wash is a head-to-heel wash which hydrates, moisturizes and brings softness to baby&rsquo;s skin.</li>\r\n	<li><strong>Olive Oil</strong>, enriched with Vitamin E, nourishes, protects, and softens skin, preventing chafing. It has soothing properties, which help keep baby&rsquo;s skin healthy and soft.</li>\r\n	<li>\r\n	<p><strong>Almond Oil</strong> is an excellent skin softener, which moisturizes baby&rsquo;s skin.<strong>Indian Lotus</strong> contains natural skin-conditioning agents, which keep baby&#39;s skin soft and supple.<strong>Milk</strong> nourishes, softens, and moisturizes baby&rsquo;s skin.</p>\r\n\r\n	<div class=\"si-share clearfix\">\r\n	<div class=\"at-share-tbx-element  addthis-smartlayers addthis-animated at4-show\" id=\"atstbx\">&nbsp;\r\n	<div class=\"at-share-btn-elements\">&nbsp;</div>\r\n	</div>\r\n	</div>\r\n	</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(148, 'Baby Massage Oil', 'baby-massage-oil', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>A daily massage with Himalaya&#39;s <strong>Baby Massage Oil</strong> helps in improving baby&#39;s growth and development. Infused with Olive Oil and Winter Cherry, Baby Massage Oil is clinically proven to be mild enough to use on babies. It is a light and non-staining oil which can be used before bathing as a massage oil as also for moisturizing after bathing.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/baby-massage-oil.jpg', 'https://www.raeesworld.com/img/uploads/baby-massage-oil.jpg,https://www.raeesworld.com/img/uploads/71yVlJUjS6L__SY879_.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Vegetable-based massage oil</li>\r\n	<li>Free from Mineral Oil and Lanolin</li>\r\n	<li><strong>Olive Oil</strong>, enriched with Vitamin E, nourishes, protects and softens baby&#39;s skin. It has soothing and antimicrobial properties, which ensures that baby&#39;s skin is healthy and lustrous. It also strengthens your little one&#39;s nails and softens cuticles.</li>\r\n	<li><strong>Winter Cherry</strong> improves skin tone and soothes baby&#39;s skin.</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 0, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(149, 'Refreshing Baby Wash', 'refreshing-baby-wash', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya <strong>Refreshing Baby Wash</strong> has cooling, refreshing, antibacterial, and anti-inflammatory properties, which effectively help manage prickly heat rashes and excessive sweating in babies. Our baby wash contains Watermelon and Champaca that cool, condition, and refresh the skin, while Neem&rsquo;s antibacterial properties prevent skin ailments. Ideal for use during the summer, Himalaya Refreshing Baby Wash is free from artificial colors.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/refreshing-baby-wash.jpg', 'https://www.raeesworld.com/img/uploads/refreshing-baby-wash.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>A head-to-heel wash which has cooling, refreshing, and antibacterial action, Himalaya Refreshing Baby Wash helps to prevent prickly heat in babies.</li>\r\n	<li><strong>Watermelon</strong> and <strong>Lemon Oil</strong> keep baby&#39;s skin cool and fresh</li>\r\n	<li><strong>Champaca</strong>, with its cooling and skin-conditioning properties, helps keep baby&#39;s skin moisturized and fresh.</li>\r\n	<li><strong>Neem</strong>, a revered herb in Ayurveda, has antibacterial and anti-inflammatory properties, and is beneficial in preventing skin infections.</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(150, 'Gentle Baby Bath', 'gentle-baby-bath', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya&#39;s <strong>Gentle Baby Bath</strong> is unique by its natural formulation, infused with the goodness of Chickpea, Fenugreek and Green Gram which cleanses your newborn&rsquo;s skin, gently.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/29204a.jpg', 'https://www.raeesworld.com/img/uploads/29204a.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 0, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Soap-free formula to gently cleanse newborn&rsquo;s skin</li>\r\n	<li>Soothing cleanser for baby&rsquo;s delicate skin</li>\r\n	<li>For mild and gentle bath from the first day</li>\r\n	<li>Nourishes and helps condition hair</li>\r\n	<li><strong>Fenugreek</strong>, traditionally used in Ayurvedic medicines, is an excellent moisturizer, especially beneficial in hydrating baby&#39;s dry skin.</li>\r\n	<li><strong>Green Gram</strong> makes baby&#39;s skin soft and supple. It removes dirt without causing any irritation</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(151, 'Gentle Baby Soap', 'gentle-baby-soap', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya&#39;s <strong>Gentle Baby Soap</strong> is formulated to effectively cleanse and condition your baby&#39;s skin gently, leaving it soft and hydrated. The natural goodness of Olive Oil and Almond Oil, rich in vitamins, are infused into our Gentle Baby Soap to ensure healthy and glowing skin. Ideal for daily use, Gentle Baby Soap is free from artificial colours.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/51.png', 'https://www.raeesworld.com/img/uploads/51.png,https://www.raeesworld.com/img/uploads/164353a.jpg,https://www.raeesworld.com/img/uploads/613Hmv2LoSL__SL1124_.jpg,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Free from Parabens, SLS/SLES*, and Synthetic Colors</li>\r\n	<li><strong>Olive Oil</strong>, enriched with Vitamin E, nourishes, protects and softens skin, preventing chafing. It has soothing properties, which keep baby&#39;s skin healthy and soft.</li>\r\n	<li><strong>Almond Oil</strong> is an excellent skin softener, which moisturizes baby&#39;s skin.</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(152, 'Refreshing Baby Soap', 'refreshing-baby-soap', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya&#39;s <strong>Refreshing Baby Soap</strong> has cooling, refreshing, antibacterial and anti-inflammatory properties, effectively helping to manage prickly heat in babies. It contains Watermelon that cools, Khus-Khus to soothe and refresh the skin while Neem&rsquo;s antibacterial properties prevent skin ailments. Ideal for use during the summer, Refreshing Baby Soap is free from artificial colours.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/himalaya_refreshing_baby_soap_125g.jpg', 'https://www.raeesworld.com/img/uploads/himalaya_refreshing_baby_soap_125g.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Ideal for oily skin</li>\r\n	<li>Free from Parabens, SLS/SLES*, and Synthetic Colors</li>\r\n	<li>Protects baby&rsquo;s skin</li>\r\n	<li>Helps manage itching and heal rashes</li>\r\n	<li>Helps reduce skin inflammation</li>\r\n	<li>Helps manage itching and rashes</li>\r\n	<li>Provides cooling and refreshing effects</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(153, 'Extra Moisturizing Baby Soap', 'extra-moisturizing-baby-soap', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n			<div class=\"tab-container\">\r\n			<div class=\"at-share-tbx-element  addthis-smartlayers addthis-animated at4-show\" id=\"atstbx\">Himalaya&#39;s <strong>Extra Moisturizing Baby Soap</strong> is designed to effectively manage infantile xerosis or excessive dry skin in babies. Indian Aloe, Almond Oil and Olive Oil work together to nourish and maintain the moisture equilibrium of baby&#39;s skin. Milk softens and improves the skin&rsquo;s texture. Ideal for use during the winter, Extra Moisturizing Baby Soap is free from artificial colours.\r\n			<div class=\"at-share-btn-elements\">&nbsp;</div>\r\n			</div>\r\n			</div>\r\n			</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/925754735s.jpeg', 'https://www.raeesworld.com/img/uploads/925754735s.jpeg,https://www.raeesworld.com/img/uploads/Himalaya-Extra-Moisturizing-Baby-Soap-125g-1.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li><strong>Olive Oil</strong>, enriched with Vitamin E, nourishes, protects and softens skin, preventing chafing. It has soothing properties, which keep baby&#39;s skin healthy and soft.</li>\r\n	<li><strong>Almond Oil</strong> is an excellent skin softener and moisturizer for baby&#39;s skin.</li>\r\n	<li>Possess skin conditioning, emollient, and soothing properties, and keeps skin soft and supple.</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(154, 'Nourishing Baby Soap', 'nourishing-baby-soap', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya&#39;s <strong>Nourishing Baby Soap</strong> is a herbal formulation, especially developed for baby&#39;s sensitive skin. It contains natural emollients like Honey, Sunflower, Castor Oil and Milk that moisturize baby&rsquo;s skin, reducing itching and inflammation. Ideal for use during the monsoon season, Nourishing Baby Soap is free from artificial colours.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/113.jpg', 'https://www.raeesworld.com/img/uploads/113.jpg,https://www.raeesworld.com/img/uploads/d1c08bdd1c3faf468fb0808d96cd902d.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>&nbsp; &nbsp;</p>\r\n\r\n<ul>\r\n	<li>Free from Parabens, SLS/SLES*, and Synthetic Colortur</li>\r\n	<li>Helps retain moisture in the skin and acts as an occlusive</li>\r\n	<li>Moisturizes baby&rsquo;s skin and helps maintain normal skin hydration</li>\r\n	<li><strong>Castor Oil</strong> helps reduce itching, rashes and skin inflammation</li>\r\n	<li>Cleanses, nourishes, and moisturizes baby&#39;s skin to make it soft and supple</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(155, 'Gentle Baby Shampoo', 'gentle-baby-shampoo', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya&#39;s <strong>Gentle Baby Shampoo</strong> formulation is a mild, &quot;no tears&quot; shampoo. It softens, nourishes and improves your baby&#39;s hair lustre, leaving it soft and fresh.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/29.jpg', 'https://www.raeesworld.com/img/uploads/29.jpg,https://www.raeesworld.com/img/uploads/61w3ggVQzoL__SY879_.jpg,https://www.raeesworld.com/img/uploads/29204a1.jpg,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Cleanses, conditions, softens, and nourishes hair</li>\r\n	<li><strong>Chickpea</strong>, a natural source of protein, effectively nourishes hair, making it healthy and shiny</li>\r\n	<li>Moisturizes baby&rsquo;s hair and helps in hair conditioning</li>\r\n	<li><strong>Khus-Khus</strong>, with its antibacterial and antifungal properties, cools baby&#39;s scalp.</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(156, 'Baby Cream', 'baby-cream', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya&#39;s <strong>Baby Cream</strong> is specially formulated to protect your little one&#39;s chapped cheeks, &#39;crawler&#39;s knee&#39;, tender nose and rubbed elbows. Our Baby Cream also offers protection against irritating wetness and windburn. The key ingredients work specially to not only moisturize baby&#39;s skin but also preserve its natural softness.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/baby-cream.jpg', 'https://www.raeesworld.com/img/uploads/baby-cream.jpg,https://www.raeesworld.com/img/uploads/him0074.jpg,https://www.raeesworld.com/img/uploads/him0541.jpg,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Specially formulated to soothe and protect baby&rsquo;s dry skin</li>\r\n	<li>Effective for dry and scaly skin</li>\r\n	<li>Free from Parabens, Mineral Oil, and Synthetic Colors</li>\r\n	<li><strong>Olive Oil</strong>, enriched with Vitamin E, nourishes, protects and softens skin and prevents chafing. It has soothing properties, which keeps baby&#39;s skin healthy and soft.</li>\r\n	<li>Helps protect baby&rsquo;s skin due to its skin conditioning and antioxidant properties</li>\r\n	<li><strong>Licorice</strong> protects and soothes baby&#39;s skin</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(157, 'Diaper Rash Cream', 'diaper-rash-cream', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya&#39;s <strong>Diaper Rash Cream</strong> while promoting effective healing, soothes red and irritated skin, and forms a protective layer on baby&#39;s skin.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/46.jpg', 'https://www.raeesworld.com/img/uploads/46.jpg,https://www.raeesworld.com/img/uploads/4_1.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Effective for the treatment and management of diaper rashes</li>\r\n	<li>Treats rashes and relieves redness and irritation naturally</li>\r\n	<li>Keeps baby&rsquo;s skin soft and comfortable</li>\r\n	<li>Protects skin from infections</li>\r\n	<li>Reduces skin inflammation and helps heal diaper rashes</li>\r\n	<li>Soothes skin and reduces irritation</li>\r\n	<li><strong>Almond Oil</strong> is an excellent skin softener, which moisturizes baby&rsquo;s skin</li>\r\n	<li><strong>Aloe Vera</strong> is used extensively in Ayurveda for wounds, burns, dermatitis and other skin ailments. It soothes and moisturizes baby&#39;s skin. It acts as an antibacterial agent and an astringent, which accelerates the healing of baby&#39;s skin.</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(158, 'Baby Lotion', 'baby-lotion', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya&#39;s <strong>Baby Lotion</strong> helps keep baby&#39;s skin soft and supple, protecting it from infection. Baby Lotion is made from natural ingredients that help moisturize delicate skin, leaving it soft all day long. Our Baby Lotion is clinically proven to be mild and gentle enough for newborns as well.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/baby-lotion.jpg', 'https://www.raeesworld.com/img/uploads/baby-lotion.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>\r\n	<p><strong>Almond Oil</strong> is an excellent skin softener, which moisturizes baby&#39;s skin.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Licorice</strong> protects and soothes baby&#39;s skin.</p>\r\n	</li>\r\n	<li>Keeps baby&#39;s skin healthy and smooth</li>\r\n	<li>Helps protect skin due to its antioxidant property</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(159, 'Himalaya Soothing Calamine Baby Lotion', 'himalaya-soothing-calamine-baby-lotion', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>Himalaya <strong>Soothing Calamine Baby Lotion</strong> is an herbal formulation that protects baby&rsquo;s skin from itching and rashes due to allergic reactions, insect bites, chicken pox, or prickly heat. Infused with the goodness of Aloe Vera and the soothing touch of Calamine, our baby lotion provides relief from itching right from day one by accelerating the skin&rsquo;s healing.</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/himalaya-soothing-calamine-baby-lotion.jpg', 'https://www.raeesworld.com/img/uploads/himalaya-soothing-calamine-baby-lotion.jpg,https://www.raeesworld.com/img/uploads/2035440a.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Himalaya Soothing Calamine Baby Lotion is useful in the effective management of prickly heat, hives, insect bites and itching due to multiple skin conditions in babies.</li>\r\n	<li><strong>Calamine</strong> helps heal wounds and soothes skin rashes</li>\r\n	<li><strong>Nutgrass</strong> possesses antimicrobial and anti-inflammatory properties.</li>\r\n	<li><strong>Aloe Vera</strong> acts as an antibacterial agent and an astringent, which accelerate the healing of baby&#39;s skin.</li>\r\n	<li><strong>Mustard</strong> is widely used in the management of skin disorders</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(160, 'Baby Powder', 'baby-powder', '<table class=\"descr table\">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n			<div class=\"tab-content clearfix ui-tabs-panel ui-widget-content ui-corner-bottom\" id=\"tabs-1\">\r\n			<p>Himalaya&#39;s <strong>Baby Powder</strong> eliminates dryness and keeps baby&#39;s skin cool and comfortable.</p>\r\n\r\n			<p><strong>Benefits:</strong></p>\r\n\r\n			<ul>\r\n				<li>Helps manage excess sweating and body odor</li>\r\n				<li>Powder containing herbal actives</li>\r\n				<li>Effective and safe</li>\r\n				<li>Free from Parabens, Phthalates, and Synthetic Colors</li>\r\n			</ul>\r\n			</div>\r\n			</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/53500a.jpg', 'https://www.raeesworld.com/img/uploads/53500a.jpg,https://www.raeesworld.com/img/uploads/himalaya_baby_powder_50g.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 2-3 days', '', 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li><strong>Olive Oil</strong>, enriched with Vitamin E, nourishes, protects and softens skin and prevents chafing. It has soothing properties, which keep baby&#39;s skin healthy and soft.</li>\r\n	<li><strong>Almond Oil</strong> is an excellent skin softener, which moisturizes baby&#39;s skin</li>\r\n	<li>Helps manage excessive sweating due to its astringent property</li>\r\n	<li>Keeps baby&rsquo;s skin cool and fresh</li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '50', '2', 0, 0, '', '', '', NULL, 0, 0, '', '');
