(181, 'Wild Stone Perfume - Red, 100 ml ', 'wild-stone-perfume-red-100-ml', '<p><span style=\"font-size:16px\"><span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">The fragrances for Wild Stone perfumes are unique, sophisticated and are especially developed by renowned perfumeries in France, keeping in mind the sensibilities of emerging youth. A scent signature that celebrates the casual yet intriguing soul of a Wild Stone man&nbsp;</span></span></p>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/100-red-perfume-perfume-wild-stone-men-original-imaeuwfzf8hsj8fh.jpeg', 'https://www.raeesworld.com/img/uploads/100-red-perfume-perfume-wild-stone-men-original-imaeuwfzf8hsj8fh.jpeg,https://www.raeesworld.com/img/uploads/Red_02.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 20, 2, '1', '20', 1, '40', 'Usually delivered in 4-7 days.', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '57', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
(182, 'Axe Signature Perfume - Body, Maverick, Signature, 122 ml ', 'axe-signature-perfume-body-maverick-signature-122-ml', '<p><span style=\"font-size:16px\"><span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">For the free-spirited man who lives by his own rules, Axe brings to you Axe Signature Maverick. A novel, exotic and engaging fragrance to help you unleash your free-spirited side. An invigorating burst of freshness from citrus, basil and lavender evolving into spicy multifaceted notes makes for a distinct fragrance which will help you stand out from the rest.&nbsp;</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">The Axe Signature range of body perfumes is inspired by the finest fragrances the world has to offer. These fragrances are stronger, last longer and chisels out your persona whenever you need to take the centre stage. It is the perfect accomplice for all your endeavours. So be it at a party, a business meeting or a date, while others will be merely good, you will strike an impression that wont fade away.&nbsp;</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">Making an impression is easier with the Axe Signature range. The key is to know how to wear it. To amplify the effect of Axe Signature, apply it on your pulse points. The heat generated by your pulse intensifies the fragrance and assures your impression wont fade away.&nbsp;</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">We pride ourselves as the creators of irresistible fragrances. Fragrances that not only smell good but also keep you fresh, clean, charming and confident. You are sure to tempt everyone with a fragrance that is long-lasting and enriching. The packaging is extremely elegant. Your dear ones would be delighted to get a scent which offers such a mesmerizing scent. One of the best scents from Axe that is perfect for those who love strong and distinct fragrances. This scent offers lasting protection that goes on from the party, to after party, to after the after party. Ready to take on the world by storm with this rich mesmerizing scent?</span></span></p>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/1_(1)2.jpg', 'https://www.raeesworld.com/img/uploads/1_(1)2.jpg,https://www.raeesworld.com/img/uploads/Axe-Signature-Maverick-Body-Perfume-SDL383919837-1-414cc.jpg,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '40', 'Usually delivered in 4-7 days.', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '57', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
