(190, 'Axe Signature Gold Black Musk & Cedar Wood Perfume, 80 ml ', 'axe-signature-gold-black-musk-cedar-wood-perfume-80-ml', '<p><span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">An intense and woody fragrance, the New Axe Signature Black Musk and Cedar Wood for men is a Eau De Toilette made with premium classy ingredients. Its an invigorating scent crafted with traditional Musk and distinctive Cedar Wood. Fragrance made with unique ingredients to bring out whats unique in you. Its scent will linger on and leave a memorable impression wherever you go. It comes in a classy black glass bottle with a masculine design. Strike an impression wherever you go - be it to the club or on a date or to the office.&nbsp;</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">We pride ourselves as the creators of irresistible fragrances. Fragrances that not only smell good but also keep you fresh, clean, charming and confident. You are sure to tempt everyone with a fragrance that is long lasting and enriching. The packaging is extremely elegant. Your dear ones would be delighted to get a scent which offers such a mesmerizing scent. One of the best scents from Axe that is perfect for those who love strong and distinct fragrances. This scent offers lasting protection that goes on from party, to after party, to after the after party. Ready to take on the world by storm with this rich mesmerizing scent? Buy Now!</span><br />\r\n<br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">Features and Benefits:</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; New AXE ultra premium perfume</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Eau De Toilette</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Show your unique ingredients with seductive dark vanilla &amp; a royal touch of Oud wood</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Fragrance family: Warm</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Key ingredients: Dark vanilla &amp; Oud Wood</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Safe on skin</span><br />\r\n&nbsp;</p>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/axe-signature-gold-black-musk-and-cedar-wood-perfume-80-ml_2_display_1474286315_81296fe3.jpg', 'https://www.raeesworld.com/img/uploads/axe-signature-gold-black-musk-and-cedar-wood-perfume-80-ml_2_display_1474286315_81296fe3.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '40', 'Usually delivered in 4-7 days.', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '57', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
