el every time you use this deodorant.</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Safe on skin</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Keeps body odour away</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Keeps you fresh and clean</span><br />\r\n<span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">&bull; Long-lasting Protection</span></span></p>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/61L5RM2kELL__SX466_.jpg', 'https://www.raeesworld.com/img/uploads/61L5RM2kELL__SX466_.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '40', 'Usually delivered in 4-7 days.', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '57', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
