(194, 'Whisper Sanitary Pads - XL Plus Wings, Ultra, 15 pcs ', 'whisper-sanitary-pads-xl-plus-wings-ultra-15-pcs', '<p><span style=\"font-size:16px\"><span style=\"background-color:rgb(255, 255, 255); color:rgb(68, 68, 68); font-family:proximanova-regular\">It is about living your life by your own rules despite what society says. It is about choosing for yourself, every day of the month. This revolutionary product Whisper Ultra Clean XL+ has odour lock gel that locks up to 100% wetness and even odour and gives you the freedom to live life by your own rules, even during periods. Because its Meri life, mere rules.</span><span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"//www.youtube.com/embed/G5i0MqeMCWk\" width=\"640\"></iframe></span></span></p>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/Whisper_Ultra_Clean_XL_Wings_15_pad.jpg', 'https://www.raeesworld.com/img/uploads/Whisper_Ultra_Clean_XL_Wings_15_pad.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '40', 'Usually delivered in 4-7 days.', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '56', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
