(196, 'Whisper Sanitary Pads - XL Plus, Ultra Soft, 30 pcs ', 'whisper-sanitary-pads-xl-plus-ultra-soft-30-pcs', '<p><span style=\"font-size:16px\"><span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">It feels comfortable with Whisper Ultra Soft sanitary pads with wings for extra gentleness on your skin, Whisper Ultra Soft pads are two times softer and contain a soft top sheet in both the center and wings. With Whisper Ultra Soft pads, your skin will get all the care it needs and you will get all the confidence you deserve. These pads are nearly 40% longer and have soft pores that drive liquid to the core and lock it away, so you have extra coverage and long-lasting protection. The stretchable wings in Whisper Ultra Soft pads wrap around your panties to keep the pad in place, while the fresh odourless pearls capture and lock away period odour. Whisper Choice Wings vs. Whisper Choice Ultra.</span></span></p>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/15355348361.jpg', 'https://www.raeesworld.com/img/uploads/15355348361.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '40', 'Usually delivered in 4-7 days.', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"//www.youtube.com/embed/J6dMciXqhaA\" width=\"640\"></iframe></p>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '56', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
