(204, 'Pedigree Dry Dog Food - Chicken & Milk, for Puppy', 'pedigree-dry-dog-food-chicken-milk-for-puppy', '<p><span style=\"font-size:16px\"><span style=\"color:rgb(68, 68, 68); font-family:proximanova-regular\">Pedigree is a complete and balanced food for your dog. Made with high quality ingredients, Pedigree provides dogs the 5 Signs of Good Health - healthy skin and coat, strong bones and teeth, healthy digestive system, strong muscles and stronger immune system. It contains 22.8% crude protein, 10% crude fat, and 5% crude fiber. It also contains the optimal blend of Omega-6 and Zinc, which are proven to provide a healthier and shinier coat to young adult dogs. Pedigree dog food is suited for all dog breeds from Pugs, Beagle to Labrador, Golden Retriever &amp; German shepherd.</span></span></p>\r\n', '', '', 'Not Refundable', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/Pedigree-Puppy-Dog-Food-Chicken-SDL342092753-1-74715.jpg', 'https://www.raeesworld.com/img/uploads/Pedigree-Puppy-Dog-Food-Chicken-SDL342092753-1-74715.jpg,,,,,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 100, 1, '0', '', 1, '40', 'Usually delivered in 4-7 days.', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '59', '2', 0, 0, '', '', '', NULL, 0, 0, '', ''),
