aging</a></span></td>\r\n			<td style=\"vertical-align:middle\"><span style=\"font-size:12px\">SMS(threaded view), MMS, Email, Push Email, IM</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:110px\"><span style=\"font-size:12px\"><a href=\"https://www.gsmarena.com/glossary.php3?term=browser\" style=\"color: rgb(85, 85, 85); box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-decoration-line: none;\">Browser</a></span></td>\r\n			<td style=\"vertical-align:middle\"><span style=\"font-size:12px\">HTML5</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:110px\">&nbsp;</td>\r\n			<td style=\"vertical-align:middle\"><span style=\"font-size:12px\">- Samsung DeX (desktop experience support)<br />\r\n			- Fast battery charging (Quick Charge 2.0)<br />\r\n			- Qi/PMA wireless charging (market dependent)<br />\r\n			- ANT+ support<br />\r\n			- Bixby natural language commands and dictation<br />\r\n			- MP4/DivX/XviD/H.265 player<br />\r\n			- MP3/WAV/eAAC+/FLAC player<br />\r\n			- Photo/video editor<br />\r\n			- Document editor</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellspacing=\"0\" style=\"background-color:rgb(255, 255, 255); border-bottom-color:initial; border-bottom-style:initial; border-image:initial; border-left-color:initial; border-left-style:initial; border-right-color:initial; border-right-style:initial; border-top-color:rgb(227, 227, 227); border-top-style:solid; border-width:1px 0px 0px; box-sizing:border-box; color:rgb(0, 0, 0); font-family:arimo,arial,sans-serif; font-size:16px; font-stretch:inherit; font-variant-east-asian:inherit; font-variant-numeric:inherit; line-height:inherit; margin:0px; padding:0px; vertical-align:baseline; width:726.4px\">\r\n	<tbody>\r\n		<tr>\r\n			<th rowspan=\"7\" scope=\"row\" style=\"text-align:left; vertical-align:top; width:86px\"><span style=\"font-size:12px\">BATTERY</span></th>\r\n			<td style=\"vertical-align:top; width:110px\">&nbsp;</td>\r\n			<td style=\"vertical-align:middle\"><span style=\"font-size:12px\">Non-removable Li-Ion 3500 mAh battery (13.48 Wh)</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', 'This item can\'t be returned to RaeesWorld, if the item is \"No longer needed\". In case of product issues, you may qualify for a replacement.\r\n\r\n<ui><li>\r\nIn general, an item may be eligible for return within the applicable return window if it fulfils one or more of the following conditions:\r\n    <li>Was delivered in a physically damaged condition\r\n    <li>Has missing parts or accessories\r\n    <li>Is different from what was ordered\r\n\r\n    <ui><li>Products marked as \"non-returnable\" on the product detail page cannot be returned.\r\n\r\n<ui><li>\r\nAll items must be returned in their original condition, with price tags intact, user manual, warranty cards, original accessories and in the original manufacturers box/packaging as delivered to you. Refer to instructions to return items against each category. We may reject the return pickup if the items are not returned according to the policy mentioned against each category.\r\n\r\n<ui><li>\r\nIn some cases, items may not be eligible for return, including cases of buyer\'s remorse such as incorrect model or color of product ordered or incorrect product ordered.\r\n', '', NULL, NULL, '3', 72000, NULL, 'https://www.raeesworld.com/img/uploads/11.jpeg', 'https://www.raeesworld.com/img/uploads/11.jpeg,https://www.raeesworld.com/img/uploads/21.jpeg,https://www.raeesworld.com/img/uploads/31.jpeg,https://www.raeesworld.com/img/uploads/41.jpeg,https://www.raeesworld.com/img/uploads/5.jpeg,,,,,,', NULL, NULL, 1, 0, NULL, NULL, '', '', '', 10, 1, '0', '', 1, '', 'Usually delivered in 4-7 days.', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">Corning Gorilla Glass 5</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">Exynos 9810 Octa (10 nm) - EMEA</span><br />\r\n	<span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">Qualcomm SDM845 Snapdragon 845 (10 nm)</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">Dual Camera-&nbsp; 12 MP, f/1.5-2.4, 26mm (wide), 1/2.55&quot;, 1.4&micro;m, Dual Pixel PDAF, OIS</span><br />\r\n	<span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;12 MP, f/2.4, 52mm (telephoto), 1/3.6&quot;, 1.0&micro;m, AF, OIS, 2x optical zoom</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">GPS with&nbsp;A-GPS, GLONASS, BDS, GALILEO</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">USB&nbsp;3.1, Type-C 1.0 reversible connector</span></span></li>\r\n	<li><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">Scanner- Iris scanner, fingerprint (rear-mounted), accelerometer,&nbsp;</span></span><span style=\"font-size:12px\"><span style=\"color:rgb(0, 0, 0); font-family:arimo,arial\">gyro, proximity, compass, barometer, heart rate, SpO2</span></span></li>\r\n</ul>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '83', '5', 0, 0, '', '', '', NULL, 0, 0, '', '');
