(246, 'men\'s adidas RUNNING CITY RUN PRIMEKNIT JACKET', 'mens-adidas-running-city-run-primeknit-jacket', '', '', '', 'Refundable in 8 days', '', NULL, NULL, '', 0, NULL, 'https://www.raeesworld.com/img/uploads/MEN_RUNNING_JACKET_BP6817_1_jpg_.jpeg', 'https://www.raeesworld.com/img/uploads/MEN_RUNNING_JACKET_BP6817_1_jpg_.jpeg,https://www.raeesworld.com/img/uploads/MEN_RUNNING_JACKET_BP6817_2_jpg_.jpeg,https://www.raeesworld.com/img/uploads/MEN_RUNNING_JACKET_BP6817_3_jpg_.jpeg,https://www.raeesworld.com/img/uploads/MEN_RUNNING_JACKET_BP6817_4_jpg_.jpeg,https://www.raeesworld.com/img/uploads/MEN_RUNNING_JACKET_BP6817_5_jpg_.jpeg,https://www.raeesworld.com/img/uploads/MEN_RUNNING_JACKET_BP6817_6_jpg_.jpeg,,,,,', NULL, NULL, 1, 0, NULL, '{\"gender\":[\"Male\"]}', '', '', '', 100, 1, '0', '', 1, '', 'usually delivered in 4-7 days', '', 12, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<div class=\"productBullets\" id=\"productBullets\">\r\n<ul>\r\n	<li>Available in Blue Night and Mystery Petrol</li>\r\n	<li>Made of 47% Polyester, 33% Wool and 20% Tencel</li>\r\n	<li>Breathable, flexible adidas Primeknit for seamless comfort and fit</li>\r\n	<li>Side seam pockets; Vertical zip pockets on left chest</li>\r\n	<li>Full zip with hood</li>\r\n	<li>Raglan sleeves</li>\r\n	<li>Ribbing on shoulders and elbows; Ribbed cuffs and hem</li>\r\n	<li>Reflective details</li>\r\n	<li>Regular fit</li>\r\n</ul>\r\n</div>\r\n', 0, 0, NULL, NULL, NULL, 0, 0, 0, 1, 0, 0, 0, '111', '1', 0, 0, '', '[{\"sizes\":\"XXL\",\"price\":\"9999\",\"qty\":\"100\"}]', '', NULL, 0, 0, '', ''),
